INSERT INTO task VALUES (42,'test11','#include \"stdio.h\"\r\n\r\nint board[8][8] = {0};\r\n/* (x,y),xoffest,yoffset(x,y)*/\r\nint legalDirect(int x, int y, int xoffest, int yoffset, int flag)\r\n{\r\n	x += xoffest;\r\n	y += yoffset;\r\n	if (x < 0 || x >= 8 || y < 0 || y >= 8)// \r\n	{\r\n		return 0;\r\n	}\r\n	if (board[x][y] == 2)\r\n	{\r\n		/* (x,y),\r\n		*  ,\r\n		*/\r\n		flag = 1;\r\n		return legalDirect(x, y, xoffest, yoffset, flag);\r\n	}\r\n	else if (board[x][y] == 1)\r\n	{\r\n		/* , legal=1*/\r\n		if (flag == 1)\r\n		{\r\n			return 1;\r\n		}\r\n		return 0;\r\n	}\r\n	else\r\n		return 0;\r\n\r\n	return 0;\r\n}\r\n\r\n/* , 0, 1*/\r\nint legal(int x, int y)\r\n{\r\n	if (board[x][y]!=0)// \r\n		return 0;\r\n	int i, j, flag;\r\n	/* (x,y)*/\r\n	for (i = -1; i <= 1; i++)\r\n	{\r\n		for (j = -1; j <= 1; j++)\r\n		{\r\n			if (i == 0 && j == 0)// (x,y)\r\n			{\r\n				continue;\r\n			}\r\n			flag = 0;\r\n			if (legalDirect(x, y, i, j, flag))\r\n			{\r\n				return 1;\r\n			}\r\n		}\r\n	}\r\n	return 0;\r\n}\r\n\r\n    int main()\r\n	{\r\n		int i =0;\r\n		int j =0;\r\n	\r\n	for(i=0;i<8;i++)\r\n		for(j=0;j<8;j++)\r\n		{\r\n		scanf(\"%d\",&board[i][j]);\r\n		}\r\n	\r\n		for(j=0;j<8;j++)\r\n				for(i=0;i<8;i++)\r\n		{\r\n		if(legal(i,j))\r\n		{\r\n			printf(\"%d %d\\n\",i,j);\r\n		return 1;\r\n		}\r\n		}\r\n}','compile correct','gcc','othello','2012-11-30 00:34:51','');
