INSERT INTO task VALUES (105,'oceantears','#include <stdio.h>\r\n\r\nint board[8][8] = {0};\r\n/* (x,y),xoffest,yoffset(x,y)*/\r\nint legalDirect(int x, int y, int xoffest, int yoffset, int flag)\r\n{\r\n	x += xoffest;\r\n	y += yoffset;\r\n	if (x < 0 || x >= 8 || y < 0 || y >= 8)// \r\n	{\r\n		return 0;\r\n	}\r\n	if (board[x][y] == 2)\r\n	{\r\n		/* (x,y),\r\n		*  ,\r\n		*/\r\n		flag = 1;\r\n		return legalDirect(x, y, xoffest, yoffset, flag);\r\n	}\r\n	else if (board[x][y] == 1)\r\n	{\r\n		/* , legal=1*/\r\n		if (flag == 1)\r\n		{\r\n			return 1;\r\n		}\r\n		return 0;\r\n	}\r\n	else\r\n		return 0;\r\n\r\n	return 0;\r\n}\r\n\r\n/* , 0, 1*/\r\nint legal(int x, int y)\r\n{\r\n	if (board[x][y]!=0)// \r\n		return 0;\r\n	int i, j, flag;\r\n	/* (x,y)*/\r\n	for (i = -1; i <= 1; i++)\r\n	{\r\n		for (j = -1; j <= 1; j++)\r\n		{\r\n			if (i == 0 && j == 0)// (x,y)\r\n			{\r\n				continue;\r\n			}\r\n			flag = 0;\r\n			if (legalDirect(x, y, i, j, flag))\r\n			{\r\n				return 1;\r\n			}\r\n		}\r\n	}\r\n	return 0;\r\n}\r\n\r\n int main()\r\n{\r\n	int i =0;\r\n	int j =0;\r\n	\r\n	for(i=0;i<8;i++)\r\n		for(j=0;j<8;j++)\r\n		{\r\n		scanf(\"%d\",&board[i][j]);\r\n		}\r\n\r\n			if (legal(i, j) && i == 0 && j == 0)\r\n				{\r\n				printf(\"%d %d\\n\",i,j);\r\n				return 1;\r\n			}\r\n\r\n			else if (legal(i, j) && i == 7 && j == 7)\r\n				{\r\n				printf(\"%d %d\\n\",i,j);\r\n				return 1;\r\n			}\r\n\r\n			else if (legal(i, j) && i == 0 && j == 7)\r\n				{\r\n				printf(\"%d %d\\n\",i,j);\r\n				return 1;\r\n			}\r\n\r\n			else if (legal(i, j) && i == 7 && j == 0)\r\n				{\r\n				printf(\"%d %d\\n\",i,j);\r\n				return 1;\r\n			}\r\n\r\n	for(j=0;j<8;j++)\r\n		for(i=0;i<8;i++)\r\n		{\r\n			if(legal(i,j))\r\n			{\r\n				printf(\"%d %d\\n\",i,j);\r\n				return 1;\r\n			}\r\n		}\r\n}\r\n\r\n','compile correct','gcc','othello','2013-05-07 15:39:01','');
INSERT INTO task VALUES (111,'xxxatt','//AI\r\n//****\r\n\r\n#include <stdio.h>\r\n\r\nint board[8][8] = {0};\r\nint tail=0,ans[100][2];\r\n/* (x,y),xoffest,yoffset(x,y)*/\r\nint legalDirect(int x, int y, int xoffest, int yoffset, int flag)\r\n{\r\n	x += xoffest;\r\n	y += yoffset;\r\n	if (x < 0 || x >= 8 || y < 0 || y >= 8)// \r\n	{\r\n		return 0;\r\n	}\r\n	if (board[x][y] == 2)\r\n	{\r\n		/* (x,y),\r\n		*  ,\r\n		*/\r\n		flag = 1;\r\n		return legalDirect(x, y, xoffest, yoffset, flag);\r\n	}\r\n	else if (board[x][y] == 1)\r\n	{\r\n		/* , legal=1*/\r\n		if (flag == 1)\r\n		{\r\n			return 1;\r\n		}\r\n		return 0;\r\n	}\r\n	else\r\n		return 0;\r\n\r\n	return 0;\r\n}\r\n\r\n/* , 0, 1*/\r\nint legal(int x, int y)\r\n{\r\n	int i, j, flag;\r\n	if (board[x][y]!=0)// \r\n		return 0;\r\n	/* (x,y)*/\r\n	for (i = -1; i <= 1; i++)\r\n	{\r\n		for (j = -1; j <= 1; j++)\r\n		{\r\n			if (i == 0 && j == 0)// (x,y)\r\n			{\r\n				continue;\r\n			}\r\n			flag = 0;\r\n			if (legalDirect(x, y, i, j, flag))\r\n			{\r\n				return 1;\r\n			}\r\n		}\r\n	}\r\n	return 0;\r\n}\r\n\r\nint value(int q)\r\n{\r\n	int x=ans[q][0],y=ans[q][1];\r\n	if ((x==0)&&(y==0)||(x==0)&&(y==7)||(x==7)&&(y==0)||(x==7)&&(y==7)) return 999;\r\n	else return 0;\r\n	\r\n}\r\n\r\nvoid sp(int l,int r)\r\n\r\n{\r\n	int q,p,m,temp[2];\r\n	q=l;p=r;m=value((l+r)/2);\r\n	do{\r\n		while (value(q)<m) q++;\r\n		while (value(p)>m) p--;\r\n		if (q<=p) {\r\n			temp[0]=ans[q][0];\r\n			ans[q][0]=ans[p][0];\r\n			ans[p][0]=temp[0];\r\n			temp[1]=ans[q][1];\r\n			ans[q][1]=ans[p][1];\r\n			ans[p][1]=temp[1];\r\n			q++;p--;\r\n		}\r\n	}while (q<=p);\r\n	if (l<p) sp(l,p);\r\n	if (q<r) sp(q,r);\r\n}\r\n\r\n int main()\r\n{\r\n	int ans[100][2]={0},i=0,j =0;\r\n	\r\n	for(i=0;i<8;i++)\r\n		for(j=0;j<8;j++)\r\n		{\r\n		scanf(\"%d\",&board[i][j]);\r\n		}\r\n	\r\n	for(j=0;j<8;j++)\r\n		for(i=0;i<8;i++)\r\n		{\r\n			if(legal(i,j))\r\n			{\r\n				tail++;\r\n				ans[tail][0]=i;\r\n				ans[tail][1]=j;\r\n			}\r\n		}\r\n	if (tail>1) sp(1,tail);\r\n	printf(\"%d %d\\n\",ans[tail][0],ans[tail][1]);\r\n	return 0;\r\n}\r\n','compile correct','gcc','othello','2013-05-07 15:46:31','');
INSERT INTO task VALUES (112,'nwangwen','//AI\r\n//****\r\n\r\n#include <stdio.h>\r\n\r\nint board[8][8] = {0};\r\n/* (x,y),xoffest,yoffset(x,y)*/\r\nint legalDirect(int x, int y, int xoffest, int yoffset, int flag)\r\n{\r\n	x += xoffest;\r\n	y += yoffset;\r\n	if (x < 0 || x >= 8 || y < 0 || y >= 8)// \r\n	{\r\n		return 0;\r\n	}\r\n	if (board[x][y] == 2)\r\n	{\r\n		/* (x,y),\r\n		*  ,\r\n		*/\r\n		flag = 1;\r\n		return legalDirect(x, y, xoffest, yoffset, flag);\r\n	}\r\n	else if (board[x][y] == 1)\r\n	{\r\n		/* , legal=1*/\r\n		if (flag == 1)\r\n		{\r\n			return 1;\r\n		}\r\n		return 0;\r\n	}\r\n	else\r\n		return 0;\r\n\r\n	return 0;\r\n}\r\n\r\n/* , 0, 1*/\r\nint legal(int x, int y)\r\n{\r\n	if (board[x][y]!=0)// \r\n		return 0;\r\n	int i, j, flag;\r\n	/* (x,y)*/\r\n	for (i = -1; i <= 1; i++)\r\n	{\r\n		for (j = -1; j <= 1; j++)\r\n		{\r\n			if (i == 0 && j == 0)// (x,y)\r\n			{\r\n				continue;\r\n			}\r\n			flag = 0;\r\n			if (legalDirect(x, y, i, j, flag))\r\n			{\r\n				return 1;\r\n			}\r\n		}\r\n	}\r\n	return 0;\r\n}\r\n\r\n int main()\r\n{\r\n	int i =0;\r\n	int j =0;\r\n	\r\n	for(i=0;i<8;i++)\r\n		for(j=0;j<8;j++)\r\n		{\r\n		scanf(\"%d\",&board[i][j]);\r\n		}\r\n	\r\n	for(j=0;j<8;j++)\r\n		for(i=0;i<8;i++)\r\n		{\r\n			if(legal(i,j))\r\n			{\r\n				printf(\"%d %d\\n\",i,j);\r\n				return 1;\r\n			}\r\n		}\r\n}\r\n\r\n\r\n','compile correct','gcc','othello','2013-05-07 15:46:53','');
