INSERT INTO task VALUES (164,'zhuxuezhi','#include<stdio.h>\r\n#include<stdlib.h>\r\n\r\nint board[10][10],maxi,maxj,DEPTH,S;            //,,, \r\n\r\n// \r\nvoid saveBoard (int temp[][10]);     //\r\nvoid resetBoard (int temp[][10]);   // \r\nint judge (int x,int y,int s);      //board[x][y]\r\nvoid newBoard (int x,int y, int s);           //\r\nlong alphabeta (int s,int depth, long alpha,long beta);         //alpha-beta\r\nint totalCount ();                    //\r\nint count (int s);                    //s(s=1,s=2)\r\nint mobility (int s);                  //s() \r\nint preMobility (int s);               //s()\r\nint stab (int s);                       // \r\nint H_AX (int i,int s);                  // \r\nint V_AX (int j,int s);                 // \r\nint BD_AX( int i,int j,int s);          // \r\nint FD_AX (int i,int j,int s);          // \r\nlong cornerValue(int s);                 //\r\nlong lineValue (int s);                 // \r\nlong firstValue (int s);                //\r\nlong midValue(int s);                   // \r\nlong lastValue (int com,int opp);       // \r\nlong Value(int s);                      // \r\nlong lastFind(int s,int depth, long alpha,long beta);        //  \r\n\r\nint main()\r\n{\r\n	int i,j,com,opp;					//i,j \r\n	char s1[9][9];						//\r\n	\r\n	for(i=0;i<10;i++){					//8\r\n\r\n                      board[0][i]=8;board[9][i]=8;\r\n                      board[i][0]=8;board[i][9]=8;\r\n\r\n                      }\r\n\r\n	S=1;				//(1)(2)\r\n	\r\n	com=S ;opp=(S==1)?2:1;			//com,opp\r\n	\r\n	for(i=1;i<=8;i++)				//int\r\n                 {\r\n               //   scanf(\"%s\",s1[i]);\r\n                  for(j=1;j<=8;j++) \r\n					  scanf(\"%d\",&board[i][j]);\r\n               //   board[i][j+1]=s1[i][j]-\'0\';\r\n\r\n                                 }\r\n\r\n	if(totalCount()<=18)  DEPTH=7;						//\r\n	\r\n	if(totalCount()>18&&totalCount()<40)	DEPTH=7;       //\r\n\r\n	\r\n	if(totalCount()>=40&&totalCount()<45)	DEPTH=10;       //\r\n\r\n	if(totalCount()>=45&&totalCount()<51)	DEPTH=12;       //\r\n\r\n	alphabeta(S,DEPTH,-100000000,100000000);				//- ,\r\n\r\n	if(totalCount()>=51)  lastFind(S,DEPTH,-100000000,100000000);		//\r\n\r\n	printf(\"%d %d\",maxi-1,maxj-1);								//\r\n\r\n \r\n}\r\n\r\n\r\nvoid saveBoard(int temp[][10])      // \r\n{\r\n     int i,j;\r\n     for(i=0;i<10;i++)\r\n     for(j=0;j<10;j++)\r\n      temp[i][j]=board[i][j];\r\n}\r\n\r\nvoid resetBoard(int temp[][10])   // \r\n{\r\n     int i,j;\r\n     for(i=0;i<10;i++)\r\n     for(j=0;j<10;j++)\r\n      board[i][j]=temp[i][j];\r\n      \r\n}\r\n      \r\n\r\n\r\nint judge(int x,int y,int s)	//board[x][y]\r\n{\r\n    int m=x , n=y;                //\r\n    int com=s , opp=(s==1)?2:1;  //com,opp\r\n    \r\n    if(board[x][y]!=0) return 0;      //,0\r\n    //\r\n    while(board[x][--y] == opp);\r\n    if(board[x][y]==com && board[x][y+1]==opp)	return 1;  		//&&board[x][y+1]==opp1  \r\n	else { x=m ;  y=n; }		 // \r\n	\r\n    // \r\n    while(board[x][++y] == opp);\r\n    if(board[x][y]==com && board[x][y-1]==opp)	return 1;   \r\n    else { x=m ; y=n; } \r\n\r\n    // \r\n    while(board[--x][y] == opp);\r\n    if(board[x][y]==com && board[x+1][y]==opp)	return 1;   \r\n    else { x=m ; y=n; } \r\n	\r\n    //\r\n    while(board[++x][y] == opp);\r\n    if(board[x][y]==com && board[x-1][y]==opp)	return 1;   \r\n    else { x=m ; y=n; }\r\n	\r\n    //\r\n    while(board[--x][--y] == opp);\r\n    if(board[x][y]==com && board[x+1][y+1]==opp)	return 1;   \r\n    else { x=m ; y=n; }\r\n\r\n    //\r\n    while(board[--x][++y] == opp);\r\n    if(board[x][y]==com && board[x+1][y-1]==opp)	return 1;   \r\n    else { x=m ; y=n; }\r\n\r\n    //\r\n    while(board[++x][--y] == opp);\r\n    if(board[x][y]==com && board[x-1][y+1]==opp)	return 1;   \r\n    else { x=m ; y=n; }\r\n    //\r\n    while(board[++x][++y] == opp);\r\n    if(board[x][y]==com && board[x-1][y-1]==opp)	return 1;   \r\n    else { x=m ; y=n; }\r\n    \r\n    return 0;			//\r\n}                   \r\n\r\n\r\nvoid newBoard(int x,int y, int s)           //\r\n{\r\n     int m=x , n=y;                              //\r\n     int com=s , opp=(s==1)?2:1;                //com,opp\r\n    \r\n     \r\n     //\r\n     while(board[x][--y]==opp);\r\n     if(board[x][y]==com && board[x][y+1]==opp){\r\n                      for(;y<n;)\r\n                                board[x][++y]=com;             // \r\n								 }               \r\n     else { x=m ;y=n; }                                      // \r\n\r\n     // \r\n     while(board[x][++y] ==opp);\r\n     if(board[x][y]==com && board[x][y-1]==opp){\r\n                      for(;y>n;)\r\n                               board[x][--y]=com;  \r\n								 } \r\n     else { x=m ;y=n; } \r\n\r\n     // \r\n     while(board[--x][y] ==opp);\r\n     if(board[x][y]==com && board[x+1][y]==opp){\r\n                      for(;x<m;)\r\n                                board[++x][y]=com; \r\n								 }  \r\n     else { x=m ;y=n; }\r\n	 \r\n     //\r\n     while(board[++x][y] ==opp);\r\n     if(board[x][y]==com && board[x-1][y]==opp){\r\n                      for(;x>m;)\r\n                                board[--x][y]=com; \r\n									}\r\n     else { x=m ;y=n; }\r\n	 \r\n     //\r\n     while(board[--x][--y] ==opp);\r\n     if(board[x][y]==com && board[x+1][y+1]==opp){\r\n                      for(;x<m&&y<n;)\r\n                                     board[++x][++y]=com;\r\n										 }   \r\n     else { x=m ;y=n; }\r\n\r\n     //\r\n     while(board[--x][++y] ==opp);\r\n     if(board[x][y]==com && board[x+1][y-1]==opp){\r\n                      for(;x<m&&y>n;)\r\n                                     board[++x][--y]=com;\r\n										}   \r\n     else { x=m ;y=n; }\r\n\r\n     //\r\n     while(board[++x][--y] ==opp);\r\n     if(board[x][y]==com && board[x-1][y+1]==opp){\r\n                      for(;x>m&&y<n;)\r\n                                     board[--x][++y]=com;\r\n										}   \r\n     else { x=m ;y=n; }\r\n\r\n     //\r\n     while(board[++x][++y] ==opp);\r\n     if(board[x][y]==com && board[x-1][y-1]==opp){\r\n                      for(;x>m&&y>n;)\r\n                                     board[--x][--y]=com;\r\n										}   \r\n     else { x=m ;y=n; }\r\n    \r\n\r\n} \r\n\r\n\r\nlong alphabeta (int s,int depth, long alpha,long beta)         //alpha-beta\r\n{\r\n    int com,opp,temp[10][10],i,j,flag=0,k=0;					//temp flag k \r\n    long value;\r\n    com=s ;	opp=(s==1)?2:1;\r\n    if(depth<=0)   return Value(s);							//\r\n    \r\n    if(depth%2==0){											//MAX\r\n		for(i=1;i<9;i++){\r\n			for(j=1;j<9;j++)\r\n				if(judge(i,j,com)){\r\n                                    k=1;                  // \r\n									saveBoard(temp);				//\r\n									newBoard(i,j,com);			// \r\n									value=alphabeta(opp,depth-1,alpha,beta);		//\r\n									resetBoard(temp);				//\r\n									if(value>alpha&&value<beta){\r\n																alpha=value;\r\n																if(depth==DEPTH){			// \r\n																					maxi=i;	\r\n																					maxj=j;\r\n																					}\r\n																	}\r\n\r\n										else if (value>=beta){				//\r\n																alpha=value;\r\n																flag=1;\r\n																break;\r\n																}\r\n									}\r\n			if(flag){				//\r\n					flag=0;\r\n					break;\r\n						}\r\n		}//for\r\n    if(k==0) return Value(S);             //  \r\n	return alpha;						//alpha\r\n	}//if\r\n\r\n                   \r\n    if(depth%2==1){										//MIN						\r\n		for(i=1;i<9;i++){\r\n			for(j=1;j<9;j++)\r\n				if(judge(i,j,com)){\r\n                                    k=1;                // \r\n									saveBoard(temp);				//\r\n									newBoard(i,j,com);			// \r\n                                    value=alphabeta(opp,depth-1,alpha,beta);		//\r\n                                    resetBoard(temp);				//\r\n                                    if(value>alpha&&value<beta){\r\n                                                                beta=value;\r\n                                                                if(depth==DEPTH){			// \r\n                                                                                maxi=i;\r\n                                                                                maxj=j;\r\n                                                                                  }\r\n                                                                  }\r\n										else if (value<=alpha){				//\r\n                                                                beta=value;\r\n                                                                flag=1;\r\n                                                                break;\r\n																	}\r\n\r\n                                                                      }\r\n             if(flag){			//\r\n                      flag=0;\r\n                      break;\r\n                        }\r\n			}//for\r\n        if(k==0) return Value(S);  //  \r\n		return beta;\r\n    }//if\r\n}//end\r\n                                                                                            \r\n                                                                                                                   \r\n                                                        \r\n\r\n\r\n\r\nint totalCount ()                    // \r\n{\r\n    int num=0,i,j;\r\n    for(i=1;i<=8;i++)\r\n		for(j=1;j<=8;j++)\r\n			if(board[i][j]!=0) num++;\r\n    return num;\r\n}    \r\n\r\n  \r\nint count (int s)                    //s(s=1,s=2)\r\n{\r\n    int num=0,i,j;\r\n    for(i=1;i<=8;i++)\r\n		for(j=1;j<=8;j++)\r\n			if(board[i][j]==s) num++;\r\n    return num;\r\n}      \r\n\r\nint mobility (int s)                  //s() \r\n{\r\n    int move=0,i,j;\r\n    for(i=1;i<=8;i++)\r\n		for(j=1;j<=8;j++)\r\n			if(judge(i,j,s)) move++;\r\n    return move;\r\n}\r\n\r\n\r\nint preMobility (int s)               //s() \r\n{\r\n    int opp=(s==1)?2:1;				//opp\r\n    int preMove=0,i,j;\r\n    for(i=1;i<=8;i++)\r\n		for(j=1;j<=8;j++)\r\n    //i,j 8 \r\n			if(board[i][j]==0&&(board[i][j-1]==opp||board[i][j+1]==opp||board[i+1][j]==opp||board[i-1][j]==opp||board[i+1][j-1]==opp||board[i+1][j+1]==opp||board[i-1][j-1]==opp||board[i-1][j+1]==opp))   \r\n					preMove++;\r\n    return preMove; \r\n}\r\n\r\nint H_AX(int i,int s)                     // \r\n{\r\n    int j,y,nstab=0,count=0,ncom=0;		//nstab\r\n    int com,opp;\r\n    com=s;	opp = (s==1)?2:1;\r\n    for(j=1;j<9;j++)					//\r\n		if(board[i][j]!=0){\r\n						if(board[i][j]==com) ncom++;		//\r\n						count++;						//\r\n						}								\r\n			else break;\r\n\r\n    if(count==8)	return ncom;						//8 ()\r\n\r\n    for(j=1;j<9;j++)\r\n		if(board[i][j]==com){	//begin if\r\n							y=j;\r\n							while(board[i][--j]==com);         // \r\n							if(board[i][j]==8){                //8 \r\n											j=y;         //             \r\n											nstab++;\r\n											continue;\r\n												}\r\n								else if(board[i][j]==opp){                       //\r\n														j=y;\r\n														while(board[i][++j]==com);    //\r\n														if(board[i][j]!=0){           //\r\n																		j=y;       // \r\n																		nstab++;\r\n																		continue;\r\n																			}\r\n                                                           }\r\n                                                           \r\n							j=y;\r\n							while(board[i][++j]==com);        //\r\n							if(board[i][j]==8){\r\n											j=y;       // \r\n											nstab++;\r\n											continue;\r\n												}\r\n									else if(board[i][j]==opp){                  //\r\n															j=y;\r\n															while(board[i][--j]==com);    //\r\n															if(board[i][j]!=0){           //\r\n																			j=y;       //  \r\n																			nstab++;\r\n																			continue;\r\n																				}\r\n																}\r\n							j=y;        //          \r\n								}//end if\r\n    return nstab;\r\n}\r\n\r\nint V_AX(int j,int s)                 // \r\n{\r\n    int i,x,nstab=0,count=0,ncom=0;\r\n    int com,opp;\r\n    com=s;opp = (s==1)?2:1;\r\n    for(i=1;i<9;i++)				//		\r\n		if(board[i][j]!=0){\r\n						if(board[i][j]==com) ncom++;	//\r\n						count++;					//\r\n							}\r\n			else break;\r\n    if(count==8)	return ncom;		//8 ()\r\n\r\n    for(i=1;i<9;i++)			\r\n		if(board[i][j]==com){	//begin if\r\n							x=i;\r\n							while(board[--i][j]==com);         // \r\n							if(board[i][j]==8){                //8 \r\n											i=x;         //             \r\n											nstab++;\r\n											continue;\r\n												}\r\n								else if(board[i][j]==opp){                       //\r\n														i=x;\r\n														while(board[++i][j]==com);    //\r\n														if(board[i][j]!=0){           //\r\n																		i=x;       // \r\n																		nstab++;\r\n																		continue;\r\n																			}\r\n                                                           }\r\n                                                           \r\n							i=x;\r\n							while(board[++i][j]==com);        //\r\n							if(board[i][j]==8){\r\n											i=x;       // \r\n											nstab++;\r\n											continue;\r\n												}\r\n								else if(board[i][j]==opp){                  //\r\n														i=x;\r\n														while(board[--i][j]==com);    //\r\n														if(board[i][j]!=0){           //\r\n																		i=x;       //  \r\n																		nstab++;\r\n																		continue;\r\n																			}\r\n                                                            }\r\n							i=x;        //          \r\n							}//end if\r\n    return nstab;\r\n}\r\n\r\nint BD_AX(int i,int j,int s)          // \r\n{\r\n    \r\n    int x,y;\r\n    int com,opp;\r\n    com=s;opp = (s==1)?2:1;\r\n    if(board[i][j]==com){\r\n						x=i;y=j;\r\n						while(board[--i][--j]==com);         // \r\n						if(board[i][j]==8)    return 1;		// \r\n							else if(board[i][j]==opp){			//\r\n													i=x;j=y;\r\n													while(board[++i][++j]==com);    //\r\n													if(board[i][j]!=0)    return 1;      //\r\n														}\r\n                                                           \r\n						i=x;j=y;\r\n						while(board[++i][++j]==com);        //\r\n						if(board[i][j]==8)    return 1;\r\n							else if(board[i][j]==opp){			//\r\n													i=x;j=y;\r\n													while(board[--i][--j]==com);    //\r\n													if(board[i][j]!=0)    return 1;       //\r\n														}\r\n						}\r\n    return 0;\r\n}\r\n\r\nint FD_AX(int i,int j,int s)          //  \r\n{\r\n    \r\n    int x,y;\r\n    int com,opp;\r\n    com=s;opp = (s==1)?2:1;\r\n    if(board[i][j]==com){\r\n						x=i;y=j;\r\n						while(board[--i][++j]==com);         // \r\n						if(board[i][j]==8)    return 1;\r\n							else if(board[i][j]==opp){                       //\r\n													i=x;j=y;\r\n													while(board[++i][--j]==com);    //\r\n													if(board[i][j]!=0)    return 1;      //\r\n														}\r\n                                                           \r\n						i=x;j=y;\r\n						while(board[++i][--j]==com);        //\r\n						if(board[i][j]==8)    return 1;\r\n							else if(board[i][j]==opp){                    //\r\n													i=x;j=y;\r\n													while(board[--i][++j]==com);    //\r\n													if(board[i][j]!=0)    return 1;       //\r\n														}\r\n							}\r\n    return 0;\r\n} \r\n\r\n\r\nint stab(int s)                       // \r\n{\r\n    int i,j,value=0;\r\n    for(i=1;i<9;i++)\r\n		value+=H_AX(i,s);\r\n\r\n    for(j=1;j<9;j++)\r\n		value+=V_AX(j,s);\r\n\r\n	for(i=1;i<9;i++)\r\n		for(j=1;j<9;j++)\r\n			value+=BD_AX(i,j,s);\r\n\r\n	for(i=1;i<9;i++)\r\n		for(j=1;j<9;j++)\r\n			value+=FD_AX(i,j,s);\r\n                                      \r\n	return value;\r\n      \r\n}\r\n\r\nlong cornerValue(int s)                                //\r\n{\r\n    int com,opp,i,j;\r\n    long value=0;\r\n    com=s ;opp=(s==1)?2:1;\r\n    if(board[1][1]==com)      value+=1000;       // \r\n    if(board[1][8]==com)      value+=1000;\r\n    if(board[8][1]==com)      value+=1000;\r\n    if(board[8][8]==com)      value+=1000;\r\n    \r\n    if(board[1][1]==opp)      value-=1000;       // \r\n    if(board[1][8]==opp)      value-=1000;\r\n    if(board[8][1]==opp)      value-=1000;\r\n    if(board[8][8]==opp)      value-=1000;\r\n    \r\n    if(board[1][1]==0){                                      // \r\n		if(board[1][2]==com){              //(1,2) \r\n							j=2;\r\n							while(board[1][++j]==com);\r\n							if(board[1][j]==opp) value-=1000;             //value \r\n								}\r\n		if(board[2][1]==com){                   //(2,1)\r\n							i=2;\r\n							while(board[++i][1]==com);\r\n							if(board[i][1]==opp) value-=1000;             //value\r\n								}\r\n		if(board[2][2]==com){                //(2,2)\r\n							i=2;j=2;\r\n							while(board[++i][++j]==com);\r\n							if(board[i][j]==opp) value-=1000;        // value \r\n								}\r\n                   }\r\n                   \r\n    if(board[1][8]==0){                                      // \r\n		if(board[1][7]==com){                    //(1,7) \r\n							j=7;\r\n							while(board[1][--j]==com);\r\n							if(board[1][j]==opp) value-=1000;             //value \r\n								}\r\n		if(board[2][8]==com){                   //(2,8)\r\n							i=2;\r\n							while(board[++i][1]==com);\r\n							if(board[i][1]==opp) value-=1000;             //value\r\n								}\r\n		if(board[2][7]==com){                  //(2,7)\r\n							i=2;j=7;\r\n							while(board[++i][--j]==com);\r\n							if(board[i][j]==opp) value-=1000;           // value  \r\n								}           \r\n                   }\r\n                   \r\n    if(board[8][1]==0){                                     //                                                           \r\n		if(board[8][2]==com){              \r\n							j=2;\r\n							while(board[8][++j]==com);\r\n							if(board[8][j]==opp) value-=1000;             \r\n								}\r\n		if(board[7][1]==com){                  \r\n							i=7;\r\n							while(board[--i][1]==com);\r\n							if(board[i][1]==opp) value-=1000;             \r\n								}\r\n		if(board[7][2]==com){                  \r\n							i=7;j=2;\r\n							while(board[--i][++j]==com);\r\n							if(board[i][j]==opp) value-=1000;            \r\n								}\r\n                   }\r\n                   \r\n    if(board[8][8]==0){                                     //                                                           \r\n		if(board[8][7]==com){              \r\n							j=7;\r\n							while(board[8][--j]==com);\r\n							if(board[8][j]==opp) value-=1000;             \r\n								}\r\n		if(board[7][8]==com){                  \r\n							i=7;\r\n							while(board[--i][8]==com);\r\n							if(board[i][8]==opp) value-=1000;             \r\n								}\r\n		if(board[7][7]==com){                  \r\n							i=7;j=7;\r\n							while(board[--i][--j]==com);\r\n							if(board[i][j]==opp) value-=1000;            \r\n								}\r\n                   }\r\n    return value;\r\n}               \r\n     \r\nlong lineValue (int s)                // \r\n{\r\n    int com,opp,i,j,x,y;\r\n    long value=0;\r\n    com=s ;opp=(s==1)?2:1;\r\n    for(x=1;x<=8;x++){\r\n						if(board[x][1]==opp){\r\n											j=1;\r\n											while(board[x][++j]==opp);\r\n											if(board[x][j]==com){\r\n																while(board[x][++j]==com);\r\n																if(board[x][j]==0) value-=100; \r\n																	}\r\n												}\r\n\r\n						if(board[x][8]==opp){\r\n											j=8;\r\n											while(board[x][--j]==opp);\r\n											if(board[x][j]==com){\r\n																while(board[x][--j]==com);\r\n																if(board[x][j]==0) value-=100; \r\n																	}\r\n												}\r\n                      }\r\n                     \r\n    for(y=1;y<=8;y++){\r\n						if(board[1][y]==opp){\r\n											i=1;\r\n											while(board[++i][y]==opp);\r\n											if(board[i][y]==com){\r\n																while(board[++i][y]==com);\r\n																if(board[i][y]==0) value-=100; \r\n																	}\r\n												}\r\n\r\n						if(board[8][y]==opp){\r\n											i=8;\r\n											while(board[--i][y]==opp);\r\n											if(board[i][y]==com){\r\n																while(board[--i][y]==com);\r\n																if(board[i][y]==0) value-=100; \r\n																	}\r\n										}\r\n                     }\r\n    return value;\r\n} \r\n\r\n\r\nlong firstValue (int s)                      // \r\n{\r\n    int com,opp;\r\n    long value=0;\r\n    com=s ;opp=(s==1)?2:1;\r\n    value+=30*cornerValue(s)+30*lineValue(s)+100*stab(s); \r\n    value+=20*(mobility(com)- mobility(opp))+5*(preMobility(com)- preMobility(opp));\r\n    \r\n    return value;\r\n}                                            \r\n\r\nlong midValue (int s)						//\r\n{\r\n    int com,opp;\r\n    long value=0;\r\n    com=s ;opp=(s==1)?2:1;\r\n    value+=30*(mobility(com)-mobility(opp))+8*(preMobility(com)-preMobility(opp));\r\n    value+=30*cornerValue(s)+30*lineValue(s)+100*stab(s);\r\n    \r\n    return value;\r\n}                                                                                                                                                                                                                                                             \r\nlong lastValue (int com,int opp)            // \r\n{\r\n    return count(com)-count(opp);\r\n}\r\n\r\nlong Value(int s)                           //\r\n {\r\n     int com,opp;\r\n     com=s ;opp=(s==1)?2:1;                                \r\n     if(totalCount()<=18)	return firstValue(s);\r\n     if(totalCount()>18&&totalCount()<51)\r\n							return midValue(s);\r\n       else return lastValue(com,opp);\r\n     \r\n                                                   \r\n}\r\n\r\n\r\nlong lastFind(int s,int depth, long alpha,long beta)\r\n{\r\n    int com,opp,temp[10][10],i,j,flag=0,k=0;\r\n    long value;\r\n    com=s ;opp=(s==1)?2:1;\r\n    if(totalCount()==64)   return lastValue(S,S==1?2:1);			//\r\n    \r\n    if(depth%2==0){\r\n		for(i=1;i<9;i++){\r\n			for(j=1;j<9;j++)\r\n				if(judge(i,j,com)){\r\n                                    k=1;                        \r\n									saveBoard(temp);\r\n									newBoard(i,j,com);\r\n									value=alphabeta(opp,depth-1,alpha,beta);\r\n									resetBoard(temp);\r\n									if(value>alpha&&value<beta){\r\n																	alpha=value;\r\n																	if(depth==DEPTH){\r\n																						maxi=i;\r\n																						maxj=j;\r\n																							}\r\n																		}\r\n																		else if (value>=beta){\r\n																								alpha=value;\r\n																								flag=1;\r\n																								break;\r\n																								}\r\n																			}\r\n                                   if(flag){\r\n                                            flag=0;\r\n                                            break;\r\n                                            }\r\n                                   }\r\n                   if(k==0) return Value(S);\r\n                   return alpha;\r\n                   }\r\n                   \r\n    if(depth%2==1){\r\n		for(i=1;i<9;i++){\r\n			for(j=1;j<9;j++)\r\n				if(judge(i,j,com)){\r\n                                    k=1;\r\n									saveBoard(temp);\r\n									newBoard(i,j,com);\r\n									value=alphabeta(opp,depth-1,alpha,beta);\r\n									resetBoard(temp);\r\n									if(value>alpha&&value<beta){\r\n																	beta=value;\r\n																	if(depth==DEPTH){\r\n																						maxi=i;\r\n																						maxj=j;\r\n																						}\r\n																		}\r\n																		else if (value<=alpha){\r\n																								beta=value;\r\n																								flag=1;\r\n																								break;\r\n																									}\r\n																	}\r\n                                   if(flag){\r\n                                            flag=0;\r\n                                            break;\r\n                                            }\r\n                                   }\r\n                   if(k==0) return Value(S);\r\n                   return beta;\r\n                   }\r\n}\r\n','compile correct','gcc','othello','2013-05-14 23:20:43','');
INSERT INTO task VALUES (166,'evr','//AI\r\n//****\r\n\r\n#include <stdio.h>\r\n\r\nint board[8][8] = {0};\r\n/* (x,y),xoffest,yoffset(x,y)*/\r\nint legalDirect(int x, int y, int xoffest, int yoffset, int flag)\r\n{\r\n	x += xoffest;\r\n	y += yoffset;\r\n	if (x < 0 || x >= 8 || y < 0 || y >= 8)// \r\n	{\r\n		return 0;\r\n	}\r\n	if (board[x][y] == 2)\r\n	{\r\n		/* (x,y),\r\n		*  ,\r\n		*/\r\n		flag = 1;\r\n		return legalDirect(x, y, xoffest, yoffset, flag);\r\n	}\r\n	else if (board[x][y] == 1)\r\n	{\r\n		/* , legal=1*/\r\n		if (flag == 1)\r\n		{\r\n			return 1;\r\n		}\r\n		return 0;\r\n	}\r\n	else\r\n		return 0;\r\n\r\n	return 0;\r\n}\r\n\r\n/* , 0, 1*/\r\nint legal(int x, int y)\r\n{\r\n	if (board[x][y]!=0)// \r\n		return 0;\r\n	int i, j, flag;\r\n	/* (x,y)*/\r\n	for (i = -1; i <= 1; i++)\r\n	{\r\n		for (j = -1; j <= 1; j++)\r\n		{\r\n			if (i == 0 && j == 0)// (x,y)\r\n			{\r\n				continue;\r\n			}\r\n			flag = 0;\r\n			if (legalDirect(x, y, i, j, flag))\r\n			{\r\n				return 1;\r\n			}\r\n		}\r\n	}\r\n	return 0;\r\n}\r\n\r\n int main()\r\n{\r\n	int i =0;\r\n	int j =0;\r\n	\r\n	for(i=0;i<8;i++)\r\n		for(j=0;j<8;j++)\r\n		{\r\n		scanf(\"%d\",&board[i][j]);\r\n		}\r\n	\r\n	for(j=0;j<8;j++)\r\n		for(i=0;i<8;i++)\r\n		{\r\n			if(legal(i,j))\r\n			{\r\n				printf(\"%d %d\\n\",i,j);\r\n				return 1;\r\n			}\r\n		}\r\n}','compile correct','gcc','othello','2013-05-22 18:28:15','');
INSERT INTO task VALUES (177,'kaiki1','#include <iostream>\r\n\r\nusing namespace std;\r\n\r\n//boardboard2 \r\nint board[8][8] = {{0}} , board2[8][8] = {{0}};                     //board2board \r\nint DirectNum[2][2]={{0}} , DirectNumTemp[1]={0};                       // xy \r\n\r\n\r\nstruct Av{                                                          //power\r\n	int x;\r\n	int y;\r\n	int power;\r\n}av[15];\r\n\r\n\r\nvoid CopyBoard()                                                    //boardboard2 \r\n{\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0); j<8; j++)\r\n			board2[i][j]=board[i][j];\r\n} \r\n\r\n\r\nvoid ChangeBoard()                                                 // \r\n{\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0); j<8; j++)\r\n		{\r\n			if(board2[i][j]==1)board2[i][j]=2;\r\n			else if(board2[i][j]==2)board2[i][j]=1;\r\n		}\r\n}\r\n\r\n\r\nint legalDirect(int x, int y, int i, int j, int flag)              //(x,y)i,j  \r\n{																   // DirectNumTemp?\r\n	x += i;\r\n	y += j;\r\n	if (x < 0 || x >7 || y < 0 || y > 7)                         // \r\n	{\r\n		return 0;\r\n	}\r\n	if (board2[x][y] == 2)\r\n	{\r\n     	DirectNumTemp[0]=1;              // \r\n		                              /* (x,y),\r\n		                              *  ,\r\n	                               	  */\r\n		flag = 1;\r\n		return legalDirect(x, y, i, j, flag);\r\n	}\r\n	else if (board2[x][y] == 1)\r\n	{\r\n		/* , flag=1*/\r\n		if (flag == 1)\r\n		{\r\n			return 1;\r\n		}\r\n		return 0;\r\n	}\r\n	else\r\n		return 0;\r\n\r\n	return 0;\r\n}\r\n\r\n\r\nint legal(int x, int y)                                 //(x,y)(i,j)\r\n{														//DirectNum[i][j];     \r\n	if (board2[x][y]!=0)                                // \r\n		return 0;\r\n	int i, j, flag;\r\n	\r\n	for (i = -1; i <= 1; i++)                          /* (x,y)*/\r\n	{\r\n		for (j = -1; j <= 1; j++)\r\n		{\r\n			if (i == 0 && j == 0)                      // (x,y)\r\n			{\r\n				continue;\r\n			}\r\n			flag = 0;\r\n			if (legalDirect(x, y, i, j, flag))\r\n			{\r\n				return 1;\r\n			}\r\n			DirectNumTemp[0]=0;                            //\r\n		}\r\n	}\r\n	return 0;\r\n}\r\n\r\n\r\nint CanEatNum(int x,int y)                                //(x,y) \r\n{\r\n	int i, j, flag,w=0;\r\n	for (i = -1; i <= 1; i++)                          /* (x,y)*/\r\n	{\r\n		for (j = -1; j <= 1; j++)\r\n		{\r\n			if (i == 0 && j == 0)                      // (x,y)\r\n			{\r\n				continue;\r\n			}\r\n			flag = 0;\r\n			if (legalDirect(x, y, i, j, flag))\r\n			{\r\n				w+= DirectNumTemp[0];\r\n			}\r\n			DirectNumTemp[0]=0;                            //\r\n		}\r\n	}\r\n	return w;\r\n} \r\n\r\n\r\nvoid fanzhuan(int x ,int y)                           // xyboard1  \r\n{\r\n	int i, j, flag;\r\n	\r\n	for (i = -1; i <= 1; i++)                          // (x,y) \r\n	{\r\n		for (j = -1; j <= 1; j++)\r\n		{\r\n			if (i == 0 && j == 0)                      // (x,y) \r\n			{\r\n				continue;\r\n			}\r\n			flag = 0;\r\n			if (legalDirect(x, y, i, j, flag))             // \r\n			{\r\n				for(int k(0); k<DirectNumTemp[0]+1; k++){\r\n					board2[x+i+k][y+j+k]= 1 ;          //  \r\n				} \r\n			}\r\n			DirectNumTemp[0]=0;                            // \r\n		}\r\n	}\r\n}\r\n\r\n\r\nbool isConner(int x ,int y)                           // \r\n{\r\n	if(x==0&&y==0)return 1;\r\n	else if(x==0&&y==7)return 1;\r\n	else if(x==7&&y==0)return 1;\r\n	else if(x==7&&y==7)return 1;\r\n	return 0; \r\n}\r\n\r\nbool is1BesideConner(int x ,int y)                   //412 \r\n{\r\n	if(x==0||x==7)\r\n		if(y==1||y==6)return 1;\r\n	if(x==1||x==6)\r\n		if(y==0||y==1||y==6||y==7)return 1;\r\n	return 0;\r\n}\r\n\r\n\r\nbool is2BesideConner(int x ,int y)                   //416 \r\n{\r\n	if(y==5||y==2)\r\n		if(x==1||x==0||x==6||x==7)return 1;\r\n	if(x==5||x==2)\r\n			if(y==1||y==0||y==6||y==7)return 1;\r\n	return 0;\r\n} \r\n\r\n\r\nint WhiteCanGoNum (int x , int y)                     //xy \r\n{\r\n	ChangeBoard();\r\n	fanzhuan(x,y);                                    //legalDirectlegal\r\n	int w=0;\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0); j<8; j++)\r\n			if(legal(i,j))w++;                           \r\n	ChangeBoard();                                    // \r\n	return w;\r\n} \r\n\r\n\r\nbool WhiteCanGotoConner(int x, int y)                 //     \r\n{\r\n	fanzhuan(x,y);\r\n	ChangeBoard();\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0); j<8; j++)\r\n			if(legal(i,j))\r\n				if(isConner(i,j)){\r\n					ChangeBoard();\r\n					return 1; \r\n				}\r\n	ChangeBoard();\r\n	return 0;\r\n}\r\n\r\n\r\nint GiveAv(Av av[])                                          //av[] \r\n{\r\n	int k=0;\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0); j<8; j++)\r\n			if(legal(i,j)){\r\n				av[k].x = i;\r\n				av[k].y = j;\r\n				k++;\r\n			}\r\n	return k ;\r\n}\r\n\r\n\r\nvoid Power(int k)                                       // \r\n{\r\n	for(int i(0); i<k; i++)\r\n	{\r\n		av[i].power=0;\r\n		if(isConner(av[i].x,av[i].y))av[i].power+=15;\r\n		if(WhiteCanGotoConner(av[i].x,av[i].y))av[i].power-=15;\r\n		if(is1BesideConner(av[i].x,av[i].y))av[i].power-=5;\r\n		if(is2BesideConner(av[i].x,av[i].y))av[i].power+=5;\r\n	}\r\n}\r\n\r\n int main()\r\n{\r\n	int w=0;\r\n	for(int i(0); i<8; i++)                                //  \r\n		for(int j(0); j<8; j++)\r\n		{\r\n			cin >> board[i][j]; \r\n			if(board[i][j]==2||board[i][j]==1)w++;\r\n		} \r\n		\r\n	CopyBoard();\r\n	\r\n	bool key1=0, key2=0;                                 //\r\n	if(board[0][0]!=0||board[0][7]!=0||board[7][0]!=0||board[7][7]!=0)key2=1;  // \r\n	                                                            \r\n	if(w>16)key1=1;											// \r\n	int k;\r\n	k=GiveAv(av);\r\n	Power(k);\r\n	\r\n	\r\n	if(key2==1)										// \r\n	{    \r\n		for(int i(0); i<k; i++)\r\n		{     \r\n			av[i].power+=CanEatNum(av[i].x,av[i].y)*2;\r\n			av[i].power-=WhiteCanGoNum(av[i].x,av[i].y);\r\n		}\r\n		\r\n	}\r\n\r\n	else if(key1==1)                                                     // \r\n	{\r\n		for(int i(0); i<k; i++)\r\n		{\r\n			av[i].power+=CanEatNum(av[i].x,av[i].y);\r\n			av[i].power-=WhiteCanGoNum(av[i].x,av[i].y)*2;\r\n		}\r\n		\r\n		\r\n		\r\n		\r\n	}\r\n\r\n	else                                                                    // \r\n	{\r\n		for(int i(0); i<k; i++)\r\n		{\r\n			av[i].power-=CanEatNum(av[i].x,av[i].y);\r\n		}\r\n		\r\n\r\n	}\r\n	\r\n	int x=av[0].x,y=av[0].y,max=av[0].power;\r\n	for(int i(1); i<k; i++)\r\n		 if(av[i].power>max)\r\n		 {\r\n		 	max=av[i].power;\r\n		 	x=av[i].x;\r\n		 	y=av[i].y;\r\n		 }\r\n	if(k==0)return 1;\r\n\r\n	cout << x <<\" \"<< y;	                                			// \r\n		return 1;\r\n}','compile correct','g++','othello','2013-05-23 17:45:07','');
INSERT INTO task VALUES (183,'mediumAi','#include<stdio.h>\r\n#include<stdlib.h>\r\n\r\nint board[10][10],maxi,maxj,DEPTH,S;            //,,, \r\n\r\n// \r\nvoid saveBoard (int temp[][10]);     //\r\nvoid resetBoard (int temp[][10]);   // \r\nint judge (int x,int y,int s);      //board[x][y]\r\nvoid newBoard (int x,int y, int s);           //\r\nlong alphabeta (int s,int depth, long alpha,long beta);         //alpha-beta\r\nint totalCount ();                    //\r\nint count (int s);                    //s(s=1,s=2)\r\nint mobility (int s);                  //s() \r\nint preMobility (int s);               //s()\r\nint stab (int s);                       // \r\nint H_AX (int i,int s);                  // \r\nint V_AX (int j,int s);                 // \r\nint BD_AX( int i,int j,int s);          // \r\nint FD_AX (int i,int j,int s);          // \r\nlong cornerValue(int s);                 //\r\nlong lineValue (int s);                 // \r\nlong firstValue (int s);                //\r\nlong midValue(int s);                   // \r\nlong lastValue (int com,int opp);       // \r\nlong Value(int s);                      // \r\nlong lastFind(int s,int depth, long alpha,long beta);        //  \r\n\r\nint main()\r\n{\r\n	int i,j,com,opp;					//i,j \r\n	char s1[9][9];						//\r\n	\r\n	for(i=0;i<10;i++){					//8\r\n\r\n                      board[0][i]=8;board[9][i]=8;\r\n                      board[i][0]=8;board[i][9]=8;\r\n\r\n                      }\r\n\r\n	S=1;				//(1)(2)\r\n	\r\n	com=S ;opp=(S==1)?2:1;			//com,opp\r\n	\r\n	for(i=1;i<=8;i++)				//int\r\n                 {\r\n               //   scanf(\"%s\",s1[i]);\r\n                  for(j=1;j<=8;j++) \r\n					  scanf(\"%d\",&board[i][j]);\r\n               //   board[i][j+1]=s1[i][j]-\'0\';\r\n\r\n                                 }\r\n\r\n	if(totalCount()<=18)  DEPTH=7;						//\r\n	\r\n	if(totalCount()>18&&totalCount()<40)	DEPTH=7;       //\r\n\r\n	\r\n	if(totalCount()>=40&&totalCount()<45)	DEPTH=9;       //\r\n\r\n	if(totalCount()>=45&&totalCount()<51)	DEPTH=11;       //\r\n\r\n	alphabeta(S,DEPTH,-100000000,100000000);				//- ,\r\n\r\n	if(totalCount()>=51)  lastFind(S,DEPTH,-100000000,100000000);		//\r\n\r\n	printf(\"%d %d\",maxi-1,maxj-1);								//\r\n\r\n \r\n}\r\n\r\n\r\nvoid saveBoard(int temp[][10])      // \r\n{\r\n     int i,j;\r\n     for(i=0;i<10;i++)\r\n     for(j=0;j<10;j++)\r\n      temp[i][j]=board[i][j];\r\n}\r\n\r\nvoid resetBoard(int temp[][10])   // \r\n{\r\n     int i,j;\r\n     for(i=0;i<10;i++)\r\n     for(j=0;j<10;j++)\r\n      board[i][j]=temp[i][j];\r\n      \r\n}\r\n      \r\n\r\n\r\nint judge(int x,int y,int s)	//board[x][y]\r\n{\r\n    int m=x , n=y;                //\r\n    int com=s , opp=(s==1)?2:1;  //com,opp\r\n    \r\n    if(board[x][y]!=0) return 0;      //,0\r\n    //\r\n    while(board[x][--y] == opp);\r\n    if(board[x][y]==com && board[x][y+1]==opp)	return 1;  		//&&board[x][y+1]==opp1  \r\n	else { x=m ;  y=n; }		 // \r\n	\r\n    // \r\n    while(board[x][++y] == opp);\r\n    if(board[x][y]==com && board[x][y-1]==opp)	return 1;   \r\n    else { x=m ; y=n; } \r\n\r\n    // \r\n    while(board[--x][y] == opp);\r\n    if(board[x][y]==com && board[x+1][y]==opp)	return 1;   \r\n    else { x=m ; y=n; } \r\n	\r\n    //\r\n    while(board[++x][y] == opp);\r\n    if(board[x][y]==com && board[x-1][y]==opp)	return 1;   \r\n    else { x=m ; y=n; }\r\n	\r\n    //\r\n    while(board[--x][--y] == opp);\r\n    if(board[x][y]==com && board[x+1][y+1]==opp)	return 1;   \r\n    else { x=m ; y=n; }\r\n\r\n    //\r\n    while(board[--x][++y] == opp);\r\n    if(board[x][y]==com && board[x+1][y-1]==opp)	return 1;   \r\n    else { x=m ; y=n; }\r\n\r\n    //\r\n    while(board[++x][--y] == opp);\r\n    if(board[x][y]==com && board[x-1][y+1]==opp)	return 1;   \r\n    else { x=m ; y=n; }\r\n    //\r\n    while(board[++x][++y] == opp);\r\n    if(board[x][y]==com && board[x-1][y-1]==opp)	return 1;   \r\n    else { x=m ; y=n; }\r\n    \r\n    return 0;			//\r\n}                   \r\n\r\n\r\nvoid newBoard(int x,int y, int s)           //\r\n{\r\n     int m=x , n=y;                              //\r\n     int com=s , opp=(s==1)?2:1;                //com,opp\r\n    \r\n     \r\n     //\r\n     while(board[x][--y]==opp);\r\n     if(board[x][y]==com && board[x][y+1]==opp){\r\n                      for(;y<n;)\r\n                                board[x][++y]=com;             // \r\n								 }               \r\n     else { x=m ;y=n; }                                      // \r\n\r\n     // \r\n     while(board[x][++y] ==opp);\r\n     if(board[x][y]==com && board[x][y-1]==opp){\r\n                      for(;y>n;)\r\n                               board[x][--y]=com;  \r\n								 } \r\n     else { x=m ;y=n; } \r\n\r\n     // \r\n     while(board[--x][y] ==opp);\r\n     if(board[x][y]==com && board[x+1][y]==opp){\r\n                      for(;x<m;)\r\n                                board[++x][y]=com; \r\n								 }  \r\n     else { x=m ;y=n; }\r\n	 \r\n     //\r\n     while(board[++x][y] ==opp);\r\n     if(board[x][y]==com && board[x-1][y]==opp){\r\n                      for(;x>m;)\r\n                                board[--x][y]=com; \r\n									}\r\n     else { x=m ;y=n; }\r\n	 \r\n     //\r\n     while(board[--x][--y] ==opp);\r\n     if(board[x][y]==com && board[x+1][y+1]==opp){\r\n                      for(;x<m&&y<n;)\r\n                                     board[++x][++y]=com;\r\n										 }   \r\n     else { x=m ;y=n; }\r\n\r\n     //\r\n     while(board[--x][++y] ==opp);\r\n     if(board[x][y]==com && board[x+1][y-1]==opp){\r\n                      for(;x<m&&y>n;)\r\n                                     board[++x][--y]=com;\r\n										}   \r\n     else { x=m ;y=n; }\r\n\r\n     //\r\n     while(board[++x][--y] ==opp);\r\n     if(board[x][y]==com && board[x-1][y+1]==opp){\r\n                      for(;x>m&&y<n;)\r\n                                     board[--x][++y]=com;\r\n										}   \r\n     else { x=m ;y=n; }\r\n\r\n     //\r\n     while(board[++x][++y] ==opp);\r\n     if(board[x][y]==com && board[x-1][y-1]==opp){\r\n                      for(;x>m&&y>n;)\r\n                                     board[--x][--y]=com;\r\n										}   \r\n     else { x=m ;y=n; }\r\n    \r\n\r\n} \r\n\r\n\r\nlong alphabeta (int s,int depth, long alpha,long beta)         //alpha-beta\r\n{\r\n    int com,opp,temp[10][10],i,j,flag=0,k=0;					//temp flag k \r\n    long value;\r\n    com=s ;	opp=(s==1)?2:1;\r\n    if(depth<=0)   return Value(s);							//\r\n    \r\n    if(depth%2==0){											//MAX\r\n		for(i=1;i<9;i++){\r\n			for(j=1;j<9;j++)\r\n				if(judge(i,j,com)){\r\n                                    k=1;                  // \r\n									saveBoard(temp);				//\r\n									newBoard(i,j,com);			// \r\n									value=alphabeta(opp,depth-1,alpha,beta);		//\r\n									resetBoard(temp);				//\r\n									if(value>alpha&&value<beta){\r\n																alpha=value;\r\n																if(depth==DEPTH){			// \r\n																					maxi=i;	\r\n																					maxj=j;\r\n																					}\r\n																	}\r\n\r\n										else if (value>=beta){				//\r\n																alpha=value;\r\n																flag=1;\r\n																break;\r\n																}\r\n									}\r\n			if(flag){				//\r\n					flag=0;\r\n					break;\r\n						}\r\n		}//for\r\n    if(k==0) return Value(S);             //  \r\n	return alpha;						//alpha\r\n	}//if\r\n\r\n                   \r\n    if(depth%2==1){										//MIN						\r\n		for(i=1;i<9;i++){\r\n			for(j=1;j<9;j++)\r\n				if(judge(i,j,com)){\r\n                                    k=1;                // \r\n									saveBoard(temp);				//\r\n									newBoard(i,j,com);			// \r\n                                    value=alphabeta(opp,depth-1,alpha,beta);		//\r\n                                    resetBoard(temp);				//\r\n                                    if(value>alpha&&value<beta){\r\n                                                                beta=value;\r\n                                                                if(depth==DEPTH){			// \r\n                                                                                maxi=i;\r\n                                                                                maxj=j;\r\n                                                                                  }\r\n                                                                  }\r\n										else if (value<=alpha){				//\r\n                                                                beta=value;\r\n                                                                flag=1;\r\n                                                                break;\r\n																	}\r\n\r\n                                                                      }\r\n             if(flag){			//\r\n                      flag=0;\r\n                      break;\r\n                        }\r\n			}//for\r\n        if(k==0) return Value(S);  //  \r\n		return beta;\r\n    }//if\r\n}//end\r\n                                                                                            \r\n                                                                                                                   \r\n                                                        \r\n\r\n\r\n\r\nint totalCount ()                    // \r\n{\r\n    int num=0,i,j;\r\n    for(i=1;i<=8;i++)\r\n		for(j=1;j<=8;j++)\r\n			if(board[i][j]!=0) num++;\r\n    return num;\r\n}    \r\n\r\n  \r\nint count (int s)                    //s(s=1,s=2)\r\n{\r\n    int num=0,i,j;\r\n    for(i=1;i<=8;i++)\r\n		for(j=1;j<=8;j++)\r\n			if(board[i][j]==s) num++;\r\n    return num;\r\n}      \r\n\r\nint mobility (int s)                  //s() \r\n{\r\n    int move=0,i,j;\r\n    for(i=1;i<=8;i++)\r\n		for(j=1;j<=8;j++)\r\n			if(judge(i,j,s)) move++;\r\n    return move;\r\n}\r\n\r\n\r\nint preMobility (int s)               //s() \r\n{\r\n    int opp=(s==1)?2:1;				//opp\r\n    int preMove=0,i,j;\r\n    for(i=1;i<=8;i++)\r\n		for(j=1;j<=8;j++)\r\n    //i,j 8 \r\n			if(board[i][j]==0&&(board[i][j-1]==opp||board[i][j+1]==opp||board[i+1][j]==opp||board[i-1][j]==opp||board[i+1][j-1]==opp||board[i+1][j+1]==opp||board[i-1][j-1]==opp||board[i-1][j+1]==opp))   \r\n					preMove++;\r\n    return preMove; \r\n}\r\n\r\nint H_AX(int i,int s)                     // \r\n{\r\n    int j,y,nstab=0,count=0,ncom=0;		//nstab\r\n    int com,opp;\r\n    com=s;	opp = (s==1)?2:1;\r\n    for(j=1;j<9;j++)					//\r\n		if(board[i][j]!=0){\r\n						if(board[i][j]==com) ncom++;		//\r\n						count++;						//\r\n						}								\r\n			else break;\r\n\r\n    if(count==8)	return ncom;						//8 ()\r\n\r\n    for(j=1;j<9;j++)\r\n		if(board[i][j]==com){	//begin if\r\n							y=j;\r\n							while(board[i][--j]==com);         // \r\n							if(board[i][j]==8){                //8 \r\n											j=y;         //             \r\n											nstab++;\r\n											continue;\r\n												}\r\n								else if(board[i][j]==opp){                       //\r\n														j=y;\r\n														while(board[i][++j]==com);    //\r\n														if(board[i][j]!=0){           //\r\n																		j=y;       // \r\n																		nstab++;\r\n																		continue;\r\n																			}\r\n                                                           }\r\n                                                           \r\n							j=y;\r\n							while(board[i][++j]==com);        //\r\n							if(board[i][j]==8){\r\n											j=y;       // \r\n											nstab++;\r\n											continue;\r\n												}\r\n									else if(board[i][j]==opp){                  //\r\n															j=y;\r\n															while(board[i][--j]==com);    //\r\n															if(board[i][j]!=0){           //\r\n																			j=y;       //  \r\n																			nstab++;\r\n																			continue;\r\n																				}\r\n																}\r\n							j=y;        //          \r\n								}//end if\r\n    return nstab;\r\n}\r\n\r\nint V_AX(int j,int s)                 // \r\n{\r\n    int i,x,nstab=0,count=0,ncom=0;\r\n    int com,opp;\r\n    com=s;opp = (s==1)?2:1;\r\n    for(i=1;i<9;i++)				//		\r\n		if(board[i][j]!=0){\r\n						if(board[i][j]==com) ncom++;	//\r\n						count++;					//\r\n							}\r\n			else break;\r\n    if(count==8)	return ncom;		//8 ()\r\n\r\n    for(i=1;i<9;i++)			\r\n		if(board[i][j]==com){	//begin if\r\n							x=i;\r\n							while(board[--i][j]==com);         // \r\n							if(board[i][j]==8){                //8 \r\n											i=x;         //             \r\n											nstab++;\r\n											continue;\r\n												}\r\n								else if(board[i][j]==opp){                       //\r\n														i=x;\r\n														while(board[++i][j]==com);    //\r\n														if(board[i][j]!=0){           //\r\n																		i=x;       // \r\n																		nstab++;\r\n																		continue;\r\n																			}\r\n                                                           }\r\n                                                           \r\n							i=x;\r\n							while(board[++i][j]==com);        //\r\n							if(board[i][j]==8){\r\n											i=x;       // \r\n											nstab++;\r\n											continue;\r\n												}\r\n								else if(board[i][j]==opp){                  //\r\n														i=x;\r\n														while(board[--i][j]==com);    //\r\n														if(board[i][j]!=0){           //\r\n																		i=x;       //  \r\n																		nstab++;\r\n																		continue;\r\n																			}\r\n                                                            }\r\n							i=x;        //          \r\n							}//end if\r\n    return nstab;\r\n}\r\n\r\nint BD_AX(int i,int j,int s)          // \r\n{\r\n    \r\n    int x,y;\r\n    int com,opp;\r\n    com=s;opp = (s==1)?2:1;\r\n    if(board[i][j]==com){\r\n						x=i;y=j;\r\n						while(board[--i][--j]==com);         // \r\n						if(board[i][j]==8)    return 1;		// \r\n							else if(board[i][j]==opp){			//\r\n													i=x;j=y;\r\n													while(board[++i][++j]==com);    //\r\n													if(board[i][j]!=0)    return 1;      //\r\n														}\r\n                                                           \r\n						i=x;j=y;\r\n						while(board[++i][++j]==com);        //\r\n						if(board[i][j]==8)    return 1;\r\n							else if(board[i][j]==opp){			//\r\n													i=x;j=y;\r\n													while(board[--i][--j]==com);    //\r\n													if(board[i][j]!=0)    return 1;       //\r\n														}\r\n						}\r\n    return 0;\r\n}\r\n\r\nint FD_AX(int i,int j,int s)          //  \r\n{\r\n    \r\n    int x,y;\r\n    int com,opp;\r\n    com=s;opp = (s==1)?2:1;\r\n    if(board[i][j]==com){\r\n						x=i;y=j;\r\n						while(board[--i][++j]==com);         // \r\n						if(board[i][j]==8)    return 1;\r\n							else if(board[i][j]==opp){                       //\r\n													i=x;j=y;\r\n													while(board[++i][--j]==com);    //\r\n													if(board[i][j]!=0)    return 1;      //\r\n														}\r\n                                                           \r\n						i=x;j=y;\r\n						while(board[++i][--j]==com);        //\r\n						if(board[i][j]==8)    return 1;\r\n							else if(board[i][j]==opp){                    //\r\n													i=x;j=y;\r\n													while(board[--i][++j]==com);    //\r\n													if(board[i][j]!=0)    return 1;       //\r\n														}\r\n							}\r\n    return 0;\r\n} \r\n\r\n\r\nint stab(int s)                       // \r\n{\r\n    int i,j,value=0;\r\n    for(i=1;i<9;i++)\r\n		value+=H_AX(i,s);\r\n\r\n    for(j=1;j<9;j++)\r\n		value+=V_AX(j,s);\r\n\r\n	for(i=1;i<9;i++)\r\n		for(j=1;j<9;j++)\r\n			value+=BD_AX(i,j,s);\r\n\r\n	for(i=1;i<9;i++)\r\n		for(j=1;j<9;j++)\r\n			value+=FD_AX(i,j,s);\r\n                                      \r\n	return value;\r\n      \r\n}\r\n\r\nlong cornerValue(int s)                                //\r\n{\r\n    int com,opp,i,j;\r\n    long value=0;\r\n    com=s ;opp=(s==1)?2:1;\r\n    if(board[1][1]==com)      value+=1000;       // \r\n    if(board[1][8]==com)      value+=1000;\r\n    if(board[8][1]==com)      value+=1000;\r\n    if(board[8][8]==com)      value+=1000;\r\n    \r\n    if(board[1][1]==opp)      value-=1000;       // \r\n    if(board[1][8]==opp)      value-=1000;\r\n    if(board[8][1]==opp)      value-=1000;\r\n    if(board[8][8]==opp)      value-=1000;\r\n    \r\n    if(board[1][1]==0){                                      // \r\n		if(board[1][2]==com){              //(1,2) \r\n							j=2;\r\n							while(board[1][++j]==com);\r\n							if(board[1][j]==opp) value-=1000;             //value \r\n								}\r\n		if(board[2][1]==com){                   //(2,1)\r\n							i=2;\r\n							while(board[++i][1]==com);\r\n							if(board[i][1]==opp) value-=1000;             //value\r\n								}\r\n		if(board[2][2]==com){                //(2,2)\r\n							i=2;j=2;\r\n							while(board[++i][++j]==com);\r\n							if(board[i][j]==opp) value-=1000;        // value \r\n								}\r\n                   }\r\n                   \r\n    if(board[1][8]==0){                                      // \r\n		if(board[1][7]==com){                    //(1,7) \r\n							j=7;\r\n							while(board[1][--j]==com);\r\n							if(board[1][j]==opp) value-=1000;             //value \r\n								}\r\n		if(board[2][8]==com){                   //(2,8)\r\n							i=2;\r\n							while(board[++i][1]==com);\r\n							if(board[i][1]==opp) value-=1000;             //value\r\n								}\r\n		if(board[2][7]==com){                  //(2,7)\r\n							i=2;j=7;\r\n							while(board[++i][--j]==com);\r\n							if(board[i][j]==opp) value-=1000;           // value  \r\n								}           \r\n                   }\r\n                   \r\n    if(board[8][1]==0){                                     //                                                           \r\n		if(board[8][2]==com){              \r\n							j=2;\r\n							while(board[8][++j]==com);\r\n							if(board[8][j]==opp) value-=1000;             \r\n								}\r\n		if(board[7][1]==com){                  \r\n							i=7;\r\n							while(board[--i][1]==com);\r\n							if(board[i][1]==opp) value-=1000;             \r\n								}\r\n		if(board[7][2]==com){                  \r\n							i=7;j=2;\r\n							while(board[--i][++j]==com);\r\n							if(board[i][j]==opp) value-=1000;            \r\n								}\r\n                   }\r\n                   \r\n    if(board[8][8]==0){                                     //                                                           \r\n		if(board[8][7]==com){              \r\n							j=7;\r\n							while(board[8][--j]==com);\r\n							if(board[8][j]==opp) value-=1000;             \r\n								}\r\n		if(board[7][8]==com){                  \r\n							i=7;\r\n							while(board[--i][8]==com);\r\n							if(board[i][8]==opp) value-=1000;             \r\n								}\r\n		if(board[7][7]==com){                  \r\n							i=7;j=7;\r\n							while(board[--i][--j]==com);\r\n							if(board[i][j]==opp) value-=1000;            \r\n								}\r\n                   }\r\n    return value;\r\n}               \r\n     \r\nlong lineValue (int s)                // \r\n{\r\n    int com,opp,i,j,x,y;\r\n    long value=0;\r\n    com=s ;opp=(s==1)?2:1;\r\n    for(x=1;x<=8;x++){\r\n						if(board[x][1]==opp){\r\n											j=1;\r\n											while(board[x][++j]==opp);\r\n											if(board[x][j]==com){\r\n																while(board[x][++j]==com);\r\n																if(board[x][j]==0) value-=100; \r\n																	}\r\n												}\r\n\r\n						if(board[x][8]==opp){\r\n											j=8;\r\n											while(board[x][--j]==opp);\r\n											if(board[x][j]==com){\r\n																while(board[x][--j]==com);\r\n																if(board[x][j]==0) value-=100; \r\n																	}\r\n												}\r\n                      }\r\n                     \r\n    for(y=1;y<=8;y++){\r\n						if(board[1][y]==opp){\r\n											i=1;\r\n											while(board[++i][y]==opp);\r\n											if(board[i][y]==com){\r\n																while(board[++i][y]==com);\r\n																if(board[i][y]==0) value-=100; \r\n																	}\r\n												}\r\n\r\n						if(board[8][y]==opp){\r\n											i=8;\r\n											while(board[--i][y]==opp);\r\n											if(board[i][y]==com){\r\n																while(board[--i][y]==com);\r\n																if(board[i][y]==0) value-=100; \r\n																	}\r\n										}\r\n                     }\r\n    return value;\r\n} \r\n\r\n\r\nlong firstValue (int s)                      // \r\n{\r\n    int com,opp;\r\n    long value=0;\r\n    com=s ;opp=(s==1)?2:1;\r\n    value+=30*cornerValue(s)+30*lineValue(s)+100*stab(s); \r\n    value+=20*(mobility(com)- mobility(opp))+5*(preMobility(com)- preMobility(opp));\r\n    \r\n    return value;\r\n}                                            \r\n\r\nlong midValue (int s)						//\r\n{\r\n    int com,opp;\r\n    long value=0;\r\n    com=s ;opp=(s==1)?2:1;\r\n    value+=30*(mobility(com)-mobility(opp))+8*(preMobility(com)-preMobility(opp));\r\n    value+=30*cornerValue(s)+30*lineValue(s)+100*stab(s);\r\n    \r\n    return value;\r\n}                                                                                                                                                                                                                                                             \r\nlong lastValue (int com,int opp)            // \r\n{\r\n    return count(com)-count(opp);\r\n}\r\n\r\nlong Value(int s)                           //\r\n {\r\n     int com,opp;\r\n     com=s ;opp=(s==1)?2:1;                                \r\n     if(totalCount()<=18)	return firstValue(s);\r\n     if(totalCount()>18&&totalCount()<51)\r\n							return midValue(s);\r\n       else return lastValue(com,opp);\r\n     \r\n                                                   \r\n}\r\n\r\n\r\nlong lastFind(int s,int depth, long alpha,long beta)\r\n{\r\n    int com,opp,temp[10][10],i,j,flag=0,k=0;\r\n    long value;\r\n    com=s ;opp=(s==1)?2:1;\r\n    if(totalCount()==64)   return lastValue(S,S==1?2:1);			//\r\n    \r\n    if(depth%2==0){\r\n		for(i=1;i<9;i++){\r\n			for(j=1;j<9;j++)\r\n				if(judge(i,j,com)){\r\n                                    k=1;                        \r\n									saveBoard(temp);\r\n									newBoard(i,j,com);\r\n									value=alphabeta(opp,depth-1,alpha,beta);\r\n									resetBoard(temp);\r\n									if(value>alpha&&value<beta){\r\n																	alpha=value;\r\n																	if(depth==DEPTH){\r\n																						maxi=i;\r\n																						maxj=j;\r\n																							}\r\n																		}\r\n																		else if (value>=beta){\r\n																								alpha=value;\r\n																								flag=1;\r\n																								break;\r\n																								}\r\n																			}\r\n                                   if(flag){\r\n                                            flag=0;\r\n                                            break;\r\n                                            }\r\n                                   }\r\n                   if(k==0) return Value(S);\r\n                   return alpha;\r\n                   }\r\n                   \r\n    if(depth%2==1){\r\n		for(i=1;i<9;i++){\r\n			for(j=1;j<9;j++)\r\n				if(judge(i,j,com)){\r\n                                    k=1;\r\n									saveBoard(temp);\r\n									newBoard(i,j,com);\r\n									value=alphabeta(opp,depth-1,alpha,beta);\r\n									resetBoard(temp);\r\n									if(value>alpha&&value<beta){\r\n																	beta=value;\r\n																	if(depth==DEPTH){\r\n																						maxi=i;\r\n																						maxj=j;\r\n																						}\r\n																		}\r\n																		else if (value<=alpha){\r\n																								beta=value;\r\n																								flag=1;\r\n																								break;\r\n																									}\r\n																	}\r\n                                   if(flag){\r\n                                            flag=0;\r\n                                            break;\r\n                                            }\r\n                                   }\r\n                   if(k==0) return Value(S);\r\n                   return beta;\r\n                   }\r\n}','compile correct','gcc','othello','2013-05-23 23:35:10','');
INSERT INTO task VALUES (186,'cheng2','#include <stdio.h>\r\n#define BLACK 1\r\n#define WHITE -1\r\n#define EMPTY 0\r\n\r\nclass CBwfind \r\n{\r\npublic:\r\n	//\r\n	void SaveBoard(int tb[][8]);\r\n	int outcome;\r\n	int bak;\r\n	//64\r\n	int save[64][8][8];\r\n	bool preview;\r\n	int stepx,stepy;\r\n	//\r\n	bool search(int tb[][8],int);\r\n	int depth;\r\n	int searchend;\r\n	//\r\n	int CountNum();\r\n	int CountWhite();\r\n	int CountBlack();\r\n	void select(int);\r\n	void newboard(int tb[][8],int,int,int);\r\n	bool decide(int,int,int);\r\n	CBwfind();\r\n	int board[8][8];\r\n	virtual ~CBwfind();\r\n	int ComChoice,ManChoice;\r\n    \r\nprotected:\r\n	\r\nprivate:\r\n	//\r\n	void Corner(int tb[][8],int i,int j,int &value);\r\n	void LineSense(int tb[][8],int chessx,int chessy,int &value);\r\n	int Mobility(int tb[][8],int flag);\r\n	void CornerSense(int tb[][8],int &);\r\n	int valuefirst(int tb[][8]);\r\n	int findfirst(int tb[][8],int &,int &, int);\r\n	//\r\n	int white(int tb[][8]);\r\n	int black(int tb[][8]);\r\n	int Total(int tb[][8]);\r\n	bool judge(int tb[][8],int chessx,int chessy,int flag);\r\n	int findlast(int tb[][8], int &,int &,int);\r\n};\r\n\r\n//////////////////////////////////////////////////////////////////////\r\n\r\nCBwfind::CBwfind()\r\n{\r\n	int i,j;	\r\n	stepx=-1;\r\n	stepy=-1;\r\n	depth=6;\r\n	searchend=52;\r\n	preview=false;\r\n	outcome=0;\r\n\r\n	for(i=0;i<8;i++) for(j=0;j<8;j++)\r\n		board[i][j]=EMPTY;\r\n\r\n	board[3][3]=WHITE;\r\n	board[4][4]=WHITE;\r\n	board[3][4]=BLACK;\r\n	board[4][3]=BLACK;\r\n}\r\n\r\nCBwfind::~CBwfind()\r\n{\r\n\r\n}\r\n\r\n//\r\nbool CBwfind::decide(int chessx, int chessy, int flag)\r\n{\r\n	//\r\n	if(chessx>7||chessx<0||chessy>7||chessy<0)\r\n		return false;\r\n	if(board[chessx][chessy]==0)\r\n		return judge(board,chessx,chessy,flag);\r\n	else \r\n		return false;\r\n}\r\n\r\n//\r\nbool CBwfind::judge(int tb[][8],int chessx, int chessy, int flag)\r\n{\r\n	int x=chessx,y=chessy;\r\n	if(tb[x][y]!=0) return false;\r\n	//\r\n	if(x>=2&&y>=2)\r\n		if(tb[x-1][y-1]+flag==0){\r\n			x=x-2;\r\n			y=y-2;\r\n			while(x>=0&&y>=0){\r\n				if(tb[x][y]==flag) \r\n					return true;\r\n				else if(tb[x][y]==-flag)\r\n				{\r\n					x--;\r\n					y--;\r\n				}\r\n				else {x=-1;y=-1;}\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(x>=2)\r\n		if(tb[x-1][y]+flag==0){\r\n			x=x-2;\r\n			while(x>=0){\r\n				if(tb[x][y]==flag) \r\n					return true;\r\n				else if(tb[x][y]==-flag) \r\n					x--;\r\n				else\r\n				{\r\n					x=-1;\r\n				}\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(x>=2&&y<=5)\r\n		if(tb[x-1][y+1]+flag==0){\r\n			x=x-2;y=y+2;\r\n			while(x>=0&&y<=7){\r\n				if(tb[x][y]==flag) return true;\r\n				else if(tb[x][y]==-flag)\r\n				{\r\n					x--;\r\n					y++;\r\n				}\r\n				else {x=-1;}\r\n				//x--;y++;\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(y<=5)\r\n		if(tb[x][y+1]+flag==0){\r\n			y=y+2;\r\n			while(y<=7){\r\n				if(tb[x][y]==flag) return true;\r\n				else if(tb[x][y]==-flag){y++;}\r\n				else {y=8;}\r\n				//y++;\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(x<=5&&y<=5)\r\n		if(tb[x+1][y+1]+flag==0){\r\n			x=x+2;y=y+2;\r\n			while(x<=7&&y<=7){\r\n				if(tb[x][y]==flag) return true;\r\n				else if(tb[x][y]==-flag){x++;y++;}\r\n				else {x=8;y=8;}\r\n				//x++;y++;\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(x<=5)\r\n		if(tb[x+1][y]+flag==0){\r\n			x=x+2;\r\n			while(x<=7){\r\n				if(tb[x][y]==flag) return true;\r\n				else if(tb[x][y]==-flag){x++;}\r\n				else {x=8;}\r\n				//x++;\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(x<=5&&y>=2)\r\n		if(tb[x+1][y-1]+flag==0){\r\n			x=x+2;y=y-2;\r\n			while(x<=7&&y>=0){\r\n				if(tb[x][y]==flag) return true;\r\n				else if(tb[x][y]==-flag){x++;y--;}\r\n				else {y=-1;}\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(y>=2)\r\n		if(tb[x][y-1]+flag==0){\r\n			y=y-2;\r\n			while(y>=0){\r\n				if(tb[x][y]==flag) return true;\r\n				else if(tb[x][y]==-flag){y--;}\r\n				else {y=-1;}\r\n			}\r\n		}\r\n	return false;\r\n			\r\n}\r\n\r\n\r\nvoid CBwfind::select(int flag)\r\n{\r\n	int step,i,j,cut=1000000,tf=flag;\r\n	int tb[8][8];\r\n	for(i=0;i<8;i++)for(j=0;j<8;j++) tb[i][j]=board[i][j];\r\n	step=CountNum();\r\n	//\r\n	if(step<searchend){\r\n		int ss=0;\r\n		findfirst(tb,ss,tf,cut);\r\n	}\r\n	//\r\n	else if(step>=searchend){\r\n		preview=true;\r\n		outcome=findlast(tb,step,tf,cut);\r\n	}\r\n}\r\n\r\nint CBwfind::CountBlack()\r\n{\r\n	int CB=0;\r\n	for(int i=0;i<8;i++)\r\n		for(int j=0;j<8;j++)\r\n			if(board[i][j]== BLACK) CB++;\r\n	return CB;\r\n}\r\n\r\nint CBwfind::CountWhite()\r\n{\r\n	int WB=0;\r\n	for(int i=0;i<8;i++)\r\n		for(int j=0;j<8;j++)\r\n			if(board[i][j]== WHITE) WB++;\r\n	return WB;\r\n}\r\n\r\n\r\n\r\nint CBwfind::CountNum()\r\n{\r\n	int Number=0,i,j;\r\n	for(i=0;i<8;i++)for(j=0;j<8;j++)\r\n		if(board[i][j]!=0) Number++;\r\n	return Number;\r\n}\r\n\r\n\r\n\r\n\r\nint CBwfind::Total(int tb[][8])\r\n{\r\n	int Num=0,i,j;\r\n	for(i=0;i<8;i++)\r\n		for(j=0;j<8;j++)\r\n			if(tb[i][j]==0) Num++;\r\n	return Num;\r\n}\r\n\r\nint CBwfind::black(int tb[][8] )\r\n{\r\n	int Bn=0,i,j;\r\n	for(i=0;i<8;i++)\r\n		for(j=0;j<8;j++)\r\n			if(tb[i][j]-1==0) Bn++;\r\n	return Bn;\r\n}\r\n\r\nint CBwfind::white(int tb[][8] )\r\n{\r\n	int Wn=0,i,j;\r\n		for(i=0;i<8;i++)\r\n		for(j=0;j<8;j++)\r\n			if(tb[i][j]==-1) Wn++;\r\n	return Wn;\r\n}\r\n\r\n\r\n\r\nbool CBwfind::search(int tb[][8] , int flag)\r\n{\r\n	int i,j;\r\n	for(i=0;i<8;i++)for(j=0;j<8;j++)\r\n		if(judge(tb,i,j,flag)) return true;\r\n	return false;\r\n}\r\n\r\nint CBwfind::findfirst(int tb[][8] , int &step, int &flag, int cut)\r\n{\r\n	int value=0,max=-100000,min=100000,k=0,i,j;\r\n	int temp[8][8];\r\n	if(step==depth){\r\n		return valuefirst(tb);\r\n	}\r\n	for(i=0;i<8;i++)for(j=0;j<8;j++) temp[i][j]=tb[i][j];\r\n	for(i=0;i<8;i++)for(j=0;j<8;j++){\r\n		if(judge(tb,i,j,flag)){\r\n			int ii,jj;\r\n			value=0;\r\n			k=1;//\r\n			newboard(tb,i,j,flag);\r\n			flag=-flag;\r\n			step++;\r\n			if(-flag==ComChoice){\r\n				LineSense(tb,i,j,value);\r\n				Corner(tb,i,j,value);\r\n				value+=findfirst(tb,step,flag,max);\r\n			}\r\n			if(-flag==ManChoice){\r\n				Corner(tb,i,j,value);\r\n				LineSense(tb,i,j,value);\r\n				value+=findfirst(tb,step,flag,min);\r\n			}\r\n			step--;\r\n			flag=-flag;\r\n			//\r\n			for(ii=0;ii<8;ii++)\r\n				for(jj=0;jj<8;jj++) \r\n					tb[ii][jj]=temp[ii][jj];\r\n			if(flag-ManChoice==0&&value<cut) \r\n				return value;\r\n			if(flag-ComChoice==0&&value>cut) \r\n				return value;\r\n			if(flag-ManChoice==0){\r\n				if(value<min){\r\n					min=value;\r\n				}\r\n			}\r\n			if(flag-ComChoice==0){\r\n				if(value>max){\r\n					max=value;\r\n					if(step==0){\r\n						stepx=i;\r\n						stepy=j;\r\n					}\r\n				}\r\n			}\r\n		}//if\r\n	}//for\r\n	//\r\n	if(k==0){\r\n		flag=-flag;\r\n		if(search(tb,flag)){\r\n			value=findfirst(tb,step,flag,cut);\r\n			flag=-flag;\r\n			return value;\r\n		}\r\n		else{\r\n			flag=-flag;\r\n			return valuefirst(tb);\r\n		}\r\n	}\r\n	//\r\n	else{\r\n		if(flag-ManChoice==0) return min;\r\n		else if(flag-ComChoice==0){\r\n			//if\r\n			return max;\r\n		}//if\r\n	}//else\r\n}\r\n\r\nint CBwfind::valuefirst(int tb[][8] )\r\n{\r\n	int flag,minus,corner=0,v,ComMobil,ManMobil,DiffMobil,Num,squre;\r\n	int danger;\r\n	flag=ComChoice;\r\n	ComMobil=Mobility(tb,ComChoice);\r\n	ManMobil=Mobility(tb,ManChoice);\r\n	//DiffMobil=ComMobil*ComMobil-ManMobil*ManMobil;\r\n	//a\r\n	DiffMobil=ComMobil-ManMobil;\r\n	//b\r\n	Num=Total(tb);\r\n	if(flag==1){\r\n		minus=white(tb)-black(tb);\r\n		if(minus>=0) squre=minus*minus;\r\n		else squre=-minus*minus;\r\n		danger=black(tb);\r\n	}\r\n	if(flag==-1){\r\n		minus=black(tb)-white(tb);\r\n		if(minus>=0) squre=minus*minus;\r\n		else squre=-minus*minus;\r\n		danger=white(tb);\r\n	}\r\n	\r\n	if(Num<25){\r\n		v=minus+2*DiffMobil;\r\n	}\r\n	else{\r\n		v=minus+3*DiffMobil;\r\n	}\r\n	if(danger==0) v=-10000;\r\n	return v;\r\n}\r\n\r\nint CBwfind::findlast(int tb[][8], int &step, int &flag, int cut)\r\n{\r\n	int value=0,max=-100000,min=100000,k=0,i,j;\r\n	int temp[8][8];\r\n	if(step==64){\r\n		if(ComChoice==1) return(black(tb)-white(tb));\r\n		else return(white(tb)-black(tb));\r\n	}\r\n	for(i=0;i<8;i++)for(j=0;j<8;j++) temp[i][j]=tb[i][j];\r\n	for(i=0;i<8;i++)for(j=0;j<8;j++){\r\n		if(judge(tb,i,j,flag)){\r\n			int ii,jj;\r\n			k=1;//\r\n			newboard(tb,i,j,flag);\r\n			flag=-flag;\r\n			step++;\r\n			if(-flag==ComChoice){\r\n				value=findlast(tb,step,flag,max);\r\n			}\r\n			if(-flag==ManChoice){\r\n				value=findlast(tb,step,flag,min);\r\n			}\r\n			step--;\r\n			flag=-flag;\r\n			//\r\n			for(ii=0;ii<8;ii++)for(jj=0;jj<8;jj++) tb[ii][jj]=temp[ii][jj];\r\n			if(flag-ManChoice==0&&value<cut) return value;\r\n			if(flag-ComChoice==0&&value>cut) return value;\r\n			if(flag-ManChoice==0){\r\n				if(value<min){\r\n					min=value;\r\n				}\r\n			}\r\n			if(flag-ComChoice==0){\r\n				if(value>max){\r\n					max=value;\r\n					if(step==CountNum()){\r\n						stepx=i;\r\n						stepy=j;\r\n					}\r\n				}\r\n			}\r\n		}//if\r\n	}//for\r\n	//\r\n	if(k==0){\r\n		flag=-flag;\r\n		if(search(tb,flag)){\r\n			value=findlast(tb,step,flag,cut);\r\n			flag=-flag;\r\n			return value;\r\n		}\r\n		else{\r\n			flag=-flag;\r\n			if(ComChoice==1) return(black(tb)-white(tb));\r\n			else return(white(tb)-black(tb));\r\n		}\r\n	}\r\n	//\r\n	else{\r\n		if(flag-ManChoice==0) return min;\r\n		if(flag-ComChoice==0){\r\n			return max;\r\n		}\r\n\r\n	}\r\n}\r\nvoid CBwfind::newboard(int tb[][8],int chessx, int chessy, int flag)\r\n{\r\n	int x=chessx,y=chessy;\r\n	//\r\n	tb[x][y]=flag;\r\n	if(x>=2&&y>=2)\r\n		if(tb[x-1][y-1]+flag==0){\r\n			x=x-2;\r\n			y=y-2;\r\n			while(x>=0&&y>=0){\r\n				if(tb[x][y]==flag){\r\n					for(int i=x,j=y;i!=chessx&&j!=chessy;i++,j++)\r\n						tb[i][j]=flag;\r\n					x=0;y=0;\r\n				}\r\n				else if(tb[x][y]==0){x=-1;y=-1;}\r\n				{x--;y--;}\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(x>=2)\r\n		if(tb[x-1][y]+flag==0){\r\n			x=x-2;\r\n			while(x>=0){\r\n				if(tb[x][y]==flag){\r\n					for(int i=x;i!=chessx;i++)\r\n						tb[i][chessy]=flag;\r\n					x=0;\r\n				} \r\n				else if(tb[x][y]==0){x=-1;y=-1;}\r\n				x--;\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(x>=2&&y<=5)\r\n		if(tb[x-1][y+1]+flag==0){\r\n			x=x-2;y=y+2;\r\n			while(x>=0&&y<=7){\r\n				if(tb[x][y]==flag){\r\n					for(int i=x,j=y;i!=chessx&&j!=chessy;i++,j--)\r\n						tb[i][j]=flag;\r\n					x=0;y=7;\r\n				} \r\n				else if(tb[x][y]==0){x=-1;}\r\n				{x--;y++;}\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(y<=5)\r\n		if(tb[x][y+1]+flag==0){\r\n			y=y+2;\r\n			while(y<=7){\r\n				if(tb[x][y]==flag){\r\n					for(int j=y;j!=chessy;j--)\r\n						tb[chessx][j]=flag;\r\n					y=7;\r\n				}\r\n				else if(tb[x][y]==0){y=8;}\r\n				y++;\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(x<=5&&y<=5)\r\n		if(tb[x+1][y+1]+flag==0){\r\n			x=x+2;y=y+2;\r\n			while(x<=7&&y<=7){\r\n				if(tb[x][y]==flag){\r\n					for(int i=x,j=y;i!=chessx&&j!=chessy;i--,j--)\r\n						tb[i][j]=flag;\r\n					x=7;y=7;\r\n				}\r\n				\r\n				else if(tb[x][y]==0){x=8;y=8;}\r\n				{x++;y++;}\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(x<=5)\r\n		if(tb[x+1][y]+flag==0){\r\n			x=x+2;\r\n			while(x<=7){\r\n				if(tb[x][y]==flag){\r\n					for(int i=x;i!=chessx;i--)\r\n						tb[i][chessy]=flag;\r\n					x=7;\r\n				}\r\n				else if(tb[x][y]==0){x=8;}\r\n				x++;\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(x<=5&&y>=2)\r\n		if(tb[x+1][y-1]+flag==0){\r\n			x=x+2;y=y-2;\r\n			while(x<=7&&y>=0){\r\n				if(tb[x][y]==flag){\r\n					for(int i=x,j=y;i!=chessx&&j!=chessy;i--,j++)\r\n						tb[i][j]=flag;\r\n					x=7;y=0;\r\n				}\r\n				else if(tb[x][y]==0){y=-1;}\r\n				{x++;y--;}\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(y>=2)\r\n		if(tb[x][y-1]+flag==0){\r\n			y=y-2;\r\n			while(y>=0){\r\n				if(tb[x][y]==flag){\r\n					for(int j=y;j!=chessy;j++)\r\n						tb[chessx][j]=flag;\r\n					y=0;\r\n				}\r\n				else if(tb[x][y]==0){y=-1;}\r\n				y--;\r\n			}\r\n		}\r\n}\r\n\r\n\r\n\r\nvoid CBwfind::CornerSense(int tb[][8], int &value)\r\n{	\r\n	int flag,corner=0;\r\n	//int i,j;\r\n	flag=ComChoice;\r\n	\r\n	if(tb[0][0]-flag!=0){\r\n		if((tb[1][0]-flag==0)||(tb[1][1]-flag==0)||(tb[0][1]-flag==0))\r\n			corner-=1000;\r\n	}\r\n	else if(tb[0][0]==flag)corner+=1000;\r\n	if(tb[0][7]-flag!=0){\r\n		if((tb[0][6]-flag==0)||(tb[1][7]-flag==0)||(tb[1][6]-flag==0))\r\n			corner-=1000;\r\n	}\r\n	else if(tb[0][0]==flag)corner+=1000;\r\n	if(tb[7][0]-flag!=0){\r\n		if((tb[6][0]-flag==0)||(tb[7][1]-flag==0)||(tb[6][1]-flag==0))\r\n			corner-=1000;\r\n	}\r\n	else if(tb[0][0]==flag)corner+=1000;\r\n	if(tb[7][7]-flag!=0){\r\n		if((tb[7][6]-flag==0)||(tb[6][7]-flag==0)||(tb[6][6]-flag==0))\r\n			corner-=1000;\r\n	}\r\n	else if(tb[0][0]==flag)corner+=1000;\r\n	value+=corner;\r\n}\r\n\r\n\r\n\r\n\r\n\r\nint CBwfind::Mobility(int tb[][8], int flag)\r\n{\r\n	int move=0,i,j;\r\n	for(i=0;i<8;i++)for(j=0;j<8;j++){\r\n		if(judge(tb,i,j,flag)) move++;\r\n	}\r\n	return move;\r\n}\r\n\r\nvoid CBwfind::LineSense(int tb[][8], int chessx, int chessy, int &value)\r\n{\r\n	int line=0;\r\n	int i,j;\r\n	if(tb[0][0]==ManChoice){\r\n		if(chessx==0){\r\n			j=0;\r\n			while(tb[0][j]==ManChoice) j++;\r\n			if(tb[0][j]==ComChoice){\r\n				while(j<8&&tb[0][j]==ComChoice) j++;\r\n				if(j<8&&tb[0][j]==0) line-=1000;\r\n			}\r\n		}\r\n		if(chessy=0){\r\n			i=0;\r\n			while(tb[i][0]==ManChoice) i++;\r\n			if(tb[i][0]==ComChoice){\r\n				while(i<8&&tb[i][0]==ComChoice) i++;\r\n				if(i<8&&tb[i][0]==0) line-=1000;\r\n			}\r\n		}\r\n	}\r\n	if(tb[0][7]==ManChoice){\r\n		if(chessx==0){\r\n			j=7;\r\n			while(tb[0][j]==ManChoice) j--;\r\n			if(tb[0][j]==ComChoice){\r\n				while(j>=0&&tb[0][j]==ComChoice) j--;\r\n				if(j>=0&&tb[0][j]==0) line-=1000;\r\n			}\r\n		}\r\n		if(chessy=7){\r\n			i=0;\r\n			while(tb[i][7]==ManChoice) i++;\r\n			if(tb[i][7]==ComChoice){\r\n				while(i<8&&tb[i][7]==ComChoice) i++;\r\n				if(i<8&&tb[i][7]==0) line-=1000;\r\n			}\r\n		}\r\n	}\r\n	if(tb[7][0]==ManChoice){\r\n		if(chessx==7){\r\n			j=0;\r\n			while(tb[0][j]==ManChoice) j++;\r\n			if(tb[0][j]==ComChoice){\r\n				while(j<8&&tb[0][j]==ComChoice) j++;\r\n				if(j<8&&tb[0][j]==0) line-=1000;\r\n			}\r\n		}\r\n		if(chessy=0){\r\n			i=7;\r\n			while(tb[i][0]==ManChoice) i--;\r\n			if(tb[i][0]==ComChoice){\r\n				while(i>=0&&tb[i][0]==ComChoice) i--;\r\n				if(i>=0&&tb[i][0]==0) line-=1000;\r\n			}\r\n		}\r\n	}\r\n	if(tb[7][7]==ManChoice){\r\n		if(chessx==7){\r\n			j=7;\r\n			while(tb[0][j]==ManChoice) j--;\r\n			if(tb[0][j]==ComChoice){\r\n				while(j>=0&&tb[7][j]==ComChoice) j--;\r\n				if(j>=0&&tb[7][j]==0) line-=1000;\r\n			}\r\n		}\r\n		if(chessy=7){\r\n			i=7;\r\n			while(tb[i][7]==ManChoice) i--;\r\n			if(tb[i][7]==ComChoice){\r\n				while(i<8&&tb[i][7]==ComChoice) i--;\r\n				if(i>=0&&tb[i][7]==0) line-=1000;\r\n			}\r\n		}\r\n	}\r\n	value+=line;\r\n\r\n}\r\n\r\nvoid CBwfind::SaveBoard(int tb[][8])\r\n{\r\n	int i,j;\r\n	bak++;\r\n	for(i=0;i<8;i++)\r\n		for(j=0;j<8;j++) \r\n			save[bak][i][j]=tb[i][j];\r\n}\r\n\r\n\r\nvoid CBwfind::Corner(int tb[][8], int chessx, int chessy, int &value)\r\n{\r\n	int flag=ComChoice;\r\n	int corner=0;\r\n	int i=chessx,j=chessy;\r\n	if(i==0&&j==0&&tb[0][0]==flag) value+=2000;//return;\r\n	if(i==0&&j==7&&tb[0][7]==flag) value+=2000;//return;\r\n	if(i==7&&j==0&&tb[7][0]==flag) value+=2000;//return;\r\n	if(i==7&&j==7&&tb[7][7]==flag) value+=2000;//return;\r\n	if(tb[0][0]==0){\r\n		//if(i==0&&tb[0][1]==flag){\r\n		if(tb[0][1]==flag){\r\n			j=1;\r\n			while(j<8&&tb[0][j]==flag) j++;\r\n			if(j<8&&tb[0][j]==-flag) value-=5000;\r\n		}\r\n		//if(j==0&&tb[1][0]==flag){\r\n		if(tb[1][0]==flag){\r\n			i=1;\r\n			while(i<8&&tb[i][0]==flag) i++;\r\n			if(i<8&&tb[i][0]==-flag) value-=5000;\r\n		}\r\n	}\r\n	i=chessx;j=chessy;\r\n	if(tb[0][7]==0){\r\n		//if(i==0&&tb[0][6]==flag){\r\n		if(tb[0][6]==flag){\r\n			j=6;\r\n			while(j>=0&&tb[0][j]==flag) j--;\r\n			if(j>=0&&tb[0][j]==-flag) value-=5000;\r\n		}\r\n		//if(j==7&&tb[1][7]==flag){\r\n		if(tb[1][7]==flag){\r\n			i=1;\r\n			while(i<8&&tb[i][7]==flag) i++;\r\n			if(i<8&&tb[i][7]==-flag) value-=5000;\r\n		}\r\n	}\r\n	i=chessx;j=chessy;\r\n	if(tb[7][0]==0){\r\n		//if(i==7&&tb[7][1]==flag){\r\n		if(tb[7][1]==flag){\r\n			j=1;\r\n			while(j<8&&tb[7][j]==flag) j++;\r\n			if(j<8&&tb[7][j]==-flag) value-=5000;\r\n		}\r\n		//if(j==0&&tb[6][0]==flag){\r\n		if(tb[6][0]==flag){\r\n			i=6;\r\n			while(i>=0&&tb[i][0]==flag) i--;\r\n			if(i>=0&&tb[i][0]==-flag) value-=5000;\r\n		}\r\n	}\r\n	i=chessx;j=chessy;\r\n	if(tb[7][7]==0){\r\n		//if(i==7&&tb[7][6]==flag){\r\n		if(tb[7][6]==flag){\r\n			j=6;\r\n			while(j>=0&&tb[7][j]==flag) j--;\r\n			if(j>=0&&tb[7][j]==-flag) value-=5000;\r\n		}\r\n		//if(j==7&&tb[6][7]==flag){\r\n		if(tb[6][7]==flag){\r\n			i=6;\r\n			while(i>=0&&tb[i][7]==flag) i--;\r\n			if(i>=0&&tb[i][7]==-flag) value-=5000;\r\n		}\r\n	}\r\n	//\r\n	i=chessx;j=chessy;\r\n	if(i==1&&j==1&&tb[0][0]-flag!=0&&tb[i][j]==flag)\r\n		value-=2000;\r\n	if(i==1&&j==6&&tb[0][7]-flag!=0&&tb[i][j]==flag)\r\n		value-=2000;\r\n	if(i==6&&j==1&&tb[7][0]-flag!=0&&tb[i][j]==flag)\r\n		value-=2000;\r\n	if(i==6&&j==6&&tb[7][7]-flag!=0&&tb[i][j]==flag)\r\n		value-=2000;\r\n}\r\n\r\nint main()\r\n{\r\n	CBwfind m_find;\r\n	m_find.depth=6;\r\n	m_find.preview=false;\r\n	m_find.bak=0;\r\n\r\n	m_find.ComChoice=BLACK;\r\n	m_find.ManChoice=WHITE;\r\n	int ComChoice = BLACK;\r\n	int ManChoice=WHITE;;\r\n\r\n	int tb[8][8];\r\n	int i,j;\r\n	for(i=0;i<8;i++)\r\n		for( j=0;j<8;j++)\r\n			scanf(\"%d\",&tb[i][j]);\r\n	for(i=0;i<8;i++)\r\n		for(j=0;j<8;j++) \r\n			if(tb[i][j] == 2)\r\n			{\r\n				m_find.board[i][j] = -1;\r\n				tb[i][j] = -1;\r\n			}\r\n			else\r\n				m_find.board[i][j] = tb[i][j];\r\n	int x,y;\r\n		m_find.select(ComChoice);\r\n		x=m_find.stepx;\r\n		y=m_find.stepy;\r\n	printf(\"%d %d\",x,y);\r\n	return 0;\r\n}\r\n		','compile correct','g++','othello','2013-05-24 13:36:10','');
INSERT INTO task VALUES (187,'strongAi','#include <stdio.h>\r\n#define BLACK 1\r\n#define WHITE -1\r\n#define EMPTY 0\r\n\r\nclass CBwfind \r\n{\r\npublic:\r\n	//\r\n	void SaveBoard(int tb[][8]);\r\n	int outcome;\r\n	int bak;\r\n	//64\r\n	int save[64][8][8];\r\n	bool preview;\r\n	int stepx,stepy;\r\n	//\r\n	bool search(int tb[][8],int);\r\n	int depth;\r\n	int searchend;\r\n	//\r\n	int CountNum();\r\n	int CountWhite();\r\n	int CountBlack();\r\n	void select(int);\r\n	void newboard(int tb[][8],int,int,int);\r\n	bool decide(int,int,int);\r\n	CBwfind();\r\n	int board[8][8];\r\n	virtual ~CBwfind();\r\n	int ComChoice,ManChoice;\r\n    \r\nprotected:\r\n	\r\nprivate:\r\n	//\r\n	void Corner(int tb[][8],int i,int j,int &value);\r\n	void LineSense(int tb[][8],int chessx,int chessy,int &value);\r\n	int Mobility(int tb[][8],int flag);\r\n	void CornerSense(int tb[][8],int &);\r\n	int valuefirst(int tb[][8]);\r\n	int findfirst(int tb[][8],int &,int &, int);\r\n	//\r\n	int white(int tb[][8]);\r\n	int black(int tb[][8]);\r\n	int Total(int tb[][8]);\r\n	bool judge(int tb[][8],int chessx,int chessy,int flag);\r\n	int findlast(int tb[][8], int &,int &,int);\r\n};\r\n\r\n//////////////////////////////////////////////////////////////////////\r\n\r\nCBwfind::CBwfind()\r\n{\r\n	int i,j;	\r\n	stepx=-1;\r\n	stepy=-1;\r\n	depth=6;\r\n	searchend=52;\r\n	preview=false;\r\n	outcome=0;\r\n\r\n	for(i=0;i<8;i++) for(j=0;j<8;j++)\r\n		board[i][j]=EMPTY;\r\n\r\n	board[3][3]=WHITE;\r\n	board[4][4]=WHITE;\r\n	board[3][4]=BLACK;\r\n	board[4][3]=BLACK;\r\n}\r\n\r\nCBwfind::~CBwfind()\r\n{\r\n\r\n}\r\n\r\n//\r\nbool CBwfind::decide(int chessx, int chessy, int flag)\r\n{\r\n	//\r\n	if(chessx>7||chessx<0||chessy>7||chessy<0)\r\n		return false;\r\n	if(board[chessx][chessy]==0)\r\n		return judge(board,chessx,chessy,flag);\r\n	else \r\n		return false;\r\n}\r\n\r\n//\r\nbool CBwfind::judge(int tb[][8],int chessx, int chessy, int flag)\r\n{\r\n	int x=chessx,y=chessy;\r\n	if(tb[x][y]!=0) return false;\r\n	//\r\n	if(x>=2&&y>=2)\r\n		if(tb[x-1][y-1]+flag==0){\r\n			x=x-2;\r\n			y=y-2;\r\n			while(x>=0&&y>=0){\r\n				if(tb[x][y]==flag) \r\n					return true;\r\n				else if(tb[x][y]==-flag)\r\n				{\r\n					x--;\r\n					y--;\r\n				}\r\n				else {x=-1;y=-1;}\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(x>=2)\r\n		if(tb[x-1][y]+flag==0){\r\n			x=x-2;\r\n			while(x>=0){\r\n				if(tb[x][y]==flag) \r\n					return true;\r\n				else if(tb[x][y]==-flag) \r\n					x--;\r\n				else\r\n				{\r\n					x=-1;\r\n				}\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(x>=2&&y<=5)\r\n		if(tb[x-1][y+1]+flag==0){\r\n			x=x-2;y=y+2;\r\n			while(x>=0&&y<=7){\r\n				if(tb[x][y]==flag) return true;\r\n				else if(tb[x][y]==-flag)\r\n				{\r\n					x--;\r\n					y++;\r\n				}\r\n				else {x=-1;}\r\n				//x--;y++;\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(y<=5)\r\n		if(tb[x][y+1]+flag==0){\r\n			y=y+2;\r\n			while(y<=7){\r\n				if(tb[x][y]==flag) return true;\r\n				else if(tb[x][y]==-flag){y++;}\r\n				else {y=8;}\r\n				//y++;\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(x<=5&&y<=5)\r\n		if(tb[x+1][y+1]+flag==0){\r\n			x=x+2;y=y+2;\r\n			while(x<=7&&y<=7){\r\n				if(tb[x][y]==flag) return true;\r\n				else if(tb[x][y]==-flag){x++;y++;}\r\n				else {x=8;y=8;}\r\n				//x++;y++;\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(x<=5)\r\n		if(tb[x+1][y]+flag==0){\r\n			x=x+2;\r\n			while(x<=7){\r\n				if(tb[x][y]==flag) return true;\r\n				else if(tb[x][y]==-flag){x++;}\r\n				else {x=8;}\r\n				//x++;\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(x<=5&&y>=2)\r\n		if(tb[x+1][y-1]+flag==0){\r\n			x=x+2;y=y-2;\r\n			while(x<=7&&y>=0){\r\n				if(tb[x][y]==flag) return true;\r\n				else if(tb[x][y]==-flag){x++;y--;}\r\n				else {y=-1;}\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(y>=2)\r\n		if(tb[x][y-1]+flag==0){\r\n			y=y-2;\r\n			while(y>=0){\r\n				if(tb[x][y]==flag) return true;\r\n				else if(tb[x][y]==-flag){y--;}\r\n				else {y=-1;}\r\n			}\r\n		}\r\n	return false;\r\n			\r\n}\r\n\r\n\r\nvoid CBwfind::select(int flag)\r\n{\r\n	int step,i,j,cut=1000000,tf=flag;\r\n	int tb[8][8];\r\n	for(i=0;i<8;i++)for(j=0;j<8;j++) tb[i][j]=board[i][j];\r\n	step=CountNum();\r\n	//\r\n	if(step<searchend){\r\n		int ss=0;\r\n		findfirst(tb,ss,tf,cut);\r\n	}\r\n	//\r\n	else if(step>=searchend){\r\n		preview=true;\r\n		outcome=findlast(tb,step,tf,cut);\r\n	}\r\n}\r\n\r\nint CBwfind::CountBlack()\r\n{\r\n	int CB=0;\r\n	for(int i=0;i<8;i++)\r\n		for(int j=0;j<8;j++)\r\n			if(board[i][j]== BLACK) CB++;\r\n	return CB;\r\n}\r\n\r\nint CBwfind::CountWhite()\r\n{\r\n	int WB=0;\r\n	for(int i=0;i<8;i++)\r\n		for(int j=0;j<8;j++)\r\n			if(board[i][j]== WHITE) WB++;\r\n	return WB;\r\n}\r\n\r\n\r\n\r\nint CBwfind::CountNum()\r\n{\r\n	int Number=0,i,j;\r\n	for(i=0;i<8;i++)for(j=0;j<8;j++)\r\n		if(board[i][j]!=0) Number++;\r\n	return Number;\r\n}\r\n\r\n\r\n\r\n\r\nint CBwfind::Total(int tb[][8])\r\n{\r\n	int Num=0,i,j;\r\n	for(i=0;i<8;i++)\r\n		for(j=0;j<8;j++)\r\n			if(tb[i][j]==0) Num++;\r\n	return Num;\r\n}\r\n\r\nint CBwfind::black(int tb[][8] )\r\n{\r\n	int Bn=0,i,j;\r\n	for(i=0;i<8;i++)\r\n		for(j=0;j<8;j++)\r\n			if(tb[i][j]-1==0) Bn++;\r\n	return Bn;\r\n}\r\n\r\nint CBwfind::white(int tb[][8] )\r\n{\r\n	int Wn=0,i,j;\r\n		for(i=0;i<8;i++)\r\n		for(j=0;j<8;j++)\r\n			if(tb[i][j]==-1) Wn++;\r\n	return Wn;\r\n}\r\n\r\n\r\n\r\nbool CBwfind::search(int tb[][8] , int flag)\r\n{\r\n	int i,j;\r\n	for(i=0;i<8;i++)for(j=0;j<8;j++)\r\n		if(judge(tb,i,j,flag)) return true;\r\n	return false;\r\n}\r\n\r\nint CBwfind::findfirst(int tb[][8] , int &step, int &flag, int cut)\r\n{\r\n	int value=0,max=-100000,min=100000,k=0,i,j;\r\n	int temp[8][8];\r\n	if(step==depth){\r\n		return valuefirst(tb);\r\n	}\r\n	for(i=0;i<8;i++)for(j=0;j<8;j++) temp[i][j]=tb[i][j];\r\n	for(i=0;i<8;i++)for(j=0;j<8;j++){\r\n		if(judge(tb,i,j,flag)){\r\n			int ii,jj;\r\n			value=0;\r\n			k=1;//\r\n			newboard(tb,i,j,flag);\r\n			flag=-flag;\r\n			step++;\r\n			if(-flag==ComChoice){\r\n				LineSense(tb,i,j,value);\r\n				Corner(tb,i,j,value);\r\n				value+=findfirst(tb,step,flag,max);\r\n			}\r\n			if(-flag==ManChoice){\r\n				Corner(tb,i,j,value);\r\n				LineSense(tb,i,j,value);\r\n				value+=findfirst(tb,step,flag,min);\r\n			}\r\n			step--;\r\n			flag=-flag;\r\n			//\r\n			for(ii=0;ii<8;ii++)\r\n				for(jj=0;jj<8;jj++) \r\n					tb[ii][jj]=temp[ii][jj];\r\n			if(flag-ManChoice==0&&value<cut) \r\n				return value;\r\n			if(flag-ComChoice==0&&value>cut) \r\n				return value;\r\n			if(flag-ManChoice==0){\r\n				if(value<min){\r\n					min=value;\r\n				}\r\n			}\r\n			if(flag-ComChoice==0){\r\n				if(value>max){\r\n					max=value;\r\n					if(step==0){\r\n						stepx=i;\r\n						stepy=j;\r\n					}\r\n				}\r\n			}\r\n		}//if\r\n	}//for\r\n	//\r\n	if(k==0){\r\n		flag=-flag;\r\n		if(search(tb,flag)){\r\n			value=findfirst(tb,step,flag,cut);\r\n			flag=-flag;\r\n			return value;\r\n		}\r\n		else{\r\n			flag=-flag;\r\n			return valuefirst(tb);\r\n		}\r\n	}\r\n	//\r\n	else{\r\n		if(flag-ManChoice==0) return min;\r\n		else if(flag-ComChoice==0){\r\n			//if\r\n			return max;\r\n		}//if\r\n	}//else\r\n}\r\n\r\nint CBwfind::valuefirst(int tb[][8] )\r\n{\r\n	int flag,minus,corner=0,v,ComMobil,ManMobil,DiffMobil,Num,squre;\r\n	int danger;\r\n	flag=ComChoice;\r\n	ComMobil=Mobility(tb,ComChoice);\r\n	ManMobil=Mobility(tb,ManChoice);\r\n	//DiffMobil=ComMobil*ComMobil-ManMobil*ManMobil;\r\n	//a\r\n	DiffMobil=ComMobil-ManMobil;\r\n	//b\r\n	Num=Total(tb);\r\n	if(flag==1){\r\n		minus=white(tb)-black(tb);\r\n		if(minus>=0) squre=minus*minus;\r\n		else squre=-minus*minus;\r\n		danger=black(tb);\r\n	}\r\n	if(flag==-1){\r\n		minus=black(tb)-white(tb);\r\n		if(minus>=0) squre=minus*minus;\r\n		else squre=-minus*minus;\r\n		danger=white(tb);\r\n	}\r\n	\r\n	if(Num<25){\r\n		v=minus+2*DiffMobil;\r\n	}\r\n	else{\r\n		v=minus+3*DiffMobil;\r\n	}\r\n	if(danger==0) v=-10000;\r\n	return v;\r\n}\r\n\r\nint CBwfind::findlast(int tb[][8], int &step, int &flag, int cut)\r\n{\r\n	int value=0,max=-100000,min=100000,k=0,i,j;\r\n	int temp[8][8];\r\n	if(step==64){\r\n		if(ComChoice==1) return(black(tb)-white(tb));\r\n		else return(white(tb)-black(tb));\r\n	}\r\n	for(i=0;i<8;i++)for(j=0;j<8;j++) temp[i][j]=tb[i][j];\r\n	for(i=0;i<8;i++)for(j=0;j<8;j++){\r\n		if(judge(tb,i,j,flag)){\r\n			int ii,jj;\r\n			k=1;//\r\n			newboard(tb,i,j,flag);\r\n			flag=-flag;\r\n			step++;\r\n			if(-flag==ComChoice){\r\n				value=findlast(tb,step,flag,max);\r\n			}\r\n			if(-flag==ManChoice){\r\n				value=findlast(tb,step,flag,min);\r\n			}\r\n			step--;\r\n			flag=-flag;\r\n			//\r\n			for(ii=0;ii<8;ii++)for(jj=0;jj<8;jj++) tb[ii][jj]=temp[ii][jj];\r\n			if(flag-ManChoice==0&&value<cut) return value;\r\n			if(flag-ComChoice==0&&value>cut) return value;\r\n			if(flag-ManChoice==0){\r\n				if(value<min){\r\n					min=value;\r\n				}\r\n			}\r\n			if(flag-ComChoice==0){\r\n				if(value>max){\r\n					max=value;\r\n					if(step==CountNum()){\r\n						stepx=i;\r\n						stepy=j;\r\n					}\r\n				}\r\n			}\r\n		}//if\r\n	}//for\r\n	//\r\n	if(k==0){\r\n		flag=-flag;\r\n		if(search(tb,flag)){\r\n			value=findlast(tb,step,flag,cut);\r\n			flag=-flag;\r\n			return value;\r\n		}\r\n		else{\r\n			flag=-flag;\r\n			if(ComChoice==1) return(black(tb)-white(tb));\r\n			else return(white(tb)-black(tb));\r\n		}\r\n	}\r\n	//\r\n	else{\r\n		if(flag-ManChoice==0) return min;\r\n		if(flag-ComChoice==0){\r\n			return max;\r\n		}\r\n\r\n	}\r\n}\r\nvoid CBwfind::newboard(int tb[][8],int chessx, int chessy, int flag)\r\n{\r\n	int x=chessx,y=chessy;\r\n	//\r\n	tb[x][y]=flag;\r\n	if(x>=2&&y>=2)\r\n		if(tb[x-1][y-1]+flag==0){\r\n			x=x-2;\r\n			y=y-2;\r\n			while(x>=0&&y>=0){\r\n				if(tb[x][y]==flag){\r\n					for(int i=x,j=y;i!=chessx&&j!=chessy;i++,j++)\r\n						tb[i][j]=flag;\r\n					x=0;y=0;\r\n				}\r\n				else if(tb[x][y]==0){x=-1;y=-1;}\r\n				{x--;y--;}\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(x>=2)\r\n		if(tb[x-1][y]+flag==0){\r\n			x=x-2;\r\n			while(x>=0){\r\n				if(tb[x][y]==flag){\r\n					for(int i=x;i!=chessx;i++)\r\n						tb[i][chessy]=flag;\r\n					x=0;\r\n				} \r\n				else if(tb[x][y]==0){x=-1;y=-1;}\r\n				x--;\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(x>=2&&y<=5)\r\n		if(tb[x-1][y+1]+flag==0){\r\n			x=x-2;y=y+2;\r\n			while(x>=0&&y<=7){\r\n				if(tb[x][y]==flag){\r\n					for(int i=x,j=y;i!=chessx&&j!=chessy;i++,j--)\r\n						tb[i][j]=flag;\r\n					x=0;y=7;\r\n				} \r\n				else if(tb[x][y]==0){x=-1;}\r\n				{x--;y++;}\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(y<=5)\r\n		if(tb[x][y+1]+flag==0){\r\n			y=y+2;\r\n			while(y<=7){\r\n				if(tb[x][y]==flag){\r\n					for(int j=y;j!=chessy;j--)\r\n						tb[chessx][j]=flag;\r\n					y=7;\r\n				}\r\n				else if(tb[x][y]==0){y=8;}\r\n				y++;\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(x<=5&&y<=5)\r\n		if(tb[x+1][y+1]+flag==0){\r\n			x=x+2;y=y+2;\r\n			while(x<=7&&y<=7){\r\n				if(tb[x][y]==flag){\r\n					for(int i=x,j=y;i!=chessx&&j!=chessy;i--,j--)\r\n						tb[i][j]=flag;\r\n					x=7;y=7;\r\n				}\r\n				\r\n				else if(tb[x][y]==0){x=8;y=8;}\r\n				{x++;y++;}\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(x<=5)\r\n		if(tb[x+1][y]+flag==0){\r\n			x=x+2;\r\n			while(x<=7){\r\n				if(tb[x][y]==flag){\r\n					for(int i=x;i!=chessx;i--)\r\n						tb[i][chessy]=flag;\r\n					x=7;\r\n				}\r\n				else if(tb[x][y]==0){x=8;}\r\n				x++;\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(x<=5&&y>=2)\r\n		if(tb[x+1][y-1]+flag==0){\r\n			x=x+2;y=y-2;\r\n			while(x<=7&&y>=0){\r\n				if(tb[x][y]==flag){\r\n					for(int i=x,j=y;i!=chessx&&j!=chessy;i--,j++)\r\n						tb[i][j]=flag;\r\n					x=7;y=0;\r\n				}\r\n				else if(tb[x][y]==0){y=-1;}\r\n				{x++;y--;}\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(y>=2)\r\n		if(tb[x][y-1]+flag==0){\r\n			y=y-2;\r\n			while(y>=0){\r\n				if(tb[x][y]==flag){\r\n					for(int j=y;j!=chessy;j++)\r\n						tb[chessx][j]=flag;\r\n					y=0;\r\n				}\r\n				else if(tb[x][y]==0){y=-1;}\r\n				y--;\r\n			}\r\n		}\r\n}\r\n\r\n\r\n\r\nvoid CBwfind::CornerSense(int tb[][8], int &value)\r\n{	\r\n	int flag,corner=0;\r\n	//int i,j;\r\n	flag=ComChoice;\r\n	\r\n	if(tb[0][0]-flag!=0){\r\n		if((tb[1][0]-flag==0)||(tb[1][1]-flag==0)||(tb[0][1]-flag==0))\r\n			corner-=1000;\r\n	}\r\n	else if(tb[0][0]==flag)corner+=1000;\r\n	if(tb[0][7]-flag!=0){\r\n		if((tb[0][6]-flag==0)||(tb[1][7]-flag==0)||(tb[1][6]-flag==0))\r\n			corner-=1000;\r\n	}\r\n	else if(tb[0][0]==flag)corner+=1000;\r\n	if(tb[7][0]-flag!=0){\r\n		if((tb[6][0]-flag==0)||(tb[7][1]-flag==0)||(tb[6][1]-flag==0))\r\n			corner-=1000;\r\n	}\r\n	else if(tb[0][0]==flag)corner+=1000;\r\n	if(tb[7][7]-flag!=0){\r\n		if((tb[7][6]-flag==0)||(tb[6][7]-flag==0)||(tb[6][6]-flag==0))\r\n			corner-=1000;\r\n	}\r\n	else if(tb[0][0]==flag)corner+=1000;\r\n	value+=corner;\r\n}\r\n\r\n\r\n\r\n\r\n\r\nint CBwfind::Mobility(int tb[][8], int flag)\r\n{\r\n	int move=0,i,j;\r\n	for(i=0;i<8;i++)for(j=0;j<8;j++){\r\n		if(judge(tb,i,j,flag)) move++;\r\n	}\r\n	return move;\r\n}\r\n\r\nvoid CBwfind::LineSense(int tb[][8], int chessx, int chessy, int &value)\r\n{\r\n	int line=0;\r\n	int i,j;\r\n	if(tb[0][0]==ManChoice){\r\n		if(chessx==0){\r\n			j=0;\r\n			while(tb[0][j]==ManChoice) j++;\r\n			if(tb[0][j]==ComChoice){\r\n				while(j<8&&tb[0][j]==ComChoice) j++;\r\n				if(j<8&&tb[0][j]==0) line-=1000;\r\n			}\r\n		}\r\n		if(chessy=0){\r\n			i=0;\r\n			while(tb[i][0]==ManChoice) i++;\r\n			if(tb[i][0]==ComChoice){\r\n				while(i<8&&tb[i][0]==ComChoice) i++;\r\n				if(i<8&&tb[i][0]==0) line-=1000;\r\n			}\r\n		}\r\n	}\r\n	if(tb[0][7]==ManChoice){\r\n		if(chessx==0){\r\n			j=7;\r\n			while(tb[0][j]==ManChoice) j--;\r\n			if(tb[0][j]==ComChoice){\r\n				while(j>=0&&tb[0][j]==ComChoice) j--;\r\n				if(j>=0&&tb[0][j]==0) line-=1000;\r\n			}\r\n		}\r\n		if(chessy=7){\r\n			i=0;\r\n			while(tb[i][7]==ManChoice) i++;\r\n			if(tb[i][7]==ComChoice){\r\n				while(i<8&&tb[i][7]==ComChoice) i++;\r\n				if(i<8&&tb[i][7]==0) line-=1000;\r\n			}\r\n		}\r\n	}\r\n	if(tb[7][0]==ManChoice){\r\n		if(chessx==7){\r\n			j=0;\r\n			while(tb[0][j]==ManChoice) j++;\r\n			if(tb[0][j]==ComChoice){\r\n				while(j<8&&tb[0][j]==ComChoice) j++;\r\n				if(j<8&&tb[0][j]==0) line-=1000;\r\n			}\r\n		}\r\n		if(chessy=0){\r\n			i=7;\r\n			while(tb[i][0]==ManChoice) i--;\r\n			if(tb[i][0]==ComChoice){\r\n				while(i>=0&&tb[i][0]==ComChoice) i--;\r\n				if(i>=0&&tb[i][0]==0) line-=1000;\r\n			}\r\n		}\r\n	}\r\n	if(tb[7][7]==ManChoice){\r\n		if(chessx==7){\r\n			j=7;\r\n			while(tb[0][j]==ManChoice) j--;\r\n			if(tb[0][j]==ComChoice){\r\n				while(j>=0&&tb[7][j]==ComChoice) j--;\r\n				if(j>=0&&tb[7][j]==0) line-=1000;\r\n			}\r\n		}\r\n		if(chessy=7){\r\n			i=7;\r\n			while(tb[i][7]==ManChoice) i--;\r\n			if(tb[i][7]==ComChoice){\r\n				while(i<8&&tb[i][7]==ComChoice) i--;\r\n				if(i>=0&&tb[i][7]==0) line-=1000;\r\n			}\r\n		}\r\n	}\r\n	value+=line;\r\n\r\n}\r\n\r\nvoid CBwfind::SaveBoard(int tb[][8])\r\n{\r\n	int i,j;\r\n	bak++;\r\n	for(i=0;i<8;i++)\r\n		for(j=0;j<8;j++) \r\n			save[bak][i][j]=tb[i][j];\r\n}\r\n\r\n\r\nvoid CBwfind::Corner(int tb[][8], int chessx, int chessy, int &value)\r\n{\r\n	int flag=ComChoice;\r\n	int corner=0;\r\n	int i=chessx,j=chessy;\r\n	if(i==0&&j==0&&tb[0][0]==flag) value+=2000;//return;\r\n	if(i==0&&j==7&&tb[0][7]==flag) value+=2000;//return;\r\n	if(i==7&&j==0&&tb[7][0]==flag) value+=2000;//return;\r\n	if(i==7&&j==7&&tb[7][7]==flag) value+=2000;//return;\r\n	if(tb[0][0]==0){\r\n		//if(i==0&&tb[0][1]==flag){\r\n		if(tb[0][1]==flag){\r\n			j=1;\r\n			while(j<8&&tb[0][j]==flag) j++;\r\n			if(j<8&&tb[0][j]==-flag) value-=5000;\r\n		}\r\n		//if(j==0&&tb[1][0]==flag){\r\n		if(tb[1][0]==flag){\r\n			i=1;\r\n			while(i<8&&tb[i][0]==flag) i++;\r\n			if(i<8&&tb[i][0]==-flag) value-=5000;\r\n		}\r\n	}\r\n	i=chessx;j=chessy;\r\n	if(tb[0][7]==0){\r\n		//if(i==0&&tb[0][6]==flag){\r\n		if(tb[0][6]==flag){\r\n			j=6;\r\n			while(j>=0&&tb[0][j]==flag) j--;\r\n			if(j>=0&&tb[0][j]==-flag) value-=5000;\r\n		}\r\n		//if(j==7&&tb[1][7]==flag){\r\n		if(tb[1][7]==flag){\r\n			i=1;\r\n			while(i<8&&tb[i][7]==flag) i++;\r\n			if(i<8&&tb[i][7]==-flag) value-=5000;\r\n		}\r\n	}\r\n	i=chessx;j=chessy;\r\n	if(tb[7][0]==0){\r\n		//if(i==7&&tb[7][1]==flag){\r\n		if(tb[7][1]==flag){\r\n			j=1;\r\n			while(j<8&&tb[7][j]==flag) j++;\r\n			if(j<8&&tb[7][j]==-flag) value-=5000;\r\n		}\r\n		//if(j==0&&tb[6][0]==flag){\r\n		if(tb[6][0]==flag){\r\n			i=6;\r\n			while(i>=0&&tb[i][0]==flag) i--;\r\n			if(i>=0&&tb[i][0]==-flag) value-=5000;\r\n		}\r\n	}\r\n	i=chessx;j=chessy;\r\n	if(tb[7][7]==0){\r\n		//if(i==7&&tb[7][6]==flag){\r\n		if(tb[7][6]==flag){\r\n			j=6;\r\n			while(j>=0&&tb[7][j]==flag) j--;\r\n			if(j>=0&&tb[7][j]==-flag) value-=5000;\r\n		}\r\n		//if(j==7&&tb[6][7]==flag){\r\n		if(tb[6][7]==flag){\r\n			i=6;\r\n			while(i>=0&&tb[i][7]==flag) i--;\r\n			if(i>=0&&tb[i][7]==-flag) value-=5000;\r\n		}\r\n	}\r\n	//\r\n	i=chessx;j=chessy;\r\n	if(i==1&&j==1&&tb[0][0]-flag!=0&&tb[i][j]==flag)\r\n		value-=2000;\r\n	if(i==1&&j==6&&tb[0][7]-flag!=0&&tb[i][j]==flag)\r\n		value-=2000;\r\n	if(i==6&&j==1&&tb[7][0]-flag!=0&&tb[i][j]==flag)\r\n		value-=2000;\r\n	if(i==6&&j==6&&tb[7][7]-flag!=0&&tb[i][j]==flag)\r\n		value-=2000;\r\n}\r\n\r\nint main()\r\n{\r\n	CBwfind m_find;\r\n	m_find.depth=6;\r\n	m_find.preview=false;\r\n	m_find.bak=0;\r\n\r\n	m_find.ComChoice=BLACK;\r\n	m_find.ManChoice=WHITE;\r\n	int ComChoice = BLACK;\r\n	int ManChoice=WHITE;;\r\n\r\n	int tb[8][8];\r\n	int i,j;\r\n	for(i=0;i<8;i++)\r\n		for( j=0;j<8;j++)\r\n			scanf(\"%d\",&tb[i][j]);\r\n	for(i=0;i<8;i++)\r\n		for(j=0;j<8;j++) \r\n			if(tb[i][j] == 2)\r\n			{\r\n				m_find.board[i][j] = -1;\r\n				tb[i][j] = -1;\r\n			}\r\n			else\r\n				m_find.board[i][j] = tb[i][j];\r\n	int x,y;\r\n		m_find.select(ComChoice);\r\n		x=m_find.stepx;\r\n		y=m_find.stepy;\r\n	printf(\"%d %d\",x,y);\r\n	return 0;\r\n}\r\n		','compile correct','g++','othello','2013-05-24 13:37:20','');
INSERT INTO task VALUES (209,'kaikitest','#include <iostream>\r\n\r\nusing namespace std;\r\n\r\n//boardboard2 \r\nint board[8][8] = {{0}} , board2[8][8] = {{0}};                     //board2board \r\nint DirectNum[2][2]={{0}} , DirectNumTemp[1]={0};                       // xy \r\n\r\n\r\nstruct Av{                                                          //power\r\n	int x;\r\n	int y;\r\n	int power;\r\n}av[30];\r\n\r\n\r\nvoid CopyBoard()                                                    //boardboard2 \r\n{\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0); j<8; j++)\r\n			board2[i][j]=board[i][j];\r\n} \r\n\r\n\r\nvoid ChangeBoard()                                                 // \r\n{\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0); j<8; j++)\r\n		{\r\n			if(board2[i][j]==1)board2[i][j]=2;\r\n			else if(board2[i][j]==2)board2[i][j]=1;\r\n		}\r\n}\r\n\r\n\r\nint legalDirect(int x, int y, int i, int j, int flag)              //(x,y)i,j  \r\n{																   // DirectNumTemp?\r\n	x += i;\r\n	y += j;\r\n	if (x < 0 || x >7 || y < 0 || y > 7)                         // \r\n	{\r\n		return 0;\r\n	}\r\n	if (board2[x][y] == 2)\r\n	{\r\n     	DirectNumTemp[0]+=1;              // \r\n		                              /* (x,y),\r\n		                              *  ,\r\n	                               	  */\r\n		flag = 1;\r\n		return legalDirect(x, y, i, j, flag);\r\n	}\r\n	else if (board2[x][y] == 1)\r\n	{\r\n		/* , flag=1*/\r\n		if (flag == 1)\r\n		{\r\n			return 1;\r\n		}\r\n		return 0;\r\n	}\r\n	else\r\n		return 0;\r\n\r\n	return 0;\r\n}\r\n\r\n\r\nint legal(int x, int y)                                 //(x,y)(i,j)\r\n{														//DirectNum[i][j];     \r\n	if (board2[x][y]!=0)                                // \r\n		return 0;\r\n	int i, j, flag;\r\n	\r\n	for (i = -1; i <= 1; i++)                          /* (x,y)*/\r\n	{\r\n		for (j = -1; j <= 1; j++)\r\n		{\r\n			if (i == 0 && j == 0)                      // (x,y)\r\n			{\r\n				continue;\r\n			}\r\n			flag = 0;\r\n			if (legalDirect(x, y, i, j, flag))\r\n			{\r\n				return 1;\r\n			}\r\n			DirectNumTemp[0]=0;                            //\r\n		}\r\n	}\r\n	return 0;\r\n}\r\n\r\n\r\nint CanEatNum(int x,int y)                                //(x,y) \r\n{\r\n	CopyBoard();\r\n	int i, j, flag,w=0;\r\n	for (i = -1; i <= 1; i++)                          /* (x,y)*/\r\n	{\r\n		for (j = -1; j <= 1; j++)\r\n		{\r\n			if (i == 0 && j == 0)                      // (x,y)\r\n			{\r\n				continue;\r\n			}\r\n			flag = 0;\r\n			if (legalDirect(x, y, i, j, flag))\r\n			{\r\n				w+= DirectNumTemp[0];\r\n			}\r\n			DirectNumTemp[0]=0;                            //\r\n		}\r\n	}\r\n	return w;\r\n} \r\n\r\n\r\nvoid fanzhuan(int x ,int y)                           // xyboard1  \r\n{\r\n	int i, j, flag;\r\n	CopyBoard();\r\n	board2[x][y]=1;\r\n	for (i = -1; i <= 1; i++)                          // (x,y) \r\n	{\r\n		for (j = -1; j <= 1; j++)\r\n		{\r\n			if (i == 0 && j == 0)                      // (x,y) \r\n			{\r\n				continue;\r\n			}\r\n			flag = 0;\r\n			if (legalDirect(x, y, i, j, flag))             // \r\n			{\r\n				for(int k(0); k<DirectNumTemp[0]+1; k++){\r\n					board2[x+i*k][y+j*k]= 1 ;          //  \r\n				} \r\n			}\r\n			DirectNumTemp[0]=0;                            // \r\n		}\r\n	}\r\n}\r\n\r\n\r\nbool isConner(int x ,int y)                           // \r\n{\r\n	if(x==0&&y==0)return 1;\r\n	else if(x==0&&y==7)return 1;\r\n	else if(x==7&&y==0)return 1;\r\n	else if(x==7&&y==7)return 1;\r\n	return 0; \r\n}\r\n\r\nbool is1BesideConner(int x ,int y)                   //412 \r\n{\r\n	if(x==0||x==7)\r\n		if(y==1||y==6)return 1;\r\n	if(x==1||x==6)\r\n		if(y==0||y==1||y==6||y==7)return 1;\r\n	return 0;\r\n}\r\n\r\n\r\nbool is2BesideConner(int x ,int y)                   //416 \r\n{\r\n	if(y==5||y==2)\r\n		if(x==1||x==0||x==6||x==7)return 1;\r\n	if(x==5||x==2)\r\n			if(y==1||y==0||y==6||y==7)return 1;\r\n	return 0;\r\n} \r\n\r\n\r\nint WhiteCanGoNum (int x , int y)                     //xy \r\n{\r\n	int a=x,b=y;\r\n	CopyBoard(); \r\n	fanzhuan(a,b);                                   \r\n	ChangeBoard(); 									//legalDirectlegal\r\n	int w=0;\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0); j<8; j++)\r\n			if(legal(i,j))w++;                           \r\n	CopyBoard();                                    // \r\n	return w;\r\n} \r\n\r\n\r\nbool WhiteCanGotoConner(int x, int y)                 //     \r\n{\r\n	int a=x,b=y;\r\n	CopyBoard();\r\n	fanzhuan(a,b);\r\n	ChangeBoard();\r\n	if(legal(0,0)||legal(7,7)||legal(0,7)||legal(7,0))\r\n	{\r\n		CopyBoard();\r\n		return 1; \r\n	}\r\n	CopyBoard();\r\n	return 0;\r\n}\r\n\r\nbool WhiteCanGotoConner2(int x, int y)\r\n{\r\n	CopyBoard();\r\n	int a=x,b=y;\r\n	fanzhuan(a,b);\r\n	ChangeBoard();\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0); j<8; j++)\r\n		{\r\n			int a1=i,b1=j;\r\n			if(is2BesideConner(a1,b1))\r\n				if(legal(a1,b1)){\r\n					CopyBoard();\r\n					return 1; \r\n				}\r\n		}\r\n	CopyBoard();\r\n	return 0;\r\n}\r\n\r\nbool CanEatWhiteInConner2(int x ,int y)\r\n{\r\n	CopyBoard();\r\n	int a=x,b=y;\r\n	fanzhuan(a,b);\r\n	ChangeBoard();\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0); j<8; j++)\r\n		{\r\n			int a1=i,b1=j;\r\n			if(is2BesideConner(a1,b1))\r\n				if(board[i][j]!=board2[i][j]){\r\n					CopyBoard();\r\n					return 1; \r\n				}\r\n		}\r\n	CopyBoard();\r\n	return 0;\r\n}\r\n\r\nint GiveAv(Av av[])                                          //av[] \r\n{\r\n	int k=0,a,b;\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0); j<8; j++)\r\n		{\r\n			a=i;\r\n			b=j;\r\n			if(legal(a,b)){\r\n				av[k].x = i;\r\n				av[k].y = j;\r\n				k++;\r\n			}\r\n		}\r\n			\r\n	return k ;\r\n}\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nvoid Power(int k)                                       // \r\n{\r\n	\r\n	for(int i(0); i<k; i++)\r\n	{\r\n		av[i].power=0;\r\n		int x=av[i].x;\r\n		int y=av[i].y;\r\n		if(isConner(x,y))av[i].power+=35;\r\n		if(WhiteCanGotoConner(x,y))av[i].power-=35;\r\n		if(WhiteCanGotoConner2(x,y))av[i].power-=35;\r\n		if(is1BesideConner(x,y))av[i].power-=30;\r\n		if(is2BesideConner(x,y))av[i].power+=5;\r\n		if(CanEatWhiteInConner2(x,y))av[i].power+=10;\r\n	}\r\n}\r\n\r\n\r\n\r\n int main()\r\n{\r\n	int w=0;\r\n	for(int i(0); i<8; i++)                                //  \r\n		for(int j(0); j<8; j++)\r\n		{\r\n			cin >> board[i][j]; \r\n			if(board[i][j]==2||board[i][j]==1)w++;\r\n		} \r\n		\r\n	CopyBoard();\r\n	\r\n	bool key1=0, key2=0 ,key3=0;                                 				//\r\n	if(board[0][0]+board[0][7]+board[7][0]+board[7][7]>1)key3=1;				// \r\n	if(board[0][0]!=0||board[0][7]!=0||board[7][0]!=0||board[7][7]!=0)key2=1;  // \r\n	if(w>38)key1=1;																// \r\n	\r\n	int k;\r\n	k=GiveAv(av);\r\n	Power(k);\r\n	\r\n	if(key3==1)                                                                 // \r\n	{\r\n		for(int i(0); i<k; i++)\r\n		{     \r\n			av[i].power+=CanEatNum(av[i].x,av[i].y)*10;\r\n		}\r\n	}\r\n	\r\n	else if(key2==1)															// \r\n	{    \r\n		for(int i(0); i<k; i++)\r\n		{     \r\n			av[i].power-=CanEatNum(av[i].x,av[i].y)*3;\r\n			av[i].power-=WhiteCanGoNum(av[i].x,av[i].y)*8;\r\n		}\r\n		\r\n	}\r\n\r\n	else if(key1==1)                                                    		// \r\n	{\r\n		for(int i(0); i<k; i++)\r\n		{\r\n			av[i].power-=CanEatNum(av[i].x,av[i].y)*4;\r\n			av[i].power-=WhiteCanGoNum(av[i].x,av[i].y)*8;\r\n		}\r\n		\r\n		\r\n		\r\n		\r\n	}\r\n\r\n	else                                                                        // \r\n	{\r\n		for(int i(0); i<k; i++)\r\n		{\r\n			av[i].power-=CanEatNum(av[i].x,av[i].y)*8;\r\n		}\r\n		\r\n\r\n	}\r\n	\r\n	int x=av[0].x,y=av[0].y,max=av[0].power;\r\n	for(int i(1); i<k; i++)\r\n		 if(av[i].power>max)\r\n		 {\r\n		 	max=av[i].power;\r\n		 	x=av[i].x;\r\n		 	y=av[i].y;\r\n		 }\r\n	if(k==0)return 1;\r\n	\r\n	\r\n\r\n	cout << x <<\" \"<< y;	                                			// \r\n		return 1;\r\n}','compile correct','g++','othello','2013-05-24 22:22:05','');
INSERT INTO task VALUES (236,'haiwei624','		\r\n		#include <stdio.h>\r\n\r\nint t,tmpt, x, y,ans =0;\r\n\r\nint f[ 10][ 10 ], g[ 10 ][ 10 ];\r\nint tx [ 8 ]= { -1,-1,-1,0,0,1,1,1};\r\nint ty [ 8 ]= { -1,0,1,-1,1,-1,0,1};\r\n\r\nint jd ( int a, int b ) {\r\n    int i, j ;\r\n    for (i=0;i<8;i++) if (g[ a+tx[i] ][ b+ty[i] ]==2) \r\n        for (j=2;a+tx[i]*j>=0&&a+tx[i]*j<8&&b+ty[i]*j>=0&&b+ty[i]*j<8;j++) {\r\n            if (g[a+tx[i]*j][b+ty[i]*j]==1) return 1;\r\n            if (g[a+tx[i]*j][b+ty[i]*j]==0) break;\r\n        }\r\n    return 0;\r\n}\r\n\r\nvoid  count ( int i, int j ) {\r\n      if ((i==0||i==7)&&(j==0||j==7)) tmpt+=10;\r\n      if ((i==1&&j==1)||(i==6&&j==6)||(i==1&&j==6)||(i==6&&j==1)) tmpt-=6;\r\n}\r\n        \r\nint deal ( int a, int b ) {\r\n    int i, j, k, t=0;\r\n    for (i=0;i<8;i++)\r\n    for (j=0;j<8;j++) f[i][j]=g[ i][j ]; \r\n    for (i=0;i<8;i++) if (f[ a+tx[i] ][ b+ty[i] ]==2) \r\n        for (j=2;a+tx[i]*j>=0&&a+tx[i]*j<8&&b+ty[i]*j>=0&&b+ty[i]*j<8;j++) {\r\n            if (f[a+tx[i]*j][b+ty[i]*j]==1) for (k=0;k<j;k++) {\r\n               f[a+tx[i]*k][b+ty[i]*k]=1;\r\n               count( a+tx[i]*k, b+ty[i]*k ) ;\r\n            }\r\n            if (f[a+tx[i]*j][b+ty[i]*j]!=2) break;\r\n        }\r\n    for (i=0;i<8;i++)\r\n    for (j=0;j<8;j++) if (f[ i][j ]==1) ++t; \r\n    return t+tmpt ;\r\n}\r\n            \r\n\r\nint main () {\r\n    int i, j;\r\n    for (i=0;i<8;i++)\r\n    for (j=0;j<8;j++) scanf(\"%d\",&g[i][j]);\r\n    for (i=0;i<8;i++)\r\n    for (j=0;j<8;j++) if ((!g[i][j])&&jd (i, j) ) {\r\n        t= deal ( i, j) ;\r\n        //if ((i==0||i==7)&&(j==0||j==7)) t-=10;\r\n        //if ((i==1&&j==1)||(i==6&&j==6)||(i==1&&j==6)||(i==6&&j==1)) t-=6;\r\n        if (ans <=t ) {x=i;y=j;ans=t;}\r\n    }\r\n    printf(\"%d %d\\n\",x,y);\r\n    //while (1 );\r\n    return 0;\r\n}\r\n','compile correct','gcc','othello','2013-05-26 17:30:30','');
INSERT INTO task VALUES (244,'chris','#include <stdio.h>\r\nint board[8][8] = {0};/* (x,y),xoffest,yoffset(x,y)*/\r\nint legalDirect(int x, int y, int xoffest, int yoffset, int flag)\r\n{\r\n	x += xoffest;\r\n	y += yoffset;\r\n	if (x < 0 || x >= 8 || y < 0 || y >= 8)// \r\n	{\r\n		return 0;\r\n	}\r\n	if (board[x][y] == 2)\r\n	{\r\n		/* (x,y),\r\n		*  ,\r\n		*/\r\n		flag = 1;\r\n		return legalDirect(x, y, xoffest, yoffset, flag);\r\n	}\r\n	else if (board[x][y] == 1)\r\n	{\r\n		/* , legal=1*/\r\n		if (flag == 1)\r\n		{\r\n			return 1;\r\n		}\r\n		return 0;\r\n	}\r\n	else\r\n		return 0;\r\n\r\n	return 0;\r\n}\r\n\r\n/* , 0, 1*/\r\nint legal(int x, int y)\r\n{\r\n	if (board[x][y]!=0)// \r\n		return 0;\r\n	int i, j, flag;\r\n	/* (x,y)*/\r\n	for (i = -1; i <= 1; i++)\r\n	{\r\n		for (j = -1; j <= 1; j++)\r\n		{\r\n			if (i == 0 && j == 0)// (x,y)\r\n			{\r\n				continue;\r\n			}\r\n			flag = 0;\r\n			if (legalDirect(x, y, i, j, flag))\r\n			{\r\n				return 1;\r\n			}\r\n		}\r\n	}\r\n	return 0;\r\n}\r\n\r\n int main()\r\n{\r\n	int i =0;\r\n	int j =0;\r\n\r\n	for(i=0;i<8;i++)\r\n		for(j=0;j<8;j++)\r\n		{\r\n		scanf(\"%d\",&board[i][j]);\r\n		}\r\n        if(legal(0,0)) printf(\"0 0\\n\");\r\n        else if(legal(7,7)) printf(\"7 7\\n\");\r\n        else if(legal(0,7)) printf(\"0 7\\n\");\r\n        else if(legal(7,0)) printf(\"7 0\\n\");\r\n        else{\r\n            for(j=0;j<8;j++){\r\n                for(i=0;i<8;i++){\r\n                    if(legal(i,j)){\r\n                        if((i==0)||(j==0)) printf(\"%d %d\\n\",i,j);\r\n                        else if((i==7)||(j==7)) printf(\"%d %d\\n\",i,j);\r\n                        else if(legal(i,j)){\r\n                            if((i==1&&j==1)||(i==6&&j==1)||(i==1&&j==6)||(i==6&&j==6)) continue;\r\n                            if((i==1&&j==0)||(i==0&&j==1)||(i==0&&j==6)||(i==6&&j==0)||(i==7&&j==6)||(i==6&&j==7)||(i==7&&j==1)||(i==1&&j==7)) continue;\r\n                            else printf(\"%d %d\\n\",i,j);\r\n                        }\r\n                        if(i==EOF||j==EOF){\r\n                            for(j=0;j<8;j++){\r\n                                for(i=0;i<8;i++){\r\n                                    if(legal(i,j)){\r\n                                        printf(\"%d %d\\n\",i,j);\r\n                                        }\r\n                                    }\r\n                                }\r\n                            }\r\n                        return 1;\r\n                        }\r\n                    }\r\n            }\r\n        }\r\n}\r\n','compile correct','gcc','othello','2013-05-26 21:48:04','');
INSERT INTO task VALUES (269,'kaikitest2','#include <iostream>\r\n\r\nusing namespace std;\r\n\r\n//boardboard2 \r\nint board[8][8] = {{0}} , board2[8][8] = {{0}};                     //board2board \r\nint DirectNum[2][2]={{0}} , DirectNumTemp[1]={0};                       // xy \r\n\r\n\r\nstruct Av{                                                          //power\r\n	int x;\r\n	int y;\r\n	int power;\r\n}av[30];\r\n\r\n\r\nvoid CopyBoard()                                                    //boardboard2 \r\n{\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0); j<8; j++)\r\n			board2[i][j]=board[i][j];\r\n} \r\n\r\n\r\nvoid ChangeBoard()                                                 // \r\n{\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0); j<8; j++)\r\n		{\r\n			if(board2[i][j]==1)board2[i][j]=2;\r\n			else if(board2[i][j]==2)board2[i][j]=1;\r\n		}\r\n}\r\n\r\n\r\nint legalDirect(int x, int y, int i, int j, int flag)              //(x,y)i,j  \r\n{																   // DirectNumTemp?\r\n	x += i;\r\n	y += j;\r\n	if (x < 0 || x >7 || y < 0 || y > 7)                         // \r\n	{\r\n		return 0;\r\n	}\r\n	if (board2[x][y] == 2)\r\n	{\r\n     	DirectNumTemp[0]+=1;              // \r\n		                              /* (x,y),\r\n		                              *  ,\r\n	                               	  */\r\n		flag = 1;\r\n		return legalDirect(x, y, i, j, flag);\r\n	}\r\n	else if (board2[x][y] == 1)\r\n	{\r\n		/* , flag=1*/\r\n		if (flag == 1)\r\n		{\r\n			return 1;\r\n		}\r\n		return 0;\r\n	}\r\n	else\r\n		return 0;\r\n\r\n	return 0;\r\n}\r\n\r\n\r\nint legal(int x, int y)                                 //(x,y)(i,j)\r\n{														//DirectNum[i][j];     \r\n	if (board2[x][y]!=0)                                // \r\n		return 0;\r\n	int i, j, flag;\r\n	\r\n	for (i = -1; i <= 1; i++)                          /* (x,y)*/\r\n	{\r\n		for (j = -1; j <= 1; j++)\r\n		{\r\n			if (i == 0 && j == 0)                      // (x,y)\r\n			{\r\n				continue;\r\n			}\r\n			flag = 0;\r\n			if (legalDirect(x, y, i, j, flag))\r\n			{\r\n				return 1;\r\n			}\r\n			DirectNumTemp[0]=0;                            //\r\n		}\r\n	}\r\n	return 0;\r\n}\r\n\r\n\r\nint CanEatNum(int x,int y)                                //(x,y) \r\n{\r\n	CopyBoard();\r\n	int i, j, flag,w=0;\r\n	for (i = -1; i <= 1; i++)                          /* (x,y)*/\r\n	{\r\n		for (j = -1; j <= 1; j++)\r\n		{\r\n			if (i == 0 && j == 0)                      // (x,y)\r\n			{\r\n				continue;\r\n			}\r\n			flag = 0;\r\n			if (legalDirect(x, y, i, j, flag))\r\n			{\r\n				w+= DirectNumTemp[0];\r\n			}\r\n			DirectNumTemp[0]=0;                            //\r\n		}\r\n	}\r\n	return w;\r\n} \r\n\r\n\r\nvoid fanzhuan(int x ,int y)                           // xyboard1  \r\n{\r\n	int i, j, flag;\r\n	CopyBoard();\r\n	board2[x][y]=1;\r\n	for (i = -1; i <= 1; i++)                          // (x,y) \r\n	{\r\n		for (j = -1; j <= 1; j++)\r\n		{\r\n			if (i == 0 && j == 0)                      // (x,y) \r\n			{\r\n				continue;\r\n			}\r\n			flag = 0;\r\n			if (legalDirect(x, y, i, j, flag))             // \r\n			{\r\n				for(int k(0); k<DirectNumTemp[0]+1; k++){\r\n					board2[x+i*k][y+j*k]= 1 ;          //  \r\n				} \r\n			}\r\n			DirectNumTemp[0]=0;                            // \r\n		}\r\n	}\r\n}\r\n\r\n\r\nbool isConner(int x ,int y)                           // \r\n{\r\n	if(x==0&&y==0)return 1;\r\n	else if(x==0&&y==7)return 1;\r\n	else if(x==7&&y==0)return 1;\r\n	else if(x==7&&y==7)return 1;\r\n	return 0; \r\n}\r\n\r\nbool is1BesideConner(int x ,int y)                   //412 \r\n{\r\n	if(x==0||x==7)\r\n		if(y==1||y==6)return 1;\r\n	if(x==1||x==6)\r\n		if(y==0||y==1||y==6||y==7)return 1;\r\n	return 0;\r\n}\r\n\r\n\r\nbool is2BesideConner(int x ,int y)                   //416 \r\n{\r\n	if(y==5||y==2)\r\n		if(x==1||x==0||x==6||x==7)return 1;\r\n	if(x==5||x==2)\r\n			if(y==1||y==0||y==6||y==7)return 1;\r\n	if((x==2&&y==2 )||( x==2&&y==5 )||( x==5&&y==5 )|| (x==5&&y==2) )return 1;\r\n	\r\n	return 0;\r\n} \r\n\r\n\r\nint WhiteCanGoNum (int x , int y)                     //xy \r\n{\r\n	int a=x,b=y;\r\n	CopyBoard(); \r\n	fanzhuan(a,b);                                   \r\n	ChangeBoard(); 									//legalDirectlegal\r\n	int w=0;\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0); j<8; j++)\r\n			if(legal(i,j))w++;                           \r\n	CopyBoard();                                    // \r\n	return w;\r\n} \r\n\r\n\r\nbool WhiteCanGotoConner(int x, int y)                 //     \r\n{\r\n	int a=x,b=y;\r\n	CopyBoard();\r\n	fanzhuan(a,b);\r\n	ChangeBoard();\r\n	if(legal(0,0)||legal(7,7)||legal(0,7)||legal(7,0))\r\n	{\r\n		CopyBoard();\r\n		return 1; \r\n	}\r\n	CopyBoard();\r\n	return 0;\r\n}\r\n\r\nbool WhiteCanGotoConner2(int x, int y)\r\n{\r\n	CopyBoard();\r\n	int a=x,b=y;\r\n	fanzhuan(a,b);\r\n	ChangeBoard();\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0); j<8; j++)\r\n		{\r\n			int a1=i,b1=j;\r\n			if(is2BesideConner(a1,b1))\r\n				if(legal(a1,b1)){\r\n					CopyBoard();\r\n					return 1; \r\n				}\r\n		}\r\n	CopyBoard();\r\n	return 0;\r\n}\r\n\r\nbool CanEatWhiteInConner2(int x ,int y)\r\n{\r\n	CopyBoard();\r\n	int a=x,b=y;\r\n	fanzhuan(a,b);\r\n	ChangeBoard();\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0); j<8; j++)\r\n		{\r\n			int a1=i,b1=j;\r\n			if(is2BesideConner(a1,b1))\r\n				if(board[i][j]!=board2[i][j]){\r\n					CopyBoard();\r\n					return 1; \r\n				}\r\n		}\r\n	CopyBoard();\r\n	return 0;\r\n}\r\n\r\nbool WhiteMustGotoConner1(int x ,int y)\r\n{\r\n	CopyBoard();\r\n	int a=x,b=y;\r\n	fanzhuan(a,b);\r\n	ChangeBoard();\r\n	if(WhiteCanGoNum(a,b)!=1)return 0;\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0); j<8; j++)\r\n		{\r\n			int a1=i,b1=j;\r\n			if(is1BesideConner(a1,b1))\r\n				if(legal(a1,b1)){\r\n					CopyBoard();\r\n					return 1; \r\n				}\r\n		}\r\n	CopyBoard();\r\n	return 0;\r\n}\r\n\r\nint GiveAv(Av av[])                                          //av[] \r\n{\r\n	int k=0,a,b;\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0); j<8; j++)\r\n		{\r\n			a=i;\r\n			b=j;\r\n			if(legal(a,b)){\r\n				av[k].x = i;\r\n				av[k].y = j;\r\n				k++;\r\n			}\r\n		}\r\n			\r\n	return k ;\r\n}\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nvoid Power(int k)                                       // \r\n{\r\n	\r\n	for(int i(0); i<k; i++)\r\n	{\r\n		av[i].power=0;\r\n		int x=av[i].x;\r\n		int y=av[i].y;\r\n		if(isConner(x,y))av[i].power+=100;\r\n		if(WhiteCanGotoConner(x,y))av[i].power-=100;\r\n		if(WhiteCanGotoConner2(x,y))av[i].power-=15;\r\n		if(is1BesideConner(x,y))av[i].power-=50;\r\n		if(is2BesideConner(x,y))av[i].power+=15;\r\n		if(CanEatWhiteInConner2(x,y))av[i].power+=20;\r\n		if(WhiteMustGotoConner1(x,y))av[i].power+=100;\r\n	}\r\n}\r\n\r\n\r\n\r\n int main()\r\n{\r\n	int w=0;\r\n	for(int i(0); i<8; i++)                                //  \r\n		for(int j(0); j<8; j++)\r\n		{\r\n			cin >> board[i][j]; \r\n			if(board[i][j]==2||board[i][j]==1)w++;\r\n		} \r\n		\r\n	CopyBoard();\r\n	\r\n	bool key1=0, key2=0 ,key3=0;;                               					    //\r\n	if(board[0][0]!=0||board[0][7]!=0||board[7][0]!=0||board[7][7]!=0)key2=1;   // \r\n	if(board[0][0]+board[0][7]+board[7][0]+board[7][7]>1)key3=1;		        //                                                            \r\n	if(w>60)key1=1;																// \r\n	int k;\r\n	k=GiveAv(av);\r\n		\r\n	Power(k);\r\n	if(key3==1)                                                                 // \r\n	{    \r\n		for(int i(0); i<k; i++)\r\n		{     \r\n			av[i].power+=CanEatNum(av[i].x,av[i].y)*4;\r\n			av[i].power-=WhiteCanGoNum(av[i].x,av[i].y);\r\n		}\r\n		\r\n	}	\r\n	else if(key2==1)															// \r\n	{    \r\n		for(int i(0); i<k; i++)\r\n		{     \r\n			av[i].power+=CanEatNum(av[i].x,av[i].y)*4;\r\n			av[i].power-=WhiteCanGoNum(av[i].x,av[i].y)*2;\r\n		}\r\n		\r\n	}\r\n\r\n	else if(key1==1)                                                    	    // \r\n	{\r\n		for(int i(0); i<k; i++)\r\n		{\r\n			av[i].power+=CanEatNum(av[i].x,av[i].y);\r\n			av[i].power-=WhiteCanGoNum(av[i].x,av[i].y)*3;\r\n		}\r\n\r\n	}\r\n\r\n	else                                                                    // \r\n	{\r\n		for(int i(0); i<k; i++)\r\n		{\r\n			av[i].power-=CanEatNum(av[i].x,av[i].y)*4;\r\n		}\r\n	}\r\n	\r\n	\r\n	int x=av[0].x,y=av[0].y,max=av[0].power;\r\n	for(int i(1); i<k; i++)\r\n		 if(av[i].power>max)\r\n		 {\r\n		 	max=av[i].power;\r\n		 	x=av[i].x;\r\n		 	y=av[i].y;\r\n		 }\r\n	if(k==0)return 1;\r\n	\r\n	\r\n\r\n	cout << x <<\" \"<< y;	                                			// \r\n		return 1;\r\n}','compile correct','g++','othello','2013-06-02 21:28:52','');
INSERT INTO task VALUES (270,'kaiki','#include <iostream>\r\n\r\nusing namespace std;\r\n\r\n//boardboard2 \r\nint board[8][8] = {{0}} , board2[8][8] = {{0}};                     //board2board \r\nint DirectNum[2][2]={{0}} , DirectNumTemp[1]={0};                       // xy \r\n\r\n\r\nstruct Av{                                                          //power\r\n	int x;\r\n	int y;\r\n	int power;\r\n}av[30];\r\n\r\n\r\nvoid CopyBoard()                                                    //boardboard2 \r\n{\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0); j<8; j++)\r\n			board2[i][j]=board[i][j];\r\n} \r\n\r\n\r\nvoid ChangeBoard()                                                 // \r\n{\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0); j<8; j++)\r\n		{\r\n			if(board2[i][j]==1)board2[i][j]=2;\r\n			else if(board2[i][j]==2)board2[i][j]=1;\r\n		}\r\n}\r\n\r\n\r\nint legalDirect(int x, int y, int i, int j, int flag)              //(x,y)i,j  \r\n{																   // DirectNumTemp?\r\n	x += i;\r\n	y += j;\r\n	if (x < 0 || x >7 || y < 0 || y > 7)                         // \r\n	{\r\n		return 0;\r\n	}\r\n	if (board2[x][y] == 2)\r\n	{\r\n     	DirectNumTemp[0]+=1;              // \r\n		                              /* (x,y),\r\n		                              *  ,\r\n	                               	  */\r\n		flag = 1;\r\n		return legalDirect(x, y, i, j, flag);\r\n	}\r\n	else if (board2[x][y] == 1)\r\n	{\r\n		/* , flag=1*/\r\n		if (flag == 1)\r\n		{\r\n			return 1;\r\n		}\r\n		return 0;\r\n	}\r\n	else\r\n		return 0;\r\n\r\n	return 0;\r\n}\r\n\r\n\r\nint legal(int x, int y)                                 //(x,y)(i,j)\r\n{														//DirectNum[i][j];     \r\n	if (board2[x][y]!=0)                                // \r\n		return 0;\r\n	int i, j, flag;\r\n	\r\n	for (i = -1; i <= 1; i++)                          /* (x,y)*/\r\n	{\r\n		for (j = -1; j <= 1; j++)\r\n		{\r\n			if (i == 0 && j == 0)                      // (x,y)\r\n			{\r\n				continue;\r\n			}\r\n			flag = 0;\r\n			if (legalDirect(x, y, i, j, flag))\r\n			{\r\n				return 1;\r\n			}\r\n			DirectNumTemp[0]=0;                            //\r\n		}\r\n	}\r\n	return 0;\r\n}\r\n\r\n\r\nint CanEatNum(int x,int y)                                //(x,y) \r\n{\r\n	CopyBoard();\r\n	int i, j, flag,w=0;\r\n	for (i = -1; i <= 1; i++)                          /* (x,y)*/\r\n	{\r\n		for (j = -1; j <= 1; j++)\r\n		{\r\n			if (i == 0 && j == 0)                      // (x,y)\r\n			{\r\n				continue;\r\n			}\r\n			flag = 0;\r\n			if (legalDirect(x, y, i, j, flag))\r\n			{\r\n				w+= DirectNumTemp[0];\r\n			}\r\n			DirectNumTemp[0]=0;                            //\r\n		}\r\n	}\r\n	return w;\r\n} \r\n\r\n\r\nvoid fanzhuan(int x ,int y)                           // xyboard1  \r\n{\r\n	int i, j, flag;\r\n	CopyBoard();\r\n	board2[x][y]=1;\r\n	for (i = -1; i <= 1; i++)                          // (x,y) \r\n	{\r\n		for (j = -1; j <= 1; j++)\r\n		{\r\n			if (i == 0 && j == 0)                      // (x,y) \r\n			{\r\n				continue;\r\n			}\r\n			flag = 0;\r\n			if (legalDirect(x, y, i, j, flag))             // \r\n			{\r\n				for(int k(0); k<DirectNumTemp[0]+1; k++){\r\n					board2[x+i*k][y+j*k]= 1 ;          //  \r\n				} \r\n			}\r\n			DirectNumTemp[0]=0;                            // \r\n		}\r\n	}\r\n}\r\n\r\n\r\nbool isConner(int x ,int y)                           // \r\n{\r\n	if(x==0&&y==0)return 1;\r\n	else if(x==0&&y==7)return 1;\r\n	else if(x==7&&y==0)return 1;\r\n	else if(x==7&&y==7)return 1;\r\n	return 0; \r\n}\r\n\r\nbool is1BesideConner(int x ,int y)                   //412 \r\n{\r\n	if(x==0||x==7)\r\n		if(y==1||y==6)return 1;\r\n	if(x==1||x==6)\r\n		if(y==0||y==1||y==6||y==7)return 1;\r\n	return 0;\r\n}\r\n\r\n\r\nbool is2BesideConner(int x ,int y)                   //416 \r\n{\r\n	if(y==5||y==2)\r\n		if(x==1||x==0||x==6||x==7)return 1;\r\n	if(x==5||x==2)\r\n			if(y==1||y==0||y==6||y==7)return 1;\r\n	if((x==2&&y==2 )||( x==2&&y==5 )||( x==5&&y==5 )|| (x==5&&y==2) )return 1;\r\n	\r\n	return 0;\r\n} \r\n\r\n\r\nint WhiteCanGoNum (int x , int y)                     //xy \r\n{\r\n	int a=x,b=y;\r\n	CopyBoard(); \r\n	fanzhuan(a,b);                                   \r\n	ChangeBoard(); 									//legalDirectlegal\r\n	int w=0;\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0); j<8; j++)\r\n			if(legal(i,j))w++;                           \r\n	CopyBoard();                                    // \r\n	return w;\r\n} \r\n\r\n\r\nbool WhiteCanGotoConner(int x, int y)                 //     \r\n{\r\n	int a=x,b=y;\r\n	CopyBoard();\r\n	fanzhuan(a,b);\r\n	ChangeBoard();\r\n	if(legal(0,0)||legal(7,7)||legal(0,7)||legal(7,0))\r\n	{\r\n		CopyBoard();\r\n		return 1; \r\n	}\r\n	CopyBoard();\r\n	return 0;\r\n}\r\n\r\nbool WhiteCanGotoConner2(int x, int y)\r\n{\r\n	CopyBoard();\r\n	int a=x,b=y;\r\n	fanzhuan(a,b);\r\n	ChangeBoard();\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0); j<8; j++)\r\n		{\r\n			int a1=i,b1=j;\r\n			if(is2BesideConner(a1,b1))\r\n				if(legal(a1,b1)){\r\n					CopyBoard();\r\n					return 1; \r\n				}\r\n		}\r\n	CopyBoard();\r\n	return 0;\r\n}\r\n\r\nbool CanEatWhiteInConner2(int x ,int y)\r\n{\r\n	CopyBoard();\r\n	int a=x,b=y;\r\n	fanzhuan(a,b);\r\n	ChangeBoard();\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0); j<8; j++)\r\n		{\r\n			int a1=i,b1=j;\r\n			if(is2BesideConner(a1,b1))\r\n				if(board[i][j]!=board2[i][j]){\r\n					CopyBoard();\r\n					return 1; \r\n				}\r\n		}\r\n	CopyBoard();\r\n	return 0;\r\n}\r\n\r\nbool WhiteMustGotoConner1(int x ,int y)\r\n{\r\n	CopyBoard();\r\n	int a=x,b=y;\r\n	fanzhuan(a,b);\r\n	ChangeBoard();\r\n	if(WhiteCanGoNum(a,b)!=1)return 0;\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0); j<8; j++)\r\n		{\r\n			int a1=i,b1=j;\r\n			if(is1BesideConner(a1,b1))\r\n				if(legal(a1,b1)){\r\n					CopyBoard();\r\n					return 1; \r\n				}\r\n		}\r\n	CopyBoard();\r\n	return 0;\r\n}\r\n\r\nint GiveAv(Av av[])                                          //av[] \r\n{\r\n	int k=0,a,b;\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0); j<8; j++)\r\n		{\r\n			a=i;\r\n			b=j;\r\n			if(legal(a,b)){\r\n				av[k].x = i;\r\n				av[k].y = j;\r\n				k++;\r\n			}\r\n		}\r\n			\r\n	return k ;\r\n}\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nvoid Power(int k)                                       // \r\n{\r\n	\r\n	for(int i(0); i<k; i++)\r\n	{\r\n		av[i].power=0;\r\n		int x=av[i].x;\r\n		int y=av[i].y;\r\n		if(isConner(x,y))av[i].power+=100;\r\n		if(WhiteCanGotoConner(x,y))av[i].power-=100;\r\n		if(WhiteCanGotoConner2(x,y))av[i].power-=15;\r\n		if(is1BesideConner(x,y))av[i].power-=50;\r\n		if(is2BesideConner(x,y))av[i].power+=15;\r\n		if(CanEatWhiteInConner2(x,y))av[i].power+=20;\r\n		if(WhiteMustGotoConner1(x,y))av[i].power+=100;\r\n	}\r\n}\r\n\r\n\r\n\r\n int main()\r\n{\r\n	int w=0;\r\n	for(int i(0); i<8; i++)                                //  \r\n		for(int j(0); j<8; j++)\r\n		{\r\n			cin >> board[i][j]; \r\n			if(board[i][j]==2||board[i][j]==1)w++;\r\n		} \r\n		\r\n	CopyBoard();\r\n	\r\n	bool key1=0, key2=0 ,key3=0;;                               					    //\r\n	if(board[0][0]!=0||board[0][7]!=0||board[7][0]!=0||board[7][7]!=0)key2=1;   // \r\n	if(board[0][0]+board[0][7]+board[7][0]+board[7][7]>1)key3=1;		        //                                                            \r\n	if(w>64)key1=1;																// \r\n	int k;\r\n	k=GiveAv(av);\r\n		\r\n	Power(k);\r\n	if(key3==1)                                                                 // \r\n	{    \r\n		for(int i(0); i<k; i++)\r\n		{     \r\n			av[i].power+=CanEatNum(av[i].x,av[i].y)*4;\r\n			av[i].power-=WhiteCanGoNum(av[i].x,av[i].y);\r\n		}\r\n		\r\n	}	\r\n	else if(key2==1)															// \r\n	{    \r\n		for(int i(0); i<k; i++)\r\n		{     \r\n			av[i].power+=CanEatNum(av[i].x,av[i].y)*4;\r\n			av[i].power-=WhiteCanGoNum(av[i].x,av[i].y)*2;\r\n		}\r\n		\r\n	}\r\n\r\n	else if(key1==1)                                                    	    // \r\n	{\r\n		for(int i(0); i<k; i++)\r\n		{\r\n			av[i].power+=CanEatNum(av[i].x,av[i].y);\r\n			av[i].power-=WhiteCanGoNum(av[i].x,av[i].y)*3;\r\n		}\r\n\r\n	}\r\n\r\n	else                                                                    // \r\n	{\r\n		for(int i(0); i<k; i++)\r\n		{\r\n			av[i].power-=CanEatNum(av[i].x,av[i].y)*4;\r\n		}\r\n	}\r\n	\r\n	\r\n	int x=av[0].x,y=av[0].y,max=av[0].power;\r\n	for(int i(1); i<k; i++)\r\n		 if(av[i].power>max)\r\n		 {\r\n		 	max=av[i].power;\r\n		 	x=av[i].x;\r\n		 	y=av[i].y;\r\n		 }\r\n	if(k==0)return 1;\r\n	\r\n	\r\n\r\n	cout << x <<\" \"<< y;	                                			// \r\n		return 1;\r\n}','compile correct','g++','othello','2013-06-02 21:29:42','');
INSERT INTO task VALUES (332,'hongbing','#include<stdio.h>\r\nint best_row,best_col;\r\nvoid make_move(int board[8][8],int row,int col)\r\n{\r\n     int rowde=0,colde=0;\r\n     int x=0,y=0;\r\n     board[row][col]=1;\r\n     for(rowde=-1;rowde<=1;rowde++)\r\n        for(colde=-1;colde<=1;colde++)\r\n         {\r\n             if(row+rowde<0||row+rowde>=8||col+colde<0||col+colde>=8||(rowde==0&&colde==0))\r\n             continue;\r\n             if(board[row+rowde][col+colde]==2)\r\n              {\r\n               x=row+rowde,y=col+colde;\r\n               for(;;)\r\n               {\r\n                 x+=rowde;\r\n                 y+=colde;\r\n                 if(x<0||x>=8||y<0||y>=8)\r\n                  break;\r\n                if(board[x][y]==0)\r\n                break;\r\n                if(board[x][y]==1)\r\n                {\r\n                  while(board[x-=rowde][y-=colde]==2)\r\n                         board[x][y]=1;\r\n                       break;\r\n                }\r\n               }\r\n              }\r\n             }\r\n}\r\nint get_score(int board[8][8])\r\n{\r\n    int score=0,row=0,col=0;\r\n    for(row=0;row<8;row++)\r\n       for(col=0;col<8;col++)\r\n             score+=board[row][col]==1;\r\n          return score;\r\n}\r\n int valid_moves(int board[8][8],int moves[8][8])\r\n{\r\n    int rowde=0,colde=0;\r\n    int row=0,col=0;\r\n    int x=0,y=0;\r\n    int no_of_moves=0;\r\n    for(row=0;row<8;row++)\r\n       for(col=0;col<8;col++)\r\n         moves[row][col]=0;\r\n    for(row=0;row<8;row++)\r\n       for(col=0;col<8;col++)\r\n          {\r\n            if(board[row][col]!=0)\r\n               continue;\r\n    for(rowde=-1;rowde<=1;++rowde)\r\n       for(colde=-1;colde<=1;++colde)\r\n          {\r\n             if(row+rowde<0||row+rowde>=8||col+colde<0||col+colde>=8||(rowde==0&&colde==0))\r\n             continue;\r\n    if(board[row+rowde][col+colde]==2)\r\n       {\r\n         x=row+rowde,y=col+colde;\r\n         for(;;)\r\n         {\r\n                x+=rowde;\r\n                y+=colde;\r\n                if(x<0||x>=8||y<0||y>=8)\r\n                  break;\r\n                if(board[x][y]==0)\r\n                break;\r\n                if(board[x][y]==1)\r\n                  {\r\n                    moves[row][col]=1;\r\n                    no_of_moves++;\r\n                    break;\r\n                  }\r\n         }\r\n       }\r\n         }\r\n    }\r\n    return no_of_moves;\r\n}    \r\nint best_move(int board[8][8],int moves[8][8])\r\n{\r\n    int row=0,col=0,i=0,j=0;\r\n    int new_board[8][8]={0};\r\n    int score=0,new_score=0;\r\n    for(row=0;row<8;row++)\r\n       for(col=0;col<8;col++)\r\n          {\r\n             if(!moves[row][col])\r\n             continue;\r\n             for(i=0;i<8;i++)\r\n                for(j=0;j<8;j++)\r\n                   new_board[i][j]=board[i][j];\r\n                   make_move(new_board,row,col);\r\n             new_score=get_score(new_board);\r\n             if(score<new_score)\r\n             {\r\n                score=new_score;\r\n                best_row=row;\r\n                best_col=col;\r\n             }\r\n          }\r\n          return score;\r\n}   \r\n main()\r\n{\r\n       int i,j,row,col,s;\r\n       int a[8][8],vmoves[8][8];\r\n       for(i=0;i<8;i++)\r\n          for(j=0;j<8;j++)\r\n       scanf(\"%d\",&a[i][j]);\r\n       for(i=0;i<8;i++)\r\n          for(j=0;j<8;j++)\r\n          vmoves[i][j]=0;\r\n       valid_moves(a,vmoves);//vmove \r\n       s=best_move(a,vmoves);\r\n       printf(\"%d %d\\n\",best_row,best_col);\r\n}\r\n    ','compile correct','gcc','othello','2013-06-08 14:00:04','');
INSERT INTO task VALUES (353,'LerenceRay','#include<cmath>\r\n#include<iostream>\r\n#include<cstdlib>\r\n#include<cstring>\r\nusing namespace std;\r\n\r\nint a[8][8], d[3][3] = {0, 1, 2, 3, -1, 4, 5, 6, 7};\r\n\r\nstruct point \r\n{\r\n		int x, y;\r\n		int eat;\r\n		int s;\r\n}p[8][8];\r\n\r\nint direct(int x, int y, int xx, int yy, int flag)\r\n{\r\n		x += xx;\r\n		y += yy;\r\n		if (x < 0 || x > 7 || y < 0 || y > 7)\r\n				return -10;\r\n		else if (a[x][y] == 2)\r\n		{\r\n				flag = 1;\r\n				return 1 + direct(x, y, xx, yy, flag);\r\n		}\r\n		else if (a[x][y] == 1)\r\n		{\r\n				if (flag)\r\n						return 1;\r\n				return -10;\r\n		}\r\n		return -10;\r\n}\r\n\r\nint check (int p, int q)\r\n{\r\n		int i, j, x = 0, y = 0, flag = 0;\r\n\r\n		if (a[p][q])\r\n				return 0;\r\n		else\r\n		{\r\n				for (i = -1; i <= 1; ++i)\r\n						for (j = -1; j <= 1; ++j)\r\n						{\r\n								if (j == 0 && i == 0)\r\n										continue;\r\n								flag = 0;\r\n								if (direct(p, q, i, j, flag) > 0)\r\n										y += (1 << d[i + 1][j + 1]);\r\n						}\r\n				return y;\r\n		}\r\n}\r\n\r\nint next(int p, int q, int tem)\r\n{\r\n		int b[8][8], c[8][8], i, j, k, s, t;\r\n\r\n		for (i = 0; i < 8; ++i)\r\n				for (j = 0; j < 8; ++j)\r\n						b[i][j] = a[i][j];\r\n		b[p][q] = 1;\r\n		for (k = 0; k < 8; ++k)\r\n		{\r\n				if (tem & (1 << k))\r\n				{\r\n						for (i = 0; i < 3; ++i)\r\n						{\r\n								for (j = 0; j < 3; ++j)\r\n										if (d[i][j] == k)\r\n												break;\r\n								if (j != 3)\r\n										break;\r\n						}\r\n						s = p + i - 1;\r\n						t = q + j - 1;\r\n						while (b[s][t] != 1)\r\n						{\r\n								b[s][t] = 1;\r\n								s += i - 1;\r\n								t += j - 1;\r\n						}\r\n				}							\r\n		}\r\n		for (i = 0; i < 8; ++i)\r\n				for (j = 0; j < 8; ++j)\r\n				{\r\n						if (b[i][j] == 1)\r\n								b[i][j] = 2;\r\n						else if (b[i][j] == 2)\r\n								b[i][j] = 1;\r\n				}\r\n		for (i = 0; i < 8; ++i)\r\n				for (j = 0; j < 8; ++j)\r\n				{\r\n						c[i][j] = a[i][j];\r\n						a[i][j] = b[i][j];\r\n				}\r\n		if (check(0, 0) || check(0, 7) || check(7, 0) || check(7, 7))\r\n		{\r\n				for (i = 0; i < 8; ++i)\r\n						for (j = 0; j < 8; ++j)\r\n								a[i][j] = c[i][j];\r\n				return -10;\r\n		}\r\n		else\r\n		{\r\n				for (i = 0; i < 8; ++i)\r\n						for (j = 0; j < 8; ++j)\r\n								a[i][j] = c[i][j];\r\n				return 1;\r\n		}\r\n}\r\n\r\nint cmp1(const void *p, const void *q)\r\n{\r\n		point *s, *t;\r\n		s = (point *)p;\r\n		t = (point *)q;\r\n		if (s -> s == t -> s)\r\n				return t -> eat - s -> eat;\r\n		else\r\n				return t -> s - s -> s;\r\n}\r\n\r\nint cmp2(const void *p, const void *q)\r\n{\r\n		point *s, *t;\r\n		s = (point *)p;\r\n		t = (point *)q;\r\n		return t -> eat - s -> eat;\r\n}\r\n\r\n\r\nint main()\r\n{\r\n		int i, j, k, ii, jj, tem, t = 0, sum = 0;     /*tem checkt tem*/\r\n\r\n		for (i = 0;i < 8; ++i)\r\n				for (j = 0; j < 8; ++j)\r\n				{\r\n						cin >> a[i][j];\r\n						p[i][j].x = i;\r\n						p[i][j].y = j;\r\n						p[i][j].eat = 0;\r\n						p[i][j].s = -100;\r\n				}\r\n		p[1][0].eat = p[0][1].eat = p[1][1].eat = p[1][7].eat = p[0][6].eat = p[1][6].eat = p[7][1].eat = p[6][0].eat = p[6][1].eat = p[6][6].eat = p[6][7].eat = p[7][6].eat = -15;\r\n		sum = check(0, 0) ? 1 : 0 + check(7, 7) ? 1 : 0 + check(7, 0) ? 1 : 0 + check(0, 7) ? 1 : 0;\r\n		if (sum < 2)\r\n		{\r\n				if (check(0, 0))\r\n						cout << 0 << \' \' << 0 << endl;\r\n				else if (check(7, 0))\r\n						cout << 7  << \' \' << 0 << endl;\r\n				else if (check(0, 7))\r\n						cout << 0 << \' \' << 7 << endl;\r\n				else if (check(7, 7))\r\n						cout << 7 << \' \' << 7 << endl;\r\n				else\r\n				{\r\n						for (i = 0; i < 8; ++i)\r\n						{\r\n								for (j = 0; j < 8; ++j)\r\n								{\r\n										t = 0;\r\n										tem = check(i, j);\r\n										if (tem)\r\n										{\r\n												for (k = 0; k < 8; ++k)\r\n												{\r\n														if (tem & (1 << k))\r\n														{\r\n																for (ii = 0; ii < 3; ++ii)\r\n																{\r\n																		for (jj = 0; jj < 3; ++jj)\r\n																				if (d[ii][jj] == k)\r\n																						break;\r\n																		if (jj != 3)\r\n																				break;\r\n																}\r\n																t += direct(i, j, ii - 1, jj - 1, 0);														\r\n														}							\r\n												}\r\n												p[i][j].eat += t;\r\n												p[i][j].s = next(i, j, tem);\r\n										}\r\n								}						\r\n						}\r\n						qsort(p, 64, sizeof(p[0][0]), cmp1);\r\n						cout << p[0][0].x << \' \' << p[0][0].y << endl;\r\n				}\r\n		}\r\n		else\r\n		{\r\n				for (i = 0; i < 8; ++i)\r\n						{\r\n								for (j = 0; j < 8; ++j)\r\n								{\r\n										t = 0;\r\n										tem = check(i, j);\r\n										if (tem)\r\n										{\r\n												for (k = 0; k < 8; ++k)\r\n												{\r\n														if (tem & (1 << k))\r\n														{\r\n																for (ii = 0; ii < 3; ++ii)\r\n																{\r\n																		for (jj = 0; jj < 3; ++jj)\r\n																				if (d[ii][jj] == k)\r\n																						break;\r\n																		if (jj != 3)\r\n																				break;\r\n																}\r\n																t += direct(i, j, ii - 1, jj - 1, 0);														\r\n														}							\r\n												}\r\n												p[i][j].eat += t;\r\n										}\r\n								}						\r\n						}\r\n						qsort(p, 64, sizeof(p[0][0]), cmp2);\r\n						cout << p[0][0].x << \' \' << p[0][0].y << endl;\r\n		}\r\n\r\n		return 0;\r\n}','compile correct','g++','othello','2013-06-10 11:20:22','');
INSERT INTO task VALUES (364,'baird','#include <stdio.h>\r\n#include <stdlib.h>\r\n//#include <sys/time.h>\r\n#define OPPOSITE(x) ((~x) & 3)\r\n#define VALID_CELL(x,y) ((x > -1) && (x < 8) && (y > -1) && (y < 8))\r\nint weight[8][8] =\r\n  { {512,   4, 128, 256, 256, 128,   4, 512},\r\n    {  4,   2,   8,  16,  16,   8,   2,   4},\r\n    {128,   8,  64,  32,  32,  64,   8, 128},\r\n    {256,  16,  32,   2,   2,  32,  16, 256},\r\n    {256,  16,  32,   2,   2,  32,  16, 256},\r\n    {128,   8,  64,  32,  32,  64,   8, 128},\r\n    {  4,   2,   8,  16,  16,   8,   2,   4},\r\n    {512,   4, 128, 256, 256, 128,   4, 512}\r\n  };\r\nint moves_x[1830];\r\nint moves_y[1830];\r\nint moves_next = 0;\r\nint moves_stack_block[60];\r\nint moves_stack_next = 0;\r\nint flips_x[1520];\r\nint flips_y[1520];\r\nint flips_next = 0;\r\nint flips_stack_block[60];\r\nint flips_stack_who[60];\r\nint flips_stack_next = 0;\r\nint board[8][8], best_x, best_y;\r\nint empties(void);\r\nvoid get_all(int);\r\nvoid get_move(int, int);\r\nint legalDirect(int, int, int, int, int, int);\r\nint legal(int, int, int);\r\nvoid make_move(int, int, int);\r\nvoid undo_move(void);\r\nvoid unget_all(void);\r\nint weigh_move(int, int, int, int, int);\r\nint main()\r\n{\r\n	int i, j;\r\n	for (i = 0; i < 8; ++i)\r\n		for (j = 0; j < 8; ++j)\r\n		scanf(\"%d\", &board[i][j]);\r\n    get_move(1, 6); /*AI155*/\r\n    printf(\"%d %d\\n\", best_x, best_y);\r\n    return 1;\r\n}\r\n\r\n/*\r\n**\r\n*/\r\nvoid get_all(int who)\r\n{\r\n	int i, j;\r\n	moves_stack_block[moves_stack_next] = 0;\r\n	for(i = 0; i < 8; i++)\r\n		for(j = 0; j < 8; j++)\r\n			if(legal(i, j, who))\r\n			{\r\n				moves_x[moves_next] = i;\r\n				moves_y[moves_next] = j;\r\n				moves_next++;\r\n				moves_stack_block[moves_stack_next]++;\r\n			}\r\n	moves_stack_next++;\r\n}\r\n\r\n/*\r\n**\r\n*/\r\nvoid unget_all(void)\r\n{\r\n	moves_next -= moves_stack_block[--moves_stack_next];\r\n}\r\n\r\nint legalDirect(int x, int y, int xoffest, int yoffset, int flag, int who)\r\n{\r\n    int oppo = OPPOSITE(who);\r\n	x += xoffest;\r\n	y += yoffset;\r\n	if (x < 0 || x >= 8 || y < 0 || y >= 8)// \r\n	{\r\n		return 0;\r\n	}\r\n	if (board[x][y] == oppo)\r\n	{\r\n		/* (x,y),\r\n		*  ,\r\n		*/\r\n		flag = 1;\r\n		return legalDirect(x, y, xoffest, yoffset, flag, who);\r\n	}\r\n	else if (board[x][y] == who)\r\n	{\r\n		/* , legal=1*/\r\n		return flag;\r\n	}\r\n	else\r\n		return 0;\r\n	return 0;\r\n}\r\n/*\r\n**\r\n*/\r\nint legal(int x, int y, int who)\r\n{\r\n	if (board[x][y]!=0)\r\n		return 0;\r\n	int i, j, flag;\r\n	/* (x,y)*/\r\n	for (i = -1; i <= 1; i++)\r\n	{\r\n		for (j = -1; j <= 1; j++)\r\n		{\r\n			if (i == 0 && j == 0)// (x,y)\r\n			{\r\n				continue;\r\n			}\r\n			flag = 0;\r\n			if (legalDirect(x, y, i, j, flag, who))\r\n			{\r\n				return 1;\r\n			}\r\n		}\r\n	}\r\n	return 0;\r\n}\r\n\r\n/*\r\n**\r\n*/\r\nvoid make_move(int x, int y, int who)\r\n{\r\n  int dx, dy, i, j, opp = OPPOSITE(who);\r\n  board[x][y] = who;\r\n  flips_x[flips_next] = x;\r\n  flips_y[flips_next] = y;\r\n  flips_next++;\r\n  flips_stack_block[flips_stack_next] = 1;\r\n  flips_stack_who[flips_stack_next] = who;\r\n  for(dx = -1; dx < 2; dx++)\r\n    for(dy = -1; dy < 2; dy++)\r\n    {\r\n      i = x + dx;\r\n      j = y + dy;\r\n      /* branch in each direction */\r\n      if((dx || dy) && VALID_CELL(i, j) && board[i][j] == opp)\r\n      {\r\n        do\r\n        {\r\n          i += dx;\r\n          j += dy;\r\n        }\r\n        while(VALID_CELL(i, j) && (board[i][j] == opp));\r\n        /* if this direction is to be flipped */\r\n        if(VALID_CELL(i, j) && (board[i][j] == who))\r\n        {\r\n          i -= dx;\r\n          j -= dy;\r\n          /* go back and flip each piece */\r\n          while(board[i][j] == opp)\r\n          {\r\n            board[i][j] = who;\r\n            flips_x[flips_next] = i;\r\n            flips_y[flips_next] = j;\r\n            flips_next++;\r\n            flips_stack_block[flips_stack_next]++;\r\n            i -= dx;\r\n            j -= dy;\r\n          };\r\n        }\r\n      }\r\n	}\r\n	flips_stack_next++;\r\n}\r\n\r\n/*\r\n**AI\r\n*/\r\nint weigh_move(int x, int y, int who, int max_depth, int add)\r\n{\r\n	int bottom, top, i, move_weight = 0, depth_weight = 0, temp;\r\n	bottom = flips_next;\r\n	make_move(x, y, who);\r\n	top = flips_next;\r\n	for (i = bottom; i < top; ++i)\r\n		move_weight += (add ? 1 : (-1)) * weight[flips_x[i]][flips_y[i]];\r\n	if (max_depth && empties())\r\n	{\r\n		who = OPPOSITE(who);\r\n		add = !add;\r\n		bottom = moves_next;\r\n		get_all(who);\r\n		top = moves_next;\r\n		for(i = bottom; i < top; ++i)\r\n		{\r\n			temp = weigh_move(moves_x[i], moves_y[i], who, max_depth - 1, add);\r\n			if(temp < depth_weight)\r\n				depth_weight = temp;\r\n		}\r\n		unget_all();\r\n    }\r\n    undo_move();\r\n    return move_weight + depth_weight;\r\n}\r\n\r\nvoid undo_move(void)\r\n{\r\n	int i, who, top = flips_next;\r\n	flips_next -= flips_stack_block[--flips_stack_next];\r\n	board[flips_x[flips_next]][flips_y[flips_next]] = 0;\r\n	who = OPPOSITE(flips_stack_who[flips_stack_next]);\r\n	for(i = flips_next + 1; i < top; i++)\r\n		board[flips_x[i]][flips_y[i]] = who;\r\n}\r\n/*\r\n**\r\n*/\r\nint empties(void)\r\n{\r\n    int i, j, blocks = 64;\r\n    for (i = 0; i < 8; ++i)\r\n        for (j = 0; j < 8; ++j)\r\n            if (board[i][j]) --blocks;\r\n    return blocks;\r\n}\r\n\r\n/*\r\n**AI\r\n*/\r\nvoid get_move(int who, int deep)\r\n{\r\n    int bottom, top, i, move_weight, best_weight;\r\n    if (!empties()) return;\r\n    if ((empties() < 11) && deep) deep = 13; /**/\r\n    bottom = moves_next; /**/\r\n    get_all(who); /**/\r\n    top = moves_next; /**/\r\n    if (bottom == top)\r\n	{\r\n		unget_all();\r\n		return;\r\n	}\r\n    /**/\r\n    best_x = moves_x[bottom];\r\n    best_y = moves_y[bottom];\r\n    best_weight = weigh_move(best_x, best_y, who, deep, 1);\r\n    /*\r\n    **\r\n    **\r\n    */\r\n    for (i = bottom + 1; i < top; ++i)\r\n	{\r\n		move_weight = weigh_move(moves_x[i], moves_y[i], who, deep, 1);\r\n		if (move_weight > best_weight || ((move_weight == best_weight) && rand() % 2)) /**/\r\n		{\r\n			best_x = moves_x[i];\r\n			best_y = moves_y[i];\r\n			best_weight = move_weight;\r\n		}\r\n	}\r\n	unget_all();\r\n}\r\n','compile correct','gcc','othello','2013-06-10 17:04:34','');
INSERT INTO task VALUES (422,'abolo','#include <stdio.h>\r\n#include <stdlib.h>\r\n\r\nint board[8][8] = {0},map[8][8];\r\nint mapvalue[8][8]={\r\n{10000,-30,40,40,40,40,-30,10000},\r\n{-30,-30,10,10,10,10,-30,-40},\r\n{40,10,30,10,10,30,10,40},\r\n{40,10,10,30,30,10,10,40},\r\n{40,10,10,30,30,10,10,40},\r\n{40,10,30,10,10,30,10,40},\r\n{-30,-30,10,10,10,10,-30,-30},\r\n{10000,-30,40,40,40,-30,10000}};\r\nint turnnumber;\r\n/* (x,y),xoffest,yoffset(x,y)*/\r\nint legalDirect(int x, int y, int xoffest, int yoffset, int flag)\r\n{\r\n	x += xoffest;\r\n	y += yoffset;\r\n	if (x < 0 || x >= 8 || y < 0 || y >= 8)// \r\n	{\r\n		return 0;\r\n	}\r\n	if (board[x][y] == 2)\r\n	{\r\n		/* (x,y),\r\n		*  ,\r\n		*/\r\n		flag = 1;\r\n		return legalDirect(x, y, xoffest, yoffset, flag);\r\n	}\r\n	else if (board[x][y] == 1)\r\n	{\r\n		/* , legal=1*/\r\n		if (flag == 1)\r\n		{\r\n			return 1;\r\n		}\r\n		return 0;\r\n	}\r\n	else\r\n		return 0;\r\n\r\n	return 0;\r\n}\r\n\r\n/* , 0, 1*/\r\nint legal(int x, int y)\r\n{\r\n	if (board[x][y]!=0)// \r\n		return 0;\r\n	int i, j, flag;\r\n	/* (x,y)*/\r\n	for (i = -1; i <= 1; i++)\r\n	{\r\n		for (j = -1; j <= 1; j++)\r\n		{\r\n			if (i == 0 && j == 0)// (x,y)\r\n			{\r\n				continue;\r\n			}\r\n			flag = 0;\r\n			if (legalDirect(x, y, i, j, flag))\r\n			{\r\n				return 1;\r\n			}\r\n		}\r\n	}\r\n	return 0;\r\n}int changemap(int x,int y)\r\n{\r\n	int i,j,k,xx,yy,p,q;\r\n	turnnumber=0;\r\n	for (i = -1; i <= 1; i++)\r\n	{\r\n		for (j = -1; j <= 1; j++)\r\n		{\r\n			if (i != 0 || j != 0)\r\n			for (k=1;k<8;k++)\r\n			{\r\n				xx=k*i+x;\r\n				yy=k*j+y;\r\n				if (xx < 0 || xx >= 8 || yy < 0 || yy >= 8 || board[xx][yy]==0)// \r\n				{\r\n					break;\r\n				}\r\n				if (board[xx][yy]==1)\r\n				{\r\n					for (p=0;p<k;p++)\r\n					{\r\n						board[x+p*i][y+p*j]=1;\r\n						turnnumber+=mapvalue[x+p*i][y+p*j];\r\n					}\r\n					break;\r\n				}\r\n			}\r\n		}\r\n	}\r\n	 	board[x][y]=1;\r\n		return turnnumber;\r\n}\r\n\r\nint max(int a,int b)\r\n{\r\n	if (a>b) return a;\r\n	return b;\r\n}\r\n\r\nint main()\r\n{\r\n	int i,j,p,q,value,k,ans=-1000000,ansx,ansy,flag;\r\n	int tmap[8][8];\r\n	int a[4]={0,0,7,7};\r\n	int b[4]={7,0,0,7};\r\n	for(i=0;i<8;i++)\r\n	for(j=0;j<8;j++)\r\n	{\r\n		scanf(\"%d\",&map[i][j]);\r\n		board[i][j]=map[i][j];\r\n	}\r\n	for (i=0;i<8;i++)\r\n	for (j=0;j<8;j++)\r\n	if (legal(i,j))\r\n	{\r\n		changemap(i,j);\r\n		value=0;\r\n		/*for (p=0;p<8;p++)\r\n		for (q=0;q<8;q++)\r\n		{\r\n			if (board[p][q]==1)\r\n			value+=mapvalue[p][q];\r\n			if (board[p][q]==2)\r\n			value-=mapvalue[p][q];\r\n		}*/\r\n		value=turnnumber;\r\n		for (p=0;p<8;p++)\r\n		{\r\n			flag=0;\r\n			for (q=0;q<8;q++)\r\n			if (board[p][q]!=1)\r\n			flag=1;\r\n			if (!flag) value+=50;\r\n		}\r\n		for (q=0;q<8;q++)\r\n		{\r\n			flag=0;\r\n			for (p=0;p<8;p++)\r\n			if (board[p][q]!=1)\r\n			flag=1;\r\n			if (!flag) value+=50;\r\n		}\r\n		for (k=0;k<4;k++)\r\n		if (legal(a[k],b[k]))	value*=2;\r\n		for(p=0;p<8;p++)\r\n			for(q=0;q<8;q++) \r\n			{\r\n				if (board[p][q]==1) board[p][q]=2;\r\n				else if (board[p][q]==2) board[p][q]=1;\r\n			}\r\n		for (k=0;k<4;k++)\r\n		if (legal(a[k],b[k]))	value /=4;\r\n		if (ans<value)\r\n		{	\r\n			ansx=i;\r\n			ansy=j;\r\n			ans=value;\r\n		}\r\n		for(p=0;p<8;p++) for(q=0;q<8;q++) board[p][q]=map[p][q];\r\n	}\r\n	printf(\"%d %d\\n\",ansx,ansy);\r\n	return 1;\r\n}\r\n\r\n/*int main()\r\n{\r\n	int i , j , p , q , nvalue , tvalue , ansx , ansy;\r\n	freopen(\"1.txt\",\"r\",stdin);\r\n	nvalue = 10000000;\r\n    for(i=0;i<8;i++)\r\n	for(j=0;j<8;j++)\r\n	{\r\n		scanf(\"%d\",&map[i][j]);\r\n	}\r\n	for (i=0;i<8;i++)\r\n	for (j=0;j<8;j++)\r\n	{\r\n    	for(p=0;p<8;p++)\r\n		for(q=0;q<8;q++) \r\n		{\r\n		   board[p][q] = map[p][q];\r\n		}\r\n	  if (legal(i , j))\r\n	  {\r\n	  	changemap(i , j);\r\n	  	for(p=0;p<8;p++)\r\n		for(q=0;q<8;q++) \r\n		{\r\n			if (board[p][q]==1) board[p][q]=2;\r\n			else if (board[p][q]==2) board[p][q]=1;\r\n		}\r\n		tvalue = basic();\r\n		if (tvalue < nvalue)\r\n		{\r\n			ansx=i; ansy=j; nvalue=tvalue;\r\n		}\r\n	  }\r\n	}\r\n    printf(\"%d %d\\n\" , ansx , ansy);\r\n    return 1;\r\n}*/','compile correct','gcc','othello','2013-06-17 18:58:16','');
INSERT INTO task VALUES (434,'jerrytest2','#include<cstdio>\r\n#include<iostream>\r\nusing namespace std;\r\n\r\n//boardboard2\r\n\r\n\r\nint board[8][8] = {{0}} , board2[8][8] = {{0}} ;                 //board2board\r\nint DirectNumTemp = 0;                 // xy\r\nconst int DEPTH = 7;                   // \r\nconst int First =40 ;\r\n\r\nvoid Print()\r\n{\r\n	for(int i(0); i < 8; i++)\r\n	{\r\n		for(int j(0); j < 8; j++)\r\n    	{		\r\n    		printf(\"%d\",board2[i][j]);\r\n 		}\r\n		printf(\"\\n\");\r\n	}\r\n	printf(\"\\n\");\r\n}\r\n\r\n//boardboard2\r\nvoid CopyBoard()                                                 \r\n{\r\n    for(int i(0); i < 8; i++)\r\n        for(int j(0); j < 8; j++)\r\n            board2[i][j] = board[i][j];\r\n}\r\n\r\nvoid CopyToBoardTemp(int boardtemp[8][8])                                                 \r\n{\r\n    for(int i(0); i < 8; i++)\r\n        for(int j(0); j < 8; j++)\r\n            boardtemp[i][j] = board2[i][j];\r\n}\r\n\r\n//(x,y)i,j \r\nbool LegalDirect(int x, int y, int i, int j, int flag , int &DirectNumTemp)             \r\n{\r\n    // DirectNumTemp?\r\n    x += i;\r\n    y += j;\r\n\r\n    if (x < 0 || x > 7 || y < 0 || y > 7)                        // \r\n        return 0;\r\n\r\n    int flagtemp;\r\n    if(board2[x][y] == 2)flagtemp = 0;                         //\r\n    else if(board2[x][y] == 1)flagtemp = 1;\r\n    else return 0;										// ,\r\n\r\n    if(flag == flagtemp && DirectNumTemp != 0)return 1;    //\r\n\r\n    else if (flagtemp != flag )\r\n        {\r\n            DirectNumTemp ++;              //\r\n            /* (x,y),\r\n            *  ,\r\n            */\r\n            return LegalDirect(x, y, i, j, flag, DirectNumTemp);\r\n        }\r\n    return 0;\r\n}\r\n\r\n//(x,y)(i,j)\r\nbool Legal(int x, int y, int flag)                                \r\n{\r\n    //DirectNum[i][j];     \r\n    if (board2[x][y] != 0)                              // \r\n        return 0;\r\n    int i, j;\r\n\r\n    for (i = -1; i <= 1; i++)                          // (x,y)\r\n        {\r\n            for (j = -1; j <= 1; j++)\r\n                {\r\n                    if (i == 0 && j == 0)                      // (x,y)\r\n                        {\r\n                            continue;\r\n                        }\r\n                    if (LegalDirect(x, y, i, j, flag, DirectNumTemp))\r\n                        {\r\n                        	DirectNumTemp = 0;                          //\r\n                            return 1;\r\n                        }\r\n                    DirectNumTemp = 0;                          //\r\n                }\r\n        }\r\n    return 0;\r\n}\r\n\r\n// xyboard1 \r\nvoid make_move(int x , int y, int flag,int boardtemp[][8])                           \r\n{\r\n	CopyToBoardTemp(boardtemp);\r\n    int i, j,temp1= ((flag==0) ?2:1 );\r\n    board2[x][y] = temp1;\r\n    for (i = -1; i <= 1; i++)                          // (x,y)\r\n        {\r\n            for (j = -1; j <= 1; j++)\r\n                {\r\n                    if (i == 0 && j == 0)                      // (x,y)\r\n                        continue;\r\n                    if ( LegalDirect(x, y, i, j, flag, DirectNumTemp)) //\r\n					{\r\n						for(int k(0); k < DirectNumTemp + 1; k++)\r\n                            board2[x + i * k][y + j * k] = temp1 ; // \r\n					}           \r\n                    DirectNumTemp = 0;\r\n                }\r\n        }\r\n}\r\n\r\n\r\nvoid unmake_move(int boardtemp[8][8])                                                 \r\n{\r\n    for(int i(0); i < 8; i++)\r\n        for(int j(0); j < 8; j++)\r\n            board2[i][j] = boardtemp[i][j];\r\n}\r\n\r\n\r\nbool isConner(int x ,int y)                           // \r\n{\r\n	if(x==0&&y==0)return 1;\r\n	else if(x==0&&y==7)return 1;\r\n	else if(x==7&&y==0)return 1;\r\n	else if(x==7&&y==7)return 1;\r\n	return 0; \r\n}\r\n\r\nbool is1BesideConner(int x ,int y)                   //412 \r\n{\r\n	if(x==0||x==7)\r\n		if(y==1||y==6)return 1;\r\n	if(x==1||x==6)\r\n		if(y==0||y==1||y==6||y==7)return 1;\r\n	return 0;\r\n}\r\n\r\nbool is2BesideConner(int x ,int y)                   //416 \r\n{\r\n	if(y==5||y==2)\r\n		if(x==1||x==0||x==6||x==7)return 1;\r\n	if(x==5||x==2)\r\n			if(y==1||y==0||y==6||y==7)return 1;\r\n	if((x==2&&y==2 )||( x==2&&y==5 )||( x==5&&y==5 )|| (x==5&&y==2) )return 1;\r\n	\r\n	return 0;\r\n} \r\n\r\n/*int CanGoNum (int flag)                     //xy \r\n{\r\n	int w=0;\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0); j<8; j++)\r\n			if(Legal(i,j,flag))w++;                           \r\n	return w;\r\n}*/\r\n\r\n\r\nint evaluation(int board2[8][8])\r\n{\r\n	int value(0), Total(0), White(0), Black(0), Conner(0);\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0);j<8; j++)\r\n		{\r\n			if(board2[i][j]==2)White++;\r\n			else if(board2[i][j]==1)Black++;\r\n		}\r\n	Total = Black + White ;\r\n	if(Black < 5)value = -10000;\r\n	for(int i(0); i<8; i++)\r\n	for(int j(0); j<8; j++)\r\n	{\r\n		if(board2[i][j]==0)continue;\r\n		if(isConner(i,j))\r\n		{\r\n			if(board2[i][j]==1)value+=1000;\r\n			else value-=1000;\r\n			Conner++;\r\n		}\r\n		if(is1BesideConner(i,j))\r\n		{\r\n			if(board2[i][j]==1)value-=100;\r\n			else value+=100;\r\n		}\r\n		if(is2BesideConner(i,j))\r\n		{\r\n			if(board2[i][j]==1)value+=20;\r\n			else value-=20;\r\n		}\r\n	}\r\n	if(Conner>1)\r\n	{\r\n		value+=Black;\r\n		value-=White;\r\n	}\r\n	else if(Total > First)\r\n	{\r\n		value-=Black;\r\n		value+=White;\r\n	}\r\n//	cout << \"evaluation\" << value << endl;\r\n	return value;\r\n}\r\n\r\n\r\nint get_exact()\r\n{\r\n	int value(0), White(0), Black(0);\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0);j<8; j++)\r\n		{\r\n			if(board2[i][j]==2)White++;\r\n			else if(board2[i][j]==1)Black++;\r\n		}\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0);j<8; j++)\r\n			if(board2[i][j]==2){\r\n				value+=Black;\r\n				value-=White;\r\n			}\r\n//	cout << \"get_exact\" << value << endl;\r\n	return value;\r\n}\r\n\r\nint alpha_beta(int alpha, int beta, int depth, int pass)\r\n{\r\n	int boardtemp[8][8] = {{0}};\r\n	int flag(0);\r\n	bool key (1);\r\n	if(depth % 2 == 1)flag = 1;\r\n	// \r\n	int best_value = -10000000;\r\n	// \r\n	if (depth == DEPTH) {\r\n		// \r\n		return evaluation(board2);\r\n	}\r\n	// \r\n	for(int i(0); i < 8; i++)\r\n        for(int j(0); j < 8; j++)\r\n                if(Legal(i, j, flag))\r\n                {\r\n                    make_move(i,j,flag,boardtemp);\r\n                    // \r\n					int value = -alpha_beta(-beta, -alpha, depth+1, 0);\r\n					// \r\n					unmake_move(boardtemp);\r\n					// \r\n					if (value >= beta) \r\n					{\r\n					// \r\n					return value;\r\n					}\r\n						// \r\n					if (value > best_value)\r\n					{\r\n						// \r\n						best_value = value;\r\n						// \r\n						if (value > alpha) \r\n						{\r\n							alpha = value;\r\n						}\r\n					}\r\n					key = 0;\r\n				}\r\n	// \r\n	if (key)\r\n	 {\r\n		// \r\n		if (pass) \r\n		{\r\n			// \r\n			return get_exact();\r\n		}\r\n		CopyToBoardTemp(boardtemp);\r\n		// \r\n		best_value = -alpha_beta(-beta, -alpha, depth+1, 1);\r\n		// \r\n		unmake_move(boardtemp);\r\n	}\r\n	// \r\n	return best_value;\r\n}\r\n\r\nint main()\r\n{\r\n    int Total = 0;\r\n    for(int i(0); i < 8; i++)                              // \r\n        for(int j(0); j < 8; j++)\r\n            {\r\n                scanf(\"%d\", &board[i][j]);\r\n                if(board[i][j] != 0)Total++;\r\n            }\r\n    CopyBoard();\r\n    int xans(0),yans(0),flag(1),bestvalue(-100000),depth(1),value(-100000);\r\n	\r\n    for(int i(0); i < 8; i++)\r\n        for(int j(0); j < 8; j++)\r\n                if(Legal(i, j, flag))\r\n                {\r\n                	int boardtemp[8][8] = {{0}};\r\n                	make_move(i,j,flag,boardtemp);\r\n                	value =  -alpha_beta(-100000,100000,depth+1,0);\r\n                	unmake_move(boardtemp);\r\n                	if(value > bestvalue)\r\n                	{\r\n                		xans = i; yans = j; bestvalue = value ;\r\n                	}\r\n                }\r\n    printf(\"%d %d\",xans,yans);\r\n	// \r\n}','compile correct','g++','othello','2013-06-18 10:22:10','');
INSERT INTO task VALUES (465,'dane','	#include <stdio.h>\r\n#define BLACK 1\r\n#define WHITE -1\r\n#define EMPTY 0\r\n\r\nclass CBwfind \r\n{\r\npublic:\r\n	//\r\n	void SaveBoard(int tb[][8]);\r\n	int outcome;\r\n	int bak;\r\n	//64\r\n	int save[64][8][8];\r\n	bool preview;\r\n	int stepx,stepy;\r\n	//\r\n	bool search(int tb[][8],int);\r\n	int depth;\r\n	int searchend;\r\n	//\r\n	int CountNum();\r\n	int CountWhite();\r\n	int CountBlack();\r\n	void select(int);\r\n	void newboard(int tb[][8],int,int,int);\r\n	bool decide(int,int,int);\r\n	CBwfind();\r\n	int board[8][8];\r\n	virtual ~CBwfind();\r\n	int ComChoice,ManChoice;\r\n    \r\nprotected:\r\n	\r\nprivate:\r\n	//\r\n	void Corner(int tb[][8],int i,int j,int &value);\r\n	void LineSense(int tb[][8],int chessx,int chessy,int &value);\r\n	int Mobility(int tb[][8],int flag);\r\n	void CornerSense(int tb[][8],int &);\r\n	int valuefirst(int tb[][8]);\r\n	int findfirst(int tb[][8],int &,int &, int);\r\n	//\r\n	int white(int tb[][8]);\r\n	int black(int tb[][8]);\r\n	int Total(int tb[][8]);\r\n	bool judge(int tb[][8],int chessx,int chessy,int flag);\r\n	int findlast(int tb[][8], int &,int &,int);\r\n};\r\n\r\n//////////////////////////////////////////////////////////////////////\r\n\r\nCBwfind::CBwfind()\r\n{\r\n	int i,j;	\r\n	stepx=-1;\r\n	stepy=-1;\r\n	depth=6;\r\n	searchend=51;\r\n	preview=false;\r\n	outcome=0;\r\n\r\n	for(i=0;i<8;i++) for(j=0;j<8;j++)\r\n		board[i][j]=EMPTY;\r\n\r\n	board[3][3]=WHITE;\r\n	board[4][4]=WHITE;\r\n	board[3][4]=BLACK;\r\n	board[4][3]=BLACK;\r\n}\r\n\r\nCBwfind::~CBwfind()\r\n{\r\n\r\n}\r\n\r\n//\r\nbool CBwfind::decide(int chessx, int chessy, int flag)\r\n{\r\n	//\r\n	if(chessx>7||chessx<0||chessy>7||chessy<0)\r\n		return false;\r\n	if(board[chessx][chessy]==0)\r\n		return judge(board,chessx,chessy,flag);\r\n	else \r\n		return false;\r\n}\r\n\r\n//\r\nbool CBwfind::judge(int tb[][8],int chessx, int chessy, int flag)\r\n{\r\n	int x=chessx,y=chessy;\r\n	if(tb[x][y]!=0) return false;\r\n	//\r\n	if(x>=2&&y>=2)\r\n		if(tb[x-1][y-1]+flag==0){\r\n			x=x-2;\r\n			y=y-2;\r\n			while(x>=0&&y>=0){\r\n				if(tb[x][y]==flag) \r\n					return true;\r\n				else if(tb[x][y]==-flag)\r\n				{\r\n					x--;\r\n					y--;\r\n				}\r\n				else {x=-1;y=-1;}\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(x>=2)\r\n		if(tb[x-1][y]+flag==0){\r\n			x=x-2;\r\n			while(x>=0){\r\n				if(tb[x][y]==flag) \r\n					return true;\r\n				else if(tb[x][y]==-flag) \r\n					x--;\r\n				else\r\n				{\r\n					x=-1;\r\n				}\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(x>=2&&y<=5)\r\n		if(tb[x-1][y+1]+flag==0){\r\n			x=x-2;y=y+2;\r\n			while(x>=0&&y<=7){\r\n				if(tb[x][y]==flag) return true;\r\n				else if(tb[x][y]==-flag)\r\n				{\r\n					x--;\r\n					y++;\r\n				}\r\n				else {x=-1;}\r\n				//x--;y++;\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(y<=5)\r\n		if(tb[x][y+1]+flag==0){\r\n			y=y+2;\r\n			while(y<=7){\r\n				if(tb[x][y]==flag) return true;\r\n				else if(tb[x][y]==-flag){y++;}\r\n				else {y=8;}\r\n				//y++;\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(x<=5&&y<=5)\r\n		if(tb[x+1][y+1]+flag==0){\r\n			x=x+2;y=y+2;\r\n			while(x<=7&&y<=7){\r\n				if(tb[x][y]==flag) return true;\r\n				else if(tb[x][y]==-flag){x++;y++;}\r\n				else {x=8;y=8;}\r\n				//x++;y++;\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(x<=5)\r\n		if(tb[x+1][y]+flag==0){\r\n			x=x+2;\r\n			while(x<=7){\r\n				if(tb[x][y]==flag) return true;\r\n				else if(tb[x][y]==-flag){x++;}\r\n				else {x=8;}\r\n				//x++;\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(x<=5&&y>=2)\r\n		if(tb[x+1][y-1]+flag==0){\r\n			x=x+2;y=y-2;\r\n			while(x<=7&&y>=0){\r\n				if(tb[x][y]==flag) return true;\r\n				else if(tb[x][y]==-flag){x++;y--;}\r\n				else {y=-1;}\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(y>=2)\r\n		if(tb[x][y-1]+flag==0){\r\n			y=y-2;\r\n			while(y>=0){\r\n				if(tb[x][y]==flag) return true;\r\n				else if(tb[x][y]==-flag){y--;}\r\n				else {y=-1;}\r\n			}\r\n		}\r\n	return false;\r\n			\r\n}\r\n\r\n\r\nvoid CBwfind::select(int flag)\r\n{\r\n	int step,i,j,cut=1000000,tf=flag;\r\n	int tb[8][8];\r\n	for(i=0;i<8;i++)for(j=0;j<8;j++) tb[i][j]=board[i][j];\r\n	step=CountNum();\r\n	//\r\n	if(step<searchend){\r\n		int ss=0;\r\n		findfirst(tb,ss,tf,cut);\r\n	}\r\n	//\r\n	else if(step>=searchend){\r\n		preview=true;\r\n		outcome=findlast(tb,step,tf,cut);\r\n	}\r\n}\r\n\r\nint CBwfind::CountBlack()\r\n{\r\n	int CB=0;\r\n	for(int i=0;i<8;i++)\r\n		for(int j=0;j<8;j++)\r\n			if(board[i][j]== BLACK) CB++;\r\n	return CB;\r\n}\r\n\r\nint CBwfind::CountWhite()\r\n{\r\n	int WB=0;\r\n	for(int i=0;i<8;i++)\r\n		for(int j=0;j<8;j++)\r\n			if(board[i][j]== WHITE) WB++;\r\n	return WB;\r\n}\r\n\r\n\r\n\r\nint CBwfind::CountNum()\r\n{\r\n	int Number=0,i,j;\r\n	for(i=0;i<8;i++)for(j=0;j<8;j++)\r\n		if(board[i][j]!=0) Number++;\r\n	return Number;\r\n}\r\n\r\n\r\n\r\n\r\nint CBwfind::Total(int tb[][8])\r\n{\r\n	int Num=0,i,j;\r\n	for(i=0;i<8;i++)\r\n		for(j=0;j<8;j++)\r\n			if(tb[i][j]==0) Num++;\r\n	return Num;\r\n}\r\n\r\nint CBwfind::black(int tb[][8] )\r\n{\r\n	int Bn=0,i,j;\r\n	for(i=0;i<8;i++)\r\n		for(j=0;j<8;j++)\r\n			if(tb[i][j]-1==0) Bn++;\r\n	return Bn;\r\n}\r\n\r\nint CBwfind::white(int tb[][8] )\r\n{\r\n	int Wn=0,i,j;\r\n		for(i=0;i<8;i++)\r\n		for(j=0;j<8;j++)\r\n			if(tb[i][j]==-1) Wn++;\r\n	return Wn;\r\n}\r\n\r\n\r\n\r\nbool CBwfind::search(int tb[][8] , int flag)\r\n{\r\n	int i,j;\r\n	for(i=0;i<8;i++)for(j=0;j<8;j++)\r\n		if(judge(tb,i,j,flag)) return true;\r\n	return false;\r\n}\r\n\r\nint CBwfind::findfirst(int tb[][8] , int &step, int &flag, int cut)\r\n{\r\n	int value=0,max=-100000,min=100000,k=0,i,j;\r\n	int temp[8][8];\r\n	if(step==depth){\r\n		return valuefirst(tb);\r\n	}\r\n	for(i=0;i<8;i++)for(j=0;j<8;j++) temp[i][j]=tb[i][j];\r\n	for(i=0;i<8;i++)for(j=0;j<8;j++){\r\n		if(judge(tb,i,j,flag)){\r\n			int ii,jj;\r\n			value=0;\r\n			k=1;//\r\n			newboard(tb,i,j,flag);\r\n			flag=-flag;\r\n			step++;\r\n			if(-flag==ComChoice){\r\n				LineSense(tb,i,j,value);\r\n				Corner(tb,i,j,value);\r\n				value+=findfirst(tb,step,flag,max);\r\n			}\r\n			if(-flag==ManChoice){\r\n				Corner(tb,i,j,value);\r\n				LineSense(tb,i,j,value);\r\n				value+=findfirst(tb,step,flag,min);\r\n			}\r\n			step--;\r\n			flag=-flag;\r\n			//\r\n			for(ii=0;ii<8;ii++)\r\n				for(jj=0;jj<8;jj++) \r\n					tb[ii][jj]=temp[ii][jj];\r\n			if(flag-ManChoice==0&&value<cut) \r\n				return value;\r\n			if(flag-ComChoice==0&&value>cut) \r\n				return value;\r\n			if(flag-ManChoice==0){\r\n				if(value<min){\r\n					min=value;\r\n				}\r\n			}\r\n			if(flag-ComChoice==0){\r\n				if(value>max){\r\n					max=value;\r\n					if(step==0){\r\n						stepx=i;\r\n						stepy=j;\r\n					}\r\n				}\r\n			}\r\n		}//if\r\n	}//for\r\n	//\r\n	if(k==0){\r\n		flag=-flag;\r\n		if(search(tb,flag)){\r\n			value=findfirst(tb,step,flag,cut);\r\n			flag=-flag;\r\n			return value;\r\n		}\r\n		else{\r\n			flag=-flag;\r\n			return valuefirst(tb);\r\n		}\r\n	}\r\n	//\r\n	else{\r\n		if(flag-ManChoice==0) return min;\r\n		else if(flag-ComChoice==0){\r\n			//if\r\n			return max;\r\n		}//if\r\n	}//else\r\n}\r\n\r\nint CBwfind::valuefirst(int tb[][8] )\r\n{\r\n	int flag,minus,corner=0,v,ComMobil,ManMobil,DiffMobil,Num,squre;\r\n	int danger;\r\n	flag=ComChoice;\r\n	ComMobil=Mobility(tb,ComChoice);\r\n	ManMobil=Mobility(tb,ManChoice);\r\n	//DiffMobil=ComMobil*ComMobil-ManMobil*ManMobil;\r\n	//a\r\n	DiffMobil=ComMobil-ManMobil;\r\n	//b\r\n	Num=Total(tb);\r\n	if(flag==1){\r\n		minus=white(tb)-black(tb);\r\n		if(minus>=0) squre=minus*minus;\r\n		else squre=-minus*minus;\r\n		danger=black(tb);\r\n	}\r\n	if(flag==-1){\r\n		minus=black(tb)-white(tb);\r\n		if(minus>=0) squre=minus*minus;\r\n		else squre=-minus*minus;\r\n		danger=white(tb);\r\n	}\r\n	\r\n	if(Num<25){\r\n		v=minus+2*DiffMobil;\r\n	}\r\n	else{\r\n		v=minus+3*DiffMobil;\r\n	}\r\n	if(danger==0) v=-10000;\r\n	return v;\r\n}\r\n\r\nint CBwfind::findlast(int tb[][8], int &step, int &flag, int cut)\r\n{\r\n	int value=0,max=-100000,min=100000,k=0,i,j;\r\n	int temp[8][8];\r\n	if(step==64){\r\n		if(ComChoice==1) return(black(tb)-white(tb));\r\n		else return(white(tb)-black(tb));\r\n	}\r\n	for(i=0;i<8;i++)for(j=0;j<8;j++) temp[i][j]=tb[i][j];\r\n	for(i=0;i<8;i++)for(j=0;j<8;j++){\r\n		if(judge(tb,i,j,flag)){\r\n			int ii,jj;\r\n			k=1;//\r\n			newboard(tb,i,j,flag);\r\n			flag=-flag;\r\n			step++;\r\n			if(-flag==ComChoice){\r\n				value=findlast(tb,step,flag,max);\r\n			}\r\n			if(-flag==ManChoice){\r\n				value=findlast(tb,step,flag,min);\r\n			}\r\n			step--;\r\n			flag=-flag;\r\n			//\r\n			for(ii=0;ii<8;ii++)for(jj=0;jj<8;jj++) tb[ii][jj]=temp[ii][jj];\r\n			if(flag-ManChoice==0&&value<cut) return value;\r\n			if(flag-ComChoice==0&&value>cut) return value;\r\n			if(flag-ManChoice==0){\r\n				if(value<min){\r\n					min=value;\r\n				}\r\n			}\r\n			if(flag-ComChoice==0){\r\n				if(value>max){\r\n					max=value;\r\n					if(step==CountNum()){\r\n						stepx=i;\r\n						stepy=j;\r\n					}\r\n				}\r\n			}\r\n		}//if\r\n	}//for\r\n	//\r\n	if(k==0){\r\n		flag=-flag;\r\n		if(search(tb,flag)){\r\n			value=findlast(tb,step,flag,cut);\r\n			flag=-flag;\r\n			return value;\r\n		}\r\n		else{\r\n			flag=-flag;\r\n			if(ComChoice==1) return(black(tb)-white(tb));\r\n			else return(white(tb)-black(tb));\r\n		}\r\n	}\r\n	//\r\n	else{\r\n		if(flag-ManChoice==0) return min;\r\n		if(flag-ComChoice==0){\r\n			return max;\r\n		}\r\n\r\n	}\r\n}\r\nvoid CBwfind::newboard(int tb[][8],int chessx, int chessy, int flag)\r\n{\r\n	int x=chessx,y=chessy;\r\n	//\r\n	tb[x][y]=flag;\r\n	if(x>=2&&y>=2)\r\n		if(tb[x-1][y-1]+flag==0){\r\n			x=x-2;\r\n			y=y-2;\r\n			while(x>=0&&y>=0){\r\n				if(tb[x][y]==flag){\r\n					for(int i=x,j=y;i!=chessx&&j!=chessy;i++,j++)\r\n						tb[i][j]=flag;\r\n					x=0;y=0;\r\n				}\r\n				else if(tb[x][y]==0){x=-1;y=-1;}\r\n				{x--;y--;}\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(x>=2)\r\n		if(tb[x-1][y]+flag==0){\r\n			x=x-2;\r\n			while(x>=0){\r\n				if(tb[x][y]==flag){\r\n					for(int i=x;i!=chessx;i++)\r\n						tb[i][chessy]=flag;\r\n					x=0;\r\n				} \r\n				else if(tb[x][y]==0){x=-1;y=-1;}\r\n				x--;\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(x>=2&&y<=5)\r\n		if(tb[x-1][y+1]+flag==0){\r\n			x=x-2;y=y+2;\r\n			while(x>=0&&y<=7){\r\n				if(tb[x][y]==flag){\r\n					for(int i=x,j=y;i!=chessx&&j!=chessy;i++,j--)\r\n						tb[i][j]=flag;\r\n					x=0;y=7;\r\n				} \r\n				else if(tb[x][y]==0){x=-1;}\r\n				{x--;y++;}\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(y<=5)\r\n		if(tb[x][y+1]+flag==0){\r\n			y=y+2;\r\n			while(y<=7){\r\n				if(tb[x][y]==flag){\r\n					for(int j=y;j!=chessy;j--)\r\n						tb[chessx][j]=flag;\r\n					y=7;\r\n				}\r\n				else if(tb[x][y]==0){y=8;}\r\n				y++;\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(x<=5&&y<=5)\r\n		if(tb[x+1][y+1]+flag==0){\r\n			x=x+2;y=y+2;\r\n			while(x<=7&&y<=7){\r\n				if(tb[x][y]==flag){\r\n					for(int i=x,j=y;i!=chessx&&j!=chessy;i--,j--)\r\n						tb[i][j]=flag;\r\n					x=7;y=7;\r\n				}\r\n				\r\n				else if(tb[x][y]==0){x=8;y=8;}\r\n				{x++;y++;}\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(x<=5)\r\n		if(tb[x+1][y]+flag==0){\r\n			x=x+2;\r\n			while(x<=7){\r\n				if(tb[x][y]==flag){\r\n					for(int i=x;i!=chessx;i--)\r\n						tb[i][chessy]=flag;\r\n					x=7;\r\n				}\r\n				else if(tb[x][y]==0){x=8;}\r\n				x++;\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(x<=5&&y>=2)\r\n		if(tb[x+1][y-1]+flag==0){\r\n			x=x+2;y=y-2;\r\n			while(x<=7&&y>=0){\r\n				if(tb[x][y]==flag){\r\n					for(int i=x,j=y;i!=chessx&&j!=chessy;i--,j++)\r\n						tb[i][j]=flag;\r\n					x=7;y=0;\r\n				}\r\n				else if(tb[x][y]==0){y=-1;}\r\n				{x++;y--;}\r\n			}\r\n		}\r\n	//\r\n	x=chessx;\r\n	y=chessy;\r\n	if(y>=2)\r\n		if(tb[x][y-1]+flag==0){\r\n			y=y-2;\r\n			while(y>=0){\r\n				if(tb[x][y]==flag){\r\n					for(int j=y;j!=chessy;j++)\r\n						tb[chessx][j]=flag;\r\n					y=0;\r\n				}\r\n				else if(tb[x][y]==0){y=-1;}\r\n				y--;\r\n			}\r\n		}\r\n}\r\n\r\n\r\n\r\nvoid CBwfind::CornerSense(int tb[][8], int &value)\r\n{	\r\n	int flag,corner=0;\r\n	//int i,j;\r\n	flag=ComChoice;\r\n	\r\n	if(tb[0][0]-flag!=0){\r\n		if((tb[1][0]-flag==0)||(tb[1][1]-flag==0)||(tb[0][1]-flag==0))\r\n			corner-=1000;\r\n	}\r\n	else if(tb[0][0]==flag)corner+=1000;\r\n	if(tb[0][7]-flag!=0){\r\n		if((tb[0][6]-flag==0)||(tb[1][7]-flag==0)||(tb[1][6]-flag==0))\r\n			corner-=1000;\r\n	}\r\n	else if(tb[0][0]==flag)corner+=1000;\r\n	if(tb[7][0]-flag!=0){\r\n		if((tb[6][0]-flag==0)||(tb[7][1]-flag==0)||(tb[6][1]-flag==0))\r\n			corner-=1000;\r\n	}\r\n	else if(tb[0][0]==flag)corner+=1000;\r\n	if(tb[7][7]-flag!=0){\r\n		if((tb[7][6]-flag==0)||(tb[6][7]-flag==0)||(tb[6][6]-flag==0))\r\n			corner-=1000;\r\n	}\r\n	else if(tb[0][0]==flag)corner+=1000;\r\n	value+=corner;\r\n}\r\n\r\n\r\n\r\n\r\n\r\nint CBwfind::Mobility(int tb[][8], int flag)\r\n{\r\n	int move=0,i,j;\r\n	for(i=0;i<8;i++)for(j=0;j<8;j++){\r\n		if(judge(tb,i,j,flag)) move++;\r\n	}\r\n	return move;\r\n}\r\n\r\nvoid CBwfind::LineSense(int tb[][8], int chessx, int chessy, int &value)\r\n{\r\n	int line=0;\r\n	int i,j;\r\n	if(tb[0][0]==ManChoice){\r\n		if(chessx==0){\r\n			j=0;\r\n			while(tb[0][j]==ManChoice) j++;\r\n			if(tb[0][j]==ComChoice){\r\n				while(j<8&&tb[0][j]==ComChoice) j++;\r\n				if(j<8&&tb[0][j]==0) line-=1000;\r\n			}\r\n		}\r\n		if(chessy=0){\r\n			i=0;\r\n			while(tb[i][0]==ManChoice) i++;\r\n			if(tb[i][0]==ComChoice){\r\n				while(i<8&&tb[i][0]==ComChoice) i++;\r\n				if(i<8&&tb[i][0]==0) line-=1000;\r\n			}\r\n		}\r\n	}\r\n	if(tb[0][7]==ManChoice){\r\n		if(chessx==0){\r\n			j=7;\r\n			while(tb[0][j]==ManChoice) j--;\r\n			if(tb[0][j]==ComChoice){\r\n				while(j>=0&&tb[0][j]==ComChoice) j--;\r\n				if(j>=0&&tb[0][j]==0) line-=1000;\r\n			}\r\n		}\r\n		if(chessy=7){\r\n			i=0;\r\n			while(tb[i][7]==ManChoice) i++;\r\n			if(tb[i][7]==ComChoice){\r\n				while(i<8&&tb[i][7]==ComChoice) i++;\r\n				if(i<8&&tb[i][7]==0) line-=1000;\r\n			}\r\n		}\r\n	}\r\n	if(tb[7][0]==ManChoice){\r\n		if(chessx==7){\r\n			j=0;\r\n			while(tb[0][j]==ManChoice) j++;\r\n			if(tb[0][j]==ComChoice){\r\n				while(j<8&&tb[0][j]==ComChoice) j++;\r\n				if(j<8&&tb[0][j]==0) line-=1000;\r\n			}\r\n		}\r\n		if(chessy=0){\r\n			i=7;\r\n			while(tb[i][0]==ManChoice) i--;\r\n			if(tb[i][0]==ComChoice){\r\n				while(i>=0&&tb[i][0]==ComChoice) i--;\r\n				if(i>=0&&tb[i][0]==0) line-=1000;\r\n			}\r\n		}\r\n	}\r\n	if(tb[7][7]==ManChoice){\r\n		if(chessx==7){\r\n			j=7;\r\n			while(tb[0][j]==ManChoice) j--;\r\n			if(tb[0][j]==ComChoice){\r\n				while(j>=0&&tb[7][j]==ComChoice) j--;\r\n				if(j>=0&&tb[7][j]==0) line-=1000;\r\n			}\r\n		}\r\n		if(chessy=7){\r\n			i=7;\r\n			while(tb[i][7]==ManChoice) i--;\r\n			if(tb[i][7]==ComChoice){\r\n				while(i<8&&tb[i][7]==ComChoice) i--;\r\n				if(i>=0&&tb[i][7]==0) line-=1000;\r\n			}\r\n		}\r\n	}\r\n	value+=line;\r\n\r\n}\r\n\r\nvoid CBwfind::SaveBoard(int tb[][8])\r\n{\r\n	int i,j;\r\n	bak++;\r\n	for(i=0;i<8;i++)\r\n		for(j=0;j<8;j++) \r\n			save[bak][i][j]=tb[i][j];\r\n}\r\n\r\n\r\nvoid CBwfind::Corner(int tb[][8], int chessx, int chessy, int &value)\r\n{\r\n	int flag=ComChoice;\r\n	int corner=0;\r\n	int i=chessx,j=chessy;\r\n	if(i==0&&j==0&&tb[0][0]==flag) value+=2000;//return;\r\n	if(i==0&&j==7&&tb[0][7]==flag) value+=2000;//return;\r\n	if(i==7&&j==0&&tb[7][0]==flag) value+=2000;//return;\r\n	if(i==7&&j==7&&tb[7][7]==flag) value+=2000;//return;\r\n	if(tb[0][0]==0){\r\n		//if(i==0&&tb[0][1]==flag){\r\n		if(tb[0][1]==flag){\r\n			j=1;\r\n			while(j<8&&tb[0][j]==flag) j++;\r\n			if(j<8&&tb[0][j]==-flag) value-=5000;\r\n		}\r\n		//if(j==0&&tb[1][0]==flag){\r\n		if(tb[1][0]==flag){\r\n			i=1;\r\n			while(i<8&&tb[i][0]==flag) i++;\r\n			if(i<8&&tb[i][0]==-flag) value-=5000;\r\n		}\r\n	}\r\n	i=chessx;j=chessy;\r\n	if(tb[0][7]==0){\r\n		//if(i==0&&tb[0][6]==flag){\r\n		if(tb[0][6]==flag){\r\n			j=6;\r\n			while(j>=0&&tb[0][j]==flag) j--;\r\n			if(j>=0&&tb[0][j]==-flag) value-=5000;\r\n		}\r\n		//if(j==7&&tb[1][7]==flag){\r\n		if(tb[1][7]==flag){\r\n			i=1;\r\n			while(i<8&&tb[i][7]==flag) i++;\r\n			if(i<8&&tb[i][7]==-flag) value-=5000;\r\n		}\r\n	}\r\n	i=chessx;j=chessy;\r\n	if(tb[7][0]==0){\r\n		//if(i==7&&tb[7][1]==flag){\r\n		if(tb[7][1]==flag){\r\n			j=1;\r\n			while(j<8&&tb[7][j]==flag) j++;\r\n			if(j<8&&tb[7][j]==-flag) value-=5000;\r\n		}\r\n		//if(j==0&&tb[6][0]==flag){\r\n		if(tb[6][0]==flag){\r\n			i=6;\r\n			while(i>=0&&tb[i][0]==flag) i--;\r\n			if(i>=0&&tb[i][0]==-flag) value-=5000;\r\n		}\r\n	}\r\n	i=chessx;j=chessy;\r\n	if(tb[7][7]==0){\r\n		//if(i==7&&tb[7][6]==flag){\r\n		if(tb[7][6]==flag){\r\n			j=6;\r\n			while(j>=0&&tb[7][j]==flag) j--;\r\n			if(j>=0&&tb[7][j]==-flag) value-=5000;\r\n		}\r\n		//if(j==7&&tb[6][7]==flag){\r\n		if(tb[6][7]==flag){\r\n			i=6;\r\n			while(i>=0&&tb[i][7]==flag) i--;\r\n			if(i>=0&&tb[i][7]==-flag) value-=5000;\r\n		}\r\n	}\r\n	//\r\n	i=chessx;j=chessy;\r\n	if(i==1&&j==1&&tb[0][0]-flag!=0&&tb[i][j]==flag)\r\n		value-=2000;\r\n	if(i==1&&j==6&&tb[0][7]-flag!=0&&tb[i][j]==flag)\r\n		value-=2000;\r\n	if(i==6&&j==1&&tb[7][0]-flag!=0&&tb[i][j]==flag)\r\n		value-=2000;\r\n	if(i==6&&j==6&&tb[7][7]-flag!=0&&tb[i][j]==flag)\r\n		value-=2000;\r\n}\r\n\r\nint main()\r\n{\r\n	CBwfind m_find;\r\n	m_find.depth=6;\r\n	m_find.preview=false;\r\n	m_find.bak=0;\r\n\r\n	m_find.ComChoice=BLACK;\r\n	m_find.ManChoice=WHITE;\r\n	int ComChoice = BLACK;\r\n	int ManChoice=WHITE;;\r\n\r\n	int tb[8][8];\r\n	int i,j;\r\n	for(i=0;i<8;i++)\r\n		for( j=0;j<8;j++)\r\n			scanf(\"%d\",&tb[i][j]);\r\n	for(i=0;i<8;i++)\r\n		for(j=0;j<8;j++) \r\n			if(tb[i][j] == 2)\r\n			{\r\n				m_find.board[i][j] = -1;\r\n				tb[i][j] = -1;\r\n			}\r\n			else\r\n				m_find.board[i][j] = tb[i][j];\r\n	int x,y;\r\n	if(m_find.search(tb, ComChoice))\r\n	{\r\n		m_find.select(ComChoice);\r\n		x=m_find.stepx;\r\n		y=m_find.stepy;\r\n		m_find.newboard(tb,x,y,ComChoice);\r\n\r\n	}\r\n	printf(\"%d %d\",x,y);\r\n	return 0;\r\n}\r\n','compile correct','g++','othello','2013-06-21 10:04:10','');
INSERT INTO task VALUES (466,'kaikitest3','#include<cstdio>\r\n#include<iostream>\r\nusing namespace std;\r\n\r\n//boardboard2\r\n\r\n\r\nint board[8][8] = {{0}} , board2[8][8] = {{0}} ;                 //board2board\r\nint DirectNumTemp = 0;                 // xy\r\nconst int DEPTH = 7;                   // \r\nconst int First =40 ;\r\n\r\nvoid Print()\r\n{\r\n	for(int i(0); i < 8; i++)\r\n	{\r\n		for(int j(0); j < 8; j++)\r\n    	{		\r\n    		printf(\"%d\",board2[i][j]);\r\n 		}\r\n		printf(\"\\n\");\r\n	}\r\n	printf(\"\\n\");\r\n}\r\n\r\n//boardboard2\r\nvoid CopyBoard()                                                 \r\n{\r\n    for(int i(0); i < 8; i++)\r\n        for(int j(0); j < 8; j++)\r\n            board2[i][j] = board[i][j];\r\n}\r\n\r\nvoid CopyToBoardTemp(int boardtemp[8][8])                                                 \r\n{\r\n    for(int i(0); i < 8; i++)\r\n        for(int j(0); j < 8; j++)\r\n            boardtemp[i][j] = board2[i][j];\r\n}\r\n\r\n//(x,y)i,j \r\nbool LegalDirect(int x, int y, int i, int j, int flag , int &DirectNumTemp)             \r\n{\r\n    // DirectNumTemp?\r\n    x += i;\r\n    y += j;\r\n\r\n    if (x < 0 || x > 7 || y < 0 || y > 7)                        // \r\n        return 0;\r\n\r\n    int flagtemp;\r\n    if(board2[x][y] == 2)flagtemp = 0;                         //\r\n    else if(board2[x][y] == 1)flagtemp = 1;\r\n    else return 0;										// ,\r\n\r\n    if(flag == flagtemp && DirectNumTemp != 0)return 1;    //\r\n\r\n    else if (flagtemp != flag )\r\n        {\r\n            DirectNumTemp ++;              //\r\n            /* (x,y),\r\n            *  ,\r\n            */\r\n            return LegalDirect(x, y, i, j, flag, DirectNumTemp);\r\n        }\r\n    return 0;\r\n}\r\n\r\n//(x,y)(i,j)\r\nbool Legal(int x, int y, int flag)                                \r\n{\r\n    //DirectNum[i][j];     \r\n    if (board2[x][y] != 0)                              // \r\n        return 0;\r\n    int i, j;\r\n\r\n    for (i = -1; i <= 1; i++)                          // (x,y)\r\n        {\r\n            for (j = -1; j <= 1; j++)\r\n                {\r\n                    if (i == 0 && j == 0)                      // (x,y)\r\n                        {\r\n                            continue;\r\n                        }\r\n                    if (LegalDirect(x, y, i, j, flag, DirectNumTemp))\r\n                        {\r\n                        	DirectNumTemp = 0;                          //\r\n                            return 1;\r\n                        }\r\n                    DirectNumTemp = 0;                          //\r\n                }\r\n        }\r\n    return 0;\r\n}\r\n\r\n// xyboard1 \r\nvoid make_move(int x , int y, int flag,int boardtemp[][8])                           \r\n{\r\n	CopyToBoardTemp(boardtemp);\r\n    int i, j,temp1= ((flag==0) ?2:1 );\r\n    board2[x][y] = temp1;\r\n    for (i = -1; i <= 1; i++)                          // (x,y)\r\n        {\r\n            for (j = -1; j <= 1; j++)\r\n                {\r\n                    if (i == 0 && j == 0)                      // (x,y)\r\n                        continue;\r\n                    if ( LegalDirect(x, y, i, j, flag, DirectNumTemp)) //\r\n					{\r\n						for(int k(0); k < DirectNumTemp + 1; k++)\r\n                            board2[x + i * k][y + j * k] = temp1 ; // \r\n					}           \r\n                    DirectNumTemp = 0;\r\n                }\r\n        }\r\n}\r\n\r\n\r\nvoid unmake_move(int boardtemp[8][8])                                                 \r\n{\r\n    for(int i(0); i < 8; i++)\r\n        for(int j(0); j < 8; j++)\r\n            board2[i][j] = boardtemp[i][j];\r\n}\r\n\r\n\r\nbool isConner(int x ,int y)                           // \r\n{\r\n	if(x==0&&y==0)return 1;\r\n	else if(x==0&&y==7)return 1;\r\n	else if(x==7&&y==0)return 1;\r\n	else if(x==7&&y==7)return 1;\r\n	return 0; \r\n}\r\n\r\nbool is1BesideConner(int x ,int y)                   //412 \r\n{\r\n	if(x==0||x==7)\r\n		if(y==1||y==6)return 1;\r\n	if(x==1||x==6)\r\n		if(y==0||y==1||y==6||y==7)return 1;\r\n	return 0;\r\n}\r\n\r\nbool is2BesideConner(int x ,int y)                   //416 \r\n{\r\n	if(y==5||y==2)\r\n		if(x==1||x==0||x==6||x==7)return 1;\r\n	if(x==5||x==2)\r\n			if(y==1||y==0||y==6||y==7)return 1;\r\n	if((x==2&&y==2 )||( x==2&&y==5 )||( x==5&&y==5 )|| (x==5&&y==2) )return 1;\r\n	\r\n	return 0;\r\n} \r\n\r\nbool isSide(int x ,int y)\r\n{\r\n	if(x == 0 || x == 7)\r\n		if(y == 3 || y == 4)return 1;\r\n	if(y == 0 || y == 7)\r\n		if(x == 3 || x == 4)return 1;\r\n	return 0;\r\n}\r\n\r\n\r\n/*int CanGoNum (int flag)                     //xy \r\n{\r\n	int w=0;\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0); j<8; j++)\r\n			if(Legal(i,j,flag))w++;                           \r\n	return w;\r\n}*/\r\n\r\n\r\nint evaluation(int board2[8][8])\r\n{\r\n	int value(0), Total(0), White(0), Black(0), Conner(0);\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0);j<8; j++)\r\n		{\r\n			if(board2[i][j]==2)White++;\r\n			else if(board2[i][j]==1)Black++;\r\n		}\r\n	Total = Black + White ;\r\n	if(Black < 6)value = -10000;\r\n	for(int i(0); i<8; i++)\r\n	for(int j(0); j<8; j++)\r\n	{\r\n		if(board2[i][j]==0)continue;\r\n		if(isConner(i,j))\r\n		{\r\n			if(board2[i][j]==1)value+=500;\r\n			else value-=500;\r\n			Conner++;\r\n		}\r\n		if(is1BesideConner(i,j))\r\n		{\r\n			if(board2[i][j]==1)value-=300;\r\n			else value+=300;\r\n		}\r\n		if(is2BesideConner(i,j))\r\n		{\r\n			if(board2[i][j]==1)value+=30;\r\n			else value-=30;\r\n		}\r\n		if(isSide(i,j))\r\n			if(board2[i][j]==2)value+=30;\r\n			else value-=10;\r\n	}\r\n	if(Conner>1)\r\n	{\r\n		value+=Black*10;\r\n		value-=White*10;\r\n	}\r\n	else if(Total > First)\r\n	{\r\n		value-=Black*5;\r\n		value+=White*5;\r\n	}\r\n//	cout << \"evaluation\" << value << endl;\r\n	return value;\r\n}\r\n\r\n\r\nint get_exact()\r\n{\r\n	int value(0), White(0), Black(0);\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0);j<8; j++)\r\n		{\r\n			if(board2[i][j]==2)White++;\r\n			else if(board2[i][j]==1)Black++;\r\n		}\r\n	if(White>Black)value = -1000;\r\n	else value = 1000;\r\n//	cout << \"get_exact\" << value << endl;\r\n	return value;\r\n}\r\n\r\nint alpha_beta(int alpha, int beta, int depth, int pass)\r\n{\r\n	int boardtemp[8][8] = {{0}};\r\n	int flag(0);\r\n	bool key (1);\r\n	if(depth % 2 == 1)flag = 1;\r\n	// \r\n	int best_value = -10000000;\r\n	// \r\n	if (depth == DEPTH) {\r\n		// \r\n		return evaluation(board2);\r\n	}\r\n	// \r\n	for(int i(0); i < 8; i++)\r\n        for(int j(0); j < 8; j++)\r\n                if(Legal(i, j, flag))\r\n                {\r\n                    make_move(i,j,flag,boardtemp);\r\n                    // \r\n					int value = -alpha_beta(-beta, -alpha, depth+1, 0);\r\n					// \r\n					unmake_move(boardtemp);\r\n					// \r\n					if (value >= beta) \r\n					{\r\n					// \r\n					return value;\r\n					}\r\n						// \r\n					if (value > best_value)\r\n					{\r\n						// \r\n						best_value = value;\r\n						// \r\n						if (value > alpha) \r\n						{\r\n							alpha = value;\r\n						}\r\n					}\r\n					key = 0;\r\n				}\r\n	// \r\n	if (key)\r\n	 {\r\n		// \r\n		if (pass) \r\n		{\r\n			// \r\n			return get_exact();\r\n		}\r\n		CopyToBoardTemp(boardtemp);\r\n		// \r\n		best_value = -alpha_beta(-beta, -alpha, depth+1, 1);\r\n		// \r\n		unmake_move(boardtemp);\r\n	}\r\n	// \r\n	return best_value;\r\n}\r\n\r\nint main()\r\n{\r\n    int Total = 0;\r\n    for(int i(0); i < 8; i++)                              // \r\n        for(int j(0); j < 8; j++)\r\n            {\r\n                scanf(\"%d\", &board[i][j]);\r\n                if(board[i][j] != 0)Total++;\r\n            }\r\n    CopyBoard();\r\n    int xans(0),yans(0),flag(1),bestvalue(-100000),depth(1),value(-100000);\r\n	\r\n    for(int i(0); i < 8; i++)\r\n        for(int j(0); j < 8; j++)\r\n                if(Legal(i, j, flag))\r\n                {\r\n                	int boardtemp[8][8] = {{0}};\r\n                	make_move(i,j,flag,boardtemp);\r\n                	value =  -alpha_beta(-100000,100000,depth+1,0);\r\n                	unmake_move(boardtemp);\r\n                	if(value > bestvalue)\r\n                	{\r\n                		xans = i; yans = j; bestvalue = value ;\r\n                	}\r\n                }\r\n    printf(\"%d %d\",xans,yans);\r\n	// \r\n}','compile correct','g++','othello','2013-06-22 15:35:43','');
INSERT INTO task VALUES (508,'sagitrs','#include <stdio.h>\r\n#include <math.h>\r\n#include <stdlib.h>\r\n#include <time.h>\r\n#include <string>\r\n#include <iostream>\r\n#include <vector>\r\nusing namespace std;\r\nint decisionX[8]={-1,-1,0,1,1,1,0,-1};\r\nint decisionY[8]={0,1,1,1,0,-1,-1,-1};\r\nint globalError = 0;\r\ntypedef unsigned int int32;\r\n#define MYMAX 12011031\r\n\r\n#define WHITE 1\r\n#define BLACK 0\r\n#define EXIST 2\r\n\r\n#define	NO_CHESS	0b00\r\n#define	UNDEFINED	0b01\r\n#define BLACK_CHESS	0b10\r\n#define WHITE_CHESS	0b11\r\n\r\n#define STABLE_CHESS	0b100\r\n#define IN_CHESS		0b010\r\n#define OUT_CHESS		0b001\r\n\r\n#define POS(i,j) ((unsigned long long)1<<((8*i)+j))\r\n#define ILLEGAL(x,y) (!(0<=x&&x<8&&0<=y&&y<8))\r\n#define CHESS(k) ((bool)(k&0b10))\r\n#define COLOR(k) ((bool)(k&0b01))\r\n\r\n//#define SHOW_PROCESS 1\r\ntypedef unsigned long long LL;\r\nvoid message(string s){\r\n#ifndef SHOW_PROCESS\r\n		return;\r\n#endif\r\n	cout<<s<<endl;\r\n}\r\nvoid error(string s){\r\n	cout<<\"Error Report From : \"<<s<<endl;\r\n	++globalError;\r\n}\r\nstruct Randomizer{\r\n	Randomizer(){\r\n		srand((unsigned int)time(0));\r\n	}\r\n	int random(int k){\r\n		return rand()%k;\r\n	}\r\n};\r\nRandomizer R;\r\nstruct Pair{\r\n	int x,y;\r\n	Pair(int X=0,int Y=0){\r\n		x=X;y=Y;\r\n	}\r\n	static Pair make(int x,int y){\r\n		Pair t(x,y);\r\n		return t;\r\n	}\r\n	string toString(){\r\n		string s;\r\n		s=\"( \";\r\n		s+=x+49;\r\n		s+=\" , \";\r\n		s+=y+49;\r\n		s+=\" )\";\r\n		return s;\r\n	}\r\n	Pair operator + (Pair b){\r\n		return make(x+b.x,y+b.y);\r\n	}\r\n	Pair&operator +=(Pair b){\r\n		x+=b.x;y+=b.y;\r\n		return *this;\r\n	}\r\n	bool operator ==(Pair b){\r\n		return x==b.x&&y==b.y;\r\n	}\r\n};\r\nostream& operator << (ostream& os, Pair a){\r\n	return os<<a.toString();\r\n}\r\nPair D[8];\r\n\r\nstruct Board{\r\nprivate:\r\n	LL	chessRec,colorRec;\r\n	static const LL 		BLANK = 0x0000000000000000;\r\n//	static const LL DEFAULT_CHESS = 0x0000001818000000;\r\n//	static const LL DEFAULT_COLOR = 0x0000001008000000;\r\n	bool boardcast;\r\n	void setChess(int x, int y, int k){\r\n		if (chess(x,y)!=k) chessRec^=POS(x,y);\r\n	}\r\n	void setColor(int x, int y, int k){\r\n		if (color(x,y)!=k) colorRec^=POS(x,y);\r\n	}\r\n	void setState(int x, int y, int st){\r\n		int oldSt = state(x,y);\r\n		if (oldSt==UNDEFINED) {error(\"setState\");return;}\r\n		setChess(x,y,CHESS(st));\r\n		setColor(x,y,COLOR(st));\r\n		if (state(x,y)!=st) {\r\n			printf(\"%d!=%d, \",state(x,y),st);\r\n			error(\"setState\");\r\n			return;\r\n		}\r\n	}\r\n	void setState(Pair t, int st){\r\n		setState(t.x,t.y,st);\r\n	}\r\n	int reverse(int x, int y){\r\n		if (state(x,y)==UNDEFINED||state(x,y)==NO_CHESS){\r\n			error(\"reverse\");\r\n			return 0;\r\n		}\r\n		setState(x,y,EXIST|(!color(x,y)));\r\n		if (boardcast)\r\n			cout<<\"Reverse : \"<<Pair::make(x,y)<<endl;\r\n		return 1;\r\n	}\r\n	int reverse(Pair t){\r\n		return reverse(t.x,t.y);\r\n	}\r\n	int checkLine(Pair t, bool k, int d){\r\n		if (ILLEGAL(t.x,t.y)) {error(\"checkLine\");return 0;}\r\n		int temp=0;\r\n		for (t+=D[d];!ILLEGAL(t.x,t.y);t+=D[d]){\r\n			if (chess(t)==0) break;\r\n			if (color(t)==k) return temp;\r\n			if (color(t)!=k) ++temp;\r\n		}\r\n		return 0;\r\n	}\r\n	int checkLine(int x, int y, bool k, int d){\r\n		return checkLine(Pair::make(x,y),k,d);\r\n	}\r\n	int reverseLine(Pair t,bool k, int d){//Be careful! Illegal action will be passed.\r\n		for (t+=D[d];1;t+=D[d]){\r\n			if (state(t)==UNDEFINED){\r\n				error(\"reverseLine\");\r\n				message(\"At edge.\");\r\n				return 0;\r\n			}\r\n			if (state(t)==NO_CHESS){\r\n				error(\"reverseLine\");\r\n				message(\"Illegal reverse.\");\r\n				return 0;\r\n			}\r\n			if (state(t)==(EXIST|!k)){\r\n				reverse(t);\r\n				continue;\r\n			}\r\n			if (state(t)==(EXIST| k)) \r\n				return 1;\r\n			error(\"reverseLine\");\r\n			message(\"Unknown error occured.\");\r\n			break;\r\n		}\r\n		return 0;\r\n	}\r\n	int reverseLine(int x, int y, bool k, int d){\r\n		return reverseLine(Pair::make(x,y),k,d);\r\n	}\r\npublic:\r\n	Board (bool toPublic = 0){\r\n		init();\r\n		boardcast = toPublic;\r\n		boardcast = 0;//Stop Boardcasting.\r\n	}\r\n	void clear(){\r\n		chessRec = BLANK;\r\n		colorRec = BLANK;\r\n	}\r\n	void init(){\r\n		clear();\r\n		setState(3,3,WHITE_CHESS);\r\n		setState(3,4,BLACK_CHESS);\r\n		setState(4,3,BLACK_CHESS);\r\n		setState(4,4,WHITE_CHESS);\r\n	}	\r\n	bool chess(int x,int y){\r\n		if (ILLEGAL(x,y)) {error(\"chess\");return 0;}\r\n		return (bool)(chessRec&POS(x,y));\r\n	}\r\n	bool chess(Pair t){\r\n		return chess(t.x,t.y);\r\n	}\r\n	bool color(int x, int y){\r\n		if (ILLEGAL(x,y)) {error(\"color\");return 0;}\r\n		return (bool)(colorRec&POS(x,y));\r\n	}\r\n	bool color(Pair t){\r\n		return color(t.x,t.y);\r\n	}\r\n	int state(int x, int y){\r\n		if (ILLEGAL(x,y)) return UNDEFINED;\r\n		if (chess(x,y)) return EXIST|color(x,y);\r\n		if (!color(x,y)) return NO_CHESS;\r\n		error(\"state\");\r\n		message(\"Undefined state exist.\");\r\n		return UNDEFINED;\r\n	}\r\n	int state(Pair t){\r\n		return state(t.x,t.y);\r\n	}\r\n	int check(int x,int y,bool k){\r\n		if (ILLEGAL(x,y)) return 0;\r\n		if (chess(x,y)) return 0;		\r\n		int total=0;\r\n		for (int l=0;l<8;++l)\r\n			total+=checkLine(x,y,k,l);\r\n		return total;\r\n	}\r\n	int check(Pair t,int k){\r\n		return check(t.x,t.y,k);\r\n	}\r\n	int put(int x,int y,bool k){\r\n		if (ILLEGAL(x,y)) {\r\n			error(\"put : illegal.\");\r\n			cout<<\"Trying to put a \"<<(k?\"white\":\"black\");\r\n			cout<<\" chess at \"<<Pair::make(x,y)<<endl;\r\n			return 0;\r\n		}\r\n		if (chess(x,y)) {\r\n			error(\"put : illegal.(chess alread exist)\");\r\n			cout<<\"Trying to put a \"<<(k?\"white\":\"black\");\r\n			cout<<\" chess at \"<<Pair::make(x,y)<<endl;\r\n			return 0;\r\n		}\r\n		int t=check(x,y,k);\r\n		if (t==0) {\r\n			error(\"put : illegal.(no reversable chess)\");\r\n			cout<<\"Trying to put a \"<<(k?\"white\":\"black\");\r\n			cout<<\" chess at \"<<Pair::make(x,y)<<endl;\r\n			return 0;\r\n		}\r\n		for (int l=0;l<8;++l) \r\n			if (checkLine(x,y,k,l)) reverseLine(x,y,k,l);\r\n		setState(x,y,EXIST|k);\r\n		return t;\r\n	}\r\n	int put(Pair t, bool k){\r\n		return put(t.x,t.y,k);\r\n	}\r\n	static int upDate(int x){\r\n		if (x==0) return NO_CHESS;\r\n		if (x==1) return BLACK_CHESS;\r\n		if (x==2) return WHITE_CHESS;\r\n		return UNDEFINED;\r\n	}\r\n	void read(){\r\n		int x;\r\n		for(int i=0;i<8;++i)\r\n			for(int j=0;j<8;++j){\r\n				scanf(\"%d\",&x);\r\n				setState(i,j,upDate(x));\r\n			}\r\n	}\r\n	string toString(){\r\n#ifndef SHOW_PROCESS\r\n		return \"\";\r\n#endif\r\n		const string whiteChess = \"1 \",blackChess = \"0 \";\r\n		const string noChess = \"_ \", rightLine = \"| \";\r\n		const string top = \"+ 1 2 3 4 5 6 7 8 + \\n\";\r\n		string s=top;\r\n		for (int i=0;i<8;++i){\r\n			s+=i+49;s+=\' \';\r\n			for (int j=0;j<8;++j) \r\n				s+=chess(i,j)?(color(i,j)?whiteChess:blackChess):noChess;	\r\n			s+=i+49;s+=\' \';\r\n			s+=\'\\n\';\r\n		}\r\n		s+=top;\r\n		return s;\r\n	}\r\n	void print(){\r\n		cout<<toString();\r\n	}\r\n/*	int game(){\r\n		for (bool i=0;1;i=!i){\r\n			cout<<toString();\r\n			if (!play(i%2)) return 0;\r\n		}\r\n	}\r\n	int play(int k){\r\n		int x,y,t;\r\n		string s;\r\n		do{\r\n			cin>>x>>y;	\r\n			if (x==0&&y==0) {\r\n				s=\"Game over. Player \";\r\n				s+=k+48;s+=\" resigned.\";\r\n				message(s);return 0;\r\n			}\r\n			t=put(x-1,y-1,k);\r\n		}while(t==0);\r\n		return 1;\r\n	}\r\n	static bool edge(int x, int y){\r\n		return x==0||x==7||y==0||y==7;\r\n	}\r\n	static bool edge(Pair t){\r\n		return edge(t.x,t.y);\r\n	}\r\n	static bool corner(int x, int y){\r\n		int k=0;\r\n		k+=x==0||x==7;\r\n		k+=y==0||y==7;\r\n		return k==2;\r\n	}\r\n	static bool corner(Pair t){\r\n		return corner(t.x,t.y);\r\n	}\r\n*/\r\n};\r\nostream& operator << (ostream& os, Board b){\r\n	return os<<b.toString();\r\n}\r\n\r\nstruct Analysist{\r\n	bool stableChessCheck(Pair t, Board B){\r\n		if (!B.chess(t)) return 0;\r\n		if (t.x==0||t.x==7){\r\n		if (t.y==0||t.y==7) return 1;\r\n		if ((B.state(t.x,t.y-1)^B.state(t.x,t.y))==0b01) \r\n			if ((B.state(t.x,t.y+1)^B.state(t.x,t.y))==0b01) \r\n				return 1;\r\n		return 0;\r\n		}\r\n		if (t.y==0||t.y==7){\r\n			if (t.x==0||t.x==7) return 1;\r\n			if ((B.state(t.x-1,t.y)^B.state(t.x,t.y))==0b01)\r\n				if ((B.state(t.x+1,t.y)^B.state(t.x,t.y))==0b01) \r\n					return 1;\r\n			return 0;\r\n		}\r\n		return 1;\r\n	}\r\n	bool stableChessCheck(int x, int y, Board B){\r\n		return stableChessCheck(Pair::make(x,y),B);\r\n	}\r\n	bool inChessCheck(Pair t, Board B){\r\n		for (int i=-1;i<=1;++i)\r\n			for (int j=-1;j<=1;++j){\r\n				if (B.state(t.x+i,t.y+j)==UNDEFINED) return 0;\r\n				if (B.state(t.x+i,t.y+j)==NO_CHESS)  return 0;\r\n			}\r\n		return 1;\r\n	}\r\n	bool inChessCheck(int x, int y, Board B){\r\n		return inChessCheck(Pair::make(x,y),B);\r\n	}\r\n	int typeOfChess(Pair t, Board B){\r\n		if (stableChessCheck(t,B)) \r\n			return STABLE_CHESS;\r\n		if (inChessCheck(t,B))\r\n			return IN_CHESS;\r\n		return OUT_CHESS;\r\n	}\r\n	int typeOfChess(int x, int y, Board B){	\r\n		return typeOfChess(Pair::make(x,y),B);\r\n	}\r\n	void findChoice(vector<Pair> &Choice, Board B, int color){\r\n		Choice.clear();\r\n		for (int i=0;i<8;++i)\r\n			for (int j=0;j<8;++j)\r\n				if (B.check(i,j,color)>0) \r\n					Choice.push_back(Pair::make(i,j));\r\n	}\r\n	int choices(Board B, int color){\r\n		vector<Pair> Choice;\r\n		findChoice(Choice,B,color);\r\n		return Choice.size();\r\n	}\r\n	int silence(Pair t, Board B, bool k){\r\n		Board newB = B;\r\n		if (newB.check(t,k)==0) return MYMAX;\r\n		newB.put(t,k);\r\n		vector<Pair> a1,a2,b1,b2;\r\n		findChoice(a1,B,k);\r\n		findChoice(a2,newB,k);\r\n		findChoice(b1,B,!k);\r\n		findChoice(b2,newB,!k);\r\n		return (a2.size()-a1.size())-(b2.size()-b1.size());\r\n	}\r\n};\r\nAnalysist A;\r\n\r\n\r\nstruct Player{\r\npublic:\r\n	string name;\r\n	bool hasName;\r\n	bool color;\r\n	int AI;\r\n	void setColor(bool k){\r\n		color = k;\r\n		if (hasName==0) setName();\r\n	}\r\n	void setMode(int mode){\r\n		AI = mode;\r\n	}\r\n	void setName(string s=\"\"){\r\n		if (s==\"\"){\r\n			hasName = 0;\r\n			if (AI == 0) name = \"Player\";\r\n//			if (AI == 1) name = \"Simple Computer\";\r\n//			if (AI == 2) name = \"Normal Computer\";\r\n//			if (AI == 3) name = \"Clever Computer\";\r\n			if (AI >= 1) {\r\n				name = \"Lv.\";\r\n				name+=(AI+48);\r\n				name+=\" Computer\";\r\n			}\r\n			name+=color?\" 0\":\" 1\";\r\n		}\r\n		else {\r\n			hasName = 1;\r\n			name = s;\r\n		}\r\n	}			\r\n	Player(bool k = 0, int mode = 1, string s = \"\"){\r\n		setColor(k);\r\n		setMode(mode);\r\n		setName(s);\r\n	}\r\n	int chessOfBoard(Board B, int k){\r\n		int a[2]={0,0};\r\n		for (int i=0;i<8;++i)\r\n			for (int j=0;j<8;++j) \r\n				if (B.chess(i,j))	\r\n					++a[B.color(i,j)];\r\n		return a[k];\r\n	}\r\n	Pair bestChoice(vector<Pair> &Choice, Board B){\r\n		vector<int> value;\r\n		value.clear();\r\n		int max = -12011031;\r\n		for (int32 i=0;i<Choice.size();++i){\r\n			int t=evaluate(B,Choice[i]);\r\n			if (t>max) max=t;\r\n			value.push_back(t);\r\n		}\r\n		for (int32 i=0;i<Choice.size();++i)\r\n			while (i<Choice.size()&&value[i]<max){\r\n				Choice.erase(Choice.begin()+i);\r\n				value.erase(value.begin()+i);\r\n			}\r\n		if (Choice.empty()) \r\n			return Pair::make(-1,-1);\r\n		return Choice[R.random(Choice.size())];\r\n	}\r\n	int safetyOfBoard(Board B){\r\n		int safety = 0;\r\n		for (int i=0;i<8;++i)\r\n			for (int j=0;j<8;++j){\r\n				Pair t(i,j);\r\n				if (B.state(i,j)==(EXIST|color))\r\n					safety+=safetyOfChess(t,B);\r\n			}\r\n		return safety;\r\n	}\r\n	int safetyOfChess(Pair t, Board B){\r\n		if (AI<=10){\r\n			if (A.typeOfChess(t,B)==STABLE_CHESS) \r\n				return 2;\r\n			vector<Pair> Choice;\r\n			Player c(!color,1);\r\n			A.findChoice(Choice,B,c.color);\r\n			Board newB = B;\r\n			for (int32 i=0;i<Choice.size();++i){\r\n				newB.put(Choice[i],!color);\r\n				if (newB.color(t)==!color) return 0;\r\n				newB = B;\r\n			}\r\n			return 1;\r\n		}\r\n		return 0;	\r\n	}\r\n/*	int valueOfBoard(Board B){\r\n		int value = chessOfBoard(B,color);\r\n		if (AI==1) return value;\r\n		Player c;\r\n		c.setColor(!color);\r\n		c.setMode(2);\r\n		value-=c.safetyOfBoard(B);\r\n		return value;\r\n		\r\n		int minValue = 12011031;\r\n		Player c;\r\n		c.setMode(1,1);c.setColor(!color);\r\n		setMode(1,1);\r\n		vector<Pair> Choice;\r\n		findChoice(Choice);\r\n		for (int i=0;i<Choice.size();++i){\r\n			Board newB = B;\r\n			newB.put(Choice[i],color);\r\n			newB.put(c.analysis(newB),!color);\r\n			if (valueOfBoard(newB)<minValue)\r\n				minValue = valueOfBoard();\r\n		}\r\n	}*/\r\n	int evaluate(Board B, Pair t){\r\n		Board newB = B;\r\n		//	Lv.1, \r\n		if (!newB.check(t,color)) return -MYMAX;\r\n		newB.put(t,color);\r\n		int score = 0;\r\n		score+=(chessOfBoard(newB,color)-chessOfBoard(B,color));\r\n		if (AI==1)\r\n			return score;\r\n		//	Lv.2, \r\n		score+=3*(safetyOfBoard(newB)-safetyOfBoard(B));\r\n		if (AI==2)\r\n			return score;\r\n		//	Lv.3, \r\n		score+=5*safetyOfChess(t,newB);\r\n		bool tmp0=(t.x<=1||t.x>=6)&&(t.y<=1||t.y>=6);\r\n		bool tmp1=(t.x==1||t.x==6)&&(t.y==1||t.y==6);\r\n		bool tmp2=(t.x==0||t.x==7)&&(t.y==0||t.y==7);\r\n		if (tmp0) score-=2;\r\n		if (tmp1) score-=3;\r\n		if (tmp2) score+=10;\r\n		if (AI==3)\r\n			return score;\r\n		//	Lv.4, \r\n		score+=7*A.silence(t,B,color);\r\n		if (AI==4)\r\n			return score;\r\n		//	Lv.5, ,\r\n		Player c(!color,4);\r\n		Pair sln = c.analysis(newB);\r\n		if (!newB.check(sln,!color)) return score;\r\n		score-=c.evaluate(newB,sln)/3;\r\n		if (AI==5)\r\n			return score;\r\n		//	Lv.6, \r\n		if (AI==6) \r\n			return score;\r\n		return score;\r\n	}\r\n	Pair play(Board B){\r\n		Pair d;\r\n		int t=0;\r\n		if (AI) return analysis(B);\r\n		do{\r\n			cout<<\"Please input your decision:\";\r\n			cin>>d.x>>d.y;\r\n			--d.x;--d.y;\r\n			if (d.x==-1&&d.y==-1) return d;\r\n			if (d.x==MYMAX-1) return d;\r\n			t=B.check(d,color);\r\n			if (t!=0) return d;\r\n			error(name+\" : Illegal operation.\");			\r\n		}while (t==0);\r\n		return d;//avoid warning.\r\n	}\r\n	Pair analysis(Board B){\r\n		vector<Pair> Choice;\r\n		A.findChoice(Choice,B,color);\r\n		return bestChoice(Choice,B);\r\n	}\r\n	void resign(){\r\n		string s=name+\" resigned.\";\r\n		message(s);\r\n	}\r\n	void announce(int x, int y){\r\n#ifndef SHOW_PROCESS\r\n		return;\r\n#endif\r\n		Pair decision(x,y);\r\n		cout<<name<<\" put a \"<<(color?\"white\":\"black\");\r\n		cout<<\" chess at \"<<decision<<\".\"<<endl;\r\n	}\r\n	void announce(Pair t){\r\n		announce(t.x,t.y);\r\n	}\r\n};\r\n\r\nstruct Game{\r\n	Player P[2];\r\n	bool order;\r\n	bool random;\r\n	Board B;\r\n	vector<Board> Boards;\r\n	void setOrder(int k = 0){\r\n		order = k;\r\n	}\r\n	Game(int AI1 = 2, int AI2 = 2, int o = -1){\r\n		P[0].setMode(AI1);	P[1].setMode(AI2);\r\n		P[0].setColor(0);	P[1].setColor(1);\r\n		if (o==-1) random = 1;\r\n		else order = o;\r\n	}\r\n	int checkBoard(bool color){\r\n		for (int i=0;i<8;++i)\r\n			for (int j=0;j<8;++j)\r\n				if (B.check(i,j,color)!=0) \r\n					return 1;\r\n		return 0;\r\n	}\r\n	Board regret(int k){\r\n		return Boards[Boards.size()-1-2*k];\r\n	}\r\n	int start(){\r\n		int holder;\r\n		bool stepColor;\r\n		Pair decision;\r\n		B.init();\r\n		if (random) setOrder(R.random(2));\r\n		Boards.clear();\r\n		for (int i=order;1;++i){\r\n			holder = i%2;\r\n			cout<<B;\r\n			Boards.push_back(B);\r\n			stepColor	= P[holder].color;\r\n			if (!checkBoard(stepColor)) \r\n				return gameOver(-1);\r\n			decision	= P[holder].play(B);\r\n			if (decision == Pair::make(-1,-1)) {\r\n				P[holder].resign();\r\n				return gameOver(1-holder);\r\n			}\r\n			if (decision.x==MYMAX-1) {\r\n				B=regret(2);\r\n				i-=3;\r\n				continue;\r\n			}\r\n			if (!B.put(decision,stepColor)){\r\n				error(\"Game received a bad input.\");\r\n				P[holder].resign();\r\n				return gameOver(1-holder);\r\n			}\r\n			P[holder].announce(decision);\r\n		}\r\n	}\r\n	int calcChess(){\r\n		int a[2]={};\r\n		for (int i=0;i<8;++i)\r\n			for (int j=0;j<8;++j)\r\n				if (B.chess(i,j)) ++a[B.color(i,j)];\r\n		if (P[0].color!=0) {int t=a[0];a[0]=a[1];a[1]=t;}\r\n#ifndef SHOW_PROCESS \r\n		return a[0]==a[1]?-1:a[1]>a[0];\r\n#endif\r\n		cout<<\"Chess of \"<<P[0].name<<\" : \"<<a[0]<<endl;\r\n		cout<<\"Chess of \"<<P[1].name<<\" : \"<<a[1]<<endl;\r\n		return a[0]==a[1]?-1:a[1]>a[0];\r\n	}\r\n	int gameOver(int winner){\r\n		message(\"Game over.\");\r\n		string s = \"\";\r\n		if (winner == -1) \r\n			winner = calcChess();\r\n		else\r\n			calcChess();\r\n		if (winner != -1)\r\n			s+=P[winner].name;\r\n		else \r\n			s+=\"Nobody\";\r\n		s+=\" won the game.\";\r\n		message(s);\r\n		if (globalError!=0)\r\n			cout<<\"Till now, \"<<globalError<<\" errors have occured.\"<<endl;\r\n		return winner;\r\n	}\r\n};\r\n\r\nvoid decisionInit(){\r\n	for (int i=0;i<8;++i){\r\n		D[i].x=decisionX[i];\r\n		D[i].y=decisionY[i];\r\n	}\r\n}\r\nvoid test(int AI1, int AI2, int battle = 20){\r\n	Game G(AI1,AI2);\r\n	int a[2]={},draw=0;\r\n	for (int i=0;i<battle;++i) {\r\n		int ans = G.start();\r\n		if (ans!=-1)\r\n			++a[ans];\r\n		else \r\n			++draw;\r\n	}\r\n	cout<<\"Solution :\"<<endl;\r\n	cout<<\"\\t\"<<G.P[0].name<<\" : \"<<a[0]<<endl;\r\n	cout<<\"\\t\"<<G.P[1].name<<\" : \"<<a[1]<<endl;\r\n	cout<<\"\\tDraw : \"<<draw<<endl;\r\n}\r\nvoid smallTest(){\r\n	Game G(3,2);\r\n	G.P[0].setName(\"Sagitrs\");\r\n	G.start();\r\n}\r\nint work(){\r\n	Board B;\r\n	B.read();\r\n	Player Sagitrs;\r\n	Sagitrs.setMode(5);\r\n	Sagitrs.setColor(0);\r\n	Pair decision = Sagitrs.analysis(B);\r\n	cout<<decision.x<<\" \"<<decision.y<<endl;\r\n	return 1;\r\n}\r\nint main(){\r\n	decisionInit();\r\n//	smallTest();\r\n//	test(5,4,100);\r\n//	test(5,3,100);\r\n//	test(4,3,100);\r\n//	test(6,3,100);\r\n//	test(3,1);\r\n	return work();\r\n	return 0;\r\n}','compile correct','g++','othello','2013-06-25 15:15:50','');
INSERT INTO task VALUES (523,'ustczz','#include <stdio.h>\r\n#include <stdlib.h>\r\n#include <string.h>\r\nint board[8][8]={0};\r\nint store[64][2];\r\nint score[8][8]={{50,10,30,30,30,30,10,50},\r\n				{10,15,20,20,20,20,15,10},\r\n                {30,20,45,40,40,45,20,30},\r\n                {30,20,40,45,45,40,20,30},\r\n                {30,20,40,45,45,40,20,30},\r\n                {30,20,45,40,40,45,20,30},\r\n                {10,15,20,20,20,20,15,10},\r\n                {50,10,30,30,30,30,10,50}};\r\n\r\nint legalDirect(int x,int y,int xoffest,int yoffset,int flag){\r\n	x+=xoffest;\r\n	y+=yoffset;\r\n	if(x<0||x>=8||y<0||y>=8){\r\n		return 0;\r\n	}\r\n	if(board[x][y]==2){\r\n		flag=1;\r\n		return legalDirect(x,y,xoffest,yoffset,flag);\r\n	}\r\n	else if (board[x][y] == 1){\r\n		if(flag==1){\r\n			return 1;\r\n		}\r\n		return 0;\r\n	}\r\n	else\r\n		return 0;\r\n	return 0;\r\n}\r\n\r\nint legal(int x, int y){\r\n	if(board[x][y]!=0)\r\n		return 0;\r\n	int i,j,flag;\r\n	for(i=-1;i<=1;i++){\r\n		for(j=-1;j<=1;j++){\r\n			if(i==0&&j==0){\r\n				continue;\r\n			}\r\n			flag=0;\r\n			if(legalDirect(x,y,i,j,flag)){\r\n				return 1;\r\n			}\r\n		}\r\n	}\r\n	return 0;\r\n}\r\n\r\nint main(){\r\n	int i=0,j=0,k=0,temp=0;\r\n	int temp2;\r\n	//freopen(\"test.txt\",\"r\",stdin );\r\n	memset(store,99,sizeof(store));\r\n	for(i=0;i<8;i++){\r\n		for(j=0;j<8;j++){\r\n			scanf(\"%d\",&board[i][j]);\r\n		}\r\n	}\r\n	if(board[0][0]==1){board[0][1]=30;board[1][0]=30;board[1][1]=35;}\r\n	if(board[0][7]==1){board[0][6]=30;board[1][6]=35;board[1][7]=30;}\r\n	if(board[7][0]==1){board[7][1]=30;board[6][0]=30;board[6][1]=35;}\r\n	if(board[7][7]==1){board[7][6]=30;board[6][7]=30;board[6][6]=35;}\r\n	for(j=0;j<8;j++){\r\n		for(i=0;i<8;i++){\r\n            //printf(\"i=%d j=%d \\n\",i,j);\r\n			if(temp2=legal(i,j)){\r\n                //printf(\"i=%d j=%d temp2=\\n\",i,j,temp2);\r\n				store[k][0]=i*10+j;\r\n				store[k][1]=score[i][j];\r\n				k++;\r\n			}\r\n		}\r\n	}\r\n	for(i=0,j=0;i<k;i++){\r\n        //printf(\"%d %d\\n\",store[i][0],store[i][1]);\r\n		if(store[i][1]>j){\r\n			temp=store[i][0];\r\n			j=store[i][1];\r\n		}\r\n	}\r\n	printf(\"%d %d\\n\",temp/10,temp%10);\r\n	return 0;\r\n}\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n','compile correct','gcc','othello','2013-06-25 16:02:26','');
INSERT INTO task VALUES (525,'ZHUI','#include <stdio.h>\r\n#include <time.h>\r\n#include <stdlib.h>\r\n\r\n#define FALSE -10000\r\nstruct point{\r\n	int x;\r\n	int y;\r\n	int eat;\r\n	int win;\r\n	};\r\nstruct point suit[60];\r\nstruct point suitTemp[60];\r\nint  point_value[8][8]={500, -50, 30, 10, 10, 30, -50, 500, -50, -250, 0, 0, 0, 0, -250, -50, 30, 0, 1, 2, 2, 1, 0, 30, 10, 0, 2, 16, 16, 2, 0, 10, 10, 0, 2, 16, 16, 2, 0, 10, 30, 0, 1, 2, 2, 1, 0, 30, -50, -250, 0, 0, 0, 0, -250, -50, 500, -50, 30, 10, 10, 30, -50, 500};\r\n/* (x,y),xoffest,yoffset(x,y)*/\r\nint legalDirect(int x, int y, int xoffest, int yoffset, int flag, int count,int board[][8])\r\n{\r\n	x += xoffest;\r\n	y += yoffset;\r\n	if (x < 0 || x >= 8 || y < 0 || y >= 8)// \r\n	{\r\n		return FALSE;\r\n	}\r\n	if (board[x][y] == 2)\r\n	{\r\n		/* (x,y),\r\n		*  ,\r\n		*/\r\n		flag = 1;\r\n		return legalDirect(x, y, xoffest, yoffset, flag,count+point_value[x][y],board);\r\n	}\r\n	else if (board[x][y] == 1)\r\n	{\r\n		/* , legal=1*/\r\n		if (flag == 1)\r\n		{\r\n			return count;\r\n		}\r\n		return FALSE;\r\n	}\r\n	else\r\n		return FALSE;\r\n\r\n	return FALSE;\r\n}\r\n\r\nint turnDirect(int x, int y, int xoffest, int yoffset, int flag,int board[][8])\r\n{\r\n	x += xoffest;\r\n	y += yoffset;\r\n	if (x < 0 || x >= 8 || y < 0 || y >= 8)// \r\n	{\r\n		return 0;\r\n	}\r\n	if (board[x][y] == 2)\r\n	{\r\n		/* (x,y),\r\n		*  ,\r\n		*/\r\n		flag = 1;\r\n		if(turnDirect(x, y, xoffest, yoffset, flag,board))\r\n		{\r\n			board[x][y]=1;\r\n			return 1;\r\n		}\r\n		else return 0;\r\n	}\r\n	else if (board[x][y] == 1)\r\n	{\r\n		/* , legal=1*/\r\n		if (flag == 1)\r\n		{\r\n			return 1;\r\n		}\r\n		return 0;\r\n	}\r\n	else\r\n		return 0;\r\n\r\n	return 0;\r\n}\r\n\r\nint turn(int x,int y,int board[][8])\r\n{\r\n	int i, j, flag;\r\n	/* (x,y)*/\r\n	for (i = -1; i <= 1; i++)\r\n	{\r\n		for (j = -1; j <= 1; j++)\r\n		{\r\n			if (i == 0 && j == 0)// (x,y)\r\n			{\r\n				continue;\r\n			}\r\n			flag = 0;\r\n			turnDirect(x, y, i, j, flag,board);\r\n		}\r\n	}\r\n}\r\n\r\n\r\n/* , 0, */\r\nint legal(int x, int y, int board[][8])\r\n{\r\n	\r\n	int C=0;\r\n	if (board[x][y]!=0)// \r\n		return FALSE;\r\n	int i, j, flag,count;\r\n	int eat=1;\r\n	count=point_value[x][y];\r\n	/* (x,y)*/\r\n	for (i = -1; i <= 1; i++)\r\n	{\r\n		for (j = -1; j <= 1; j++)\r\n		{\r\n			if (i == 0 && j == 0)// (x,y)\r\n			{\r\n				continue;\r\n			}\r\n			flag = 0;\r\n			int temp=legalDirect(x, y, i, j, flag, count,board);\r\n			if(temp!=FALSE)\r\n			{\r\n				eat+=temp;\r\n				C=1;\r\n				}\r\n		}\r\n	}\r\n	if(C)\r\n		return eat;\r\n	return FALSE;\r\n}\r\n\r\nint eatmost(int board[][8])\r\n{\r\n	int i,j;\r\n	int k=0;\r\n	for(i=0;i<8;i++)\r\n		for(j=0;j<8;j++)\r\n		{\r\n			int eat;\r\n			if(eat=legal(i,j,board))\r\n			{\r\n				suitTemp[k].x=i;\r\n				suitTemp[k].y=j;\r\n				suitTemp[k].eat=eat;\r\n				k++;\r\n			}\r\n		}\r\n	int N;\r\n	int MAX;\r\n	int temp=0;\r\n	N=k;\r\n	MAX=0;\r\n	for(k=0; k< N; k++)\r\n		if(suitTemp[k].eat>MAX) \r\n		{\r\n			temp=k;\r\n			MAX=suitTemp[k].eat;\r\n		}\r\n	//printf(\"\\nYour opponet will play %d %d\\n\",suitTemp[temp].x,suitTemp[temp].y);\r\n	return MAX;\r\n}	\r\nint shift (int board[][8])\r\n{\r\n	for(int j=0;j<8;j++)\r\n		for(int i=0;i<8;i++)\r\n		{\r\n			if(board[i][j]==1) \r\n				board[i][j]=2;\r\n			else if(board[i][j]==2) \r\n					board[i][j]=1;\r\n		}\r\n}\r\nint show(int board[][8])\r\n{\r\n	for(int i=0;i<8;i++)\r\n	{\r\n		for(int j=0;j<8;j++)\r\n			printf(\"%d  \",board[i][j]);\r\n		printf(\"\\n\");\r\n	}\r\n}\r\nint value(int x,int y,int board[][8],int k)\r\n{\r\n	int board2[8][8]={0};\r\n	for(int i=0;i<8;i++)\r\n		for(int j=0;j<8;j++)\r\n			board2[i][j]=board[i][j];\r\n	\r\n	board2[x][y]=1;\r\n	suit[k].win=0;			\r\n	turn(x,y,board2);\r\n	shift(board2);\r\n	suit[k].win+=suit[k].eat-eatmost(board2);\r\n	//shift(board2);\r\n	//show(board2);\r\n	//printf(\"The Point %d %d,eat %d;win %d\\n\\n\\n\",x,y,suit[k].eat,suit[k].win);\r\n	return 1;\r\n\r\n}\r\n\r\n int main()\r\n{\r\n	srand((int)time(0));\r\n	int i =0;\r\n	int j =0;\r\n	int board[8][8] = {0};\r\n	for(i=0;i<8;i++)\r\n		for(j=0;j<8;j++)\r\n		{\r\n		scanf(\"%d\",&board[i][j]);\r\n		}\r\n	//shift(board);\r\n	int k=0;\r\n	for(i=0;i<8;i++)\r\n		for(j=0;j<8;j++)\r\n		{\r\n			int eat;\r\n			eat=legal(i,j,board);\r\n			if(eat!= FALSE)\r\n			{	\r\n				suit[k].x=i;\r\n				suit[k].y=j;\r\n				suit[k].eat=eat;\r\n				k++;\r\n			}\r\n		}\r\n	int N;\r\n	int MAX,temp;\r\n	N=k;\r\n	temp=-5000;\r\n	for(k=0; k< N; k++)\r\n	{\r\n		int p;\r\n		value(suit[k].x,suit[k].y,board,k);\r\n		\r\n		if(suit[k].win>temp) \r\n			{MAX=k;temp=suit[k].win;}\r\n		else if(suit[k].win == temp && rand()%2)\r\n				{MAX=k;temp=suit[k].win;}\r\n	}\r\n	printf(\"%d %d\\n\",suit[MAX].x,suit[MAX].y);\r\n	return 1;\r\n}\r\n','compile correct','gcc','othello','2013-06-25 16:03:39','');
INSERT INTO task VALUES (561,'halloween','/*12bugcutgrade*/\r\n/*233*/\r\n#include <stdio.h>\r\n#include <math.h>\r\n#include <string.h>\r\n#include <time.h>\r\n#define BEGIN 10\r\n#define MID1 38\r\n#define MID2 55\r\n#define LEN 10\r\nint in (int i, int j) {return (i>=1&&i<=8)&&(j>=1&&j<=8); }\r\nint board[LEN][LEN];\r\nint tbd1[LEN][LEN]; //\r\nint tbd2[LEN][LEN];//\r\nint boom;\r\n\r\nint istype2 (int i, int j) {return ((i==2&&j==2) || (i==7&&j==7) || (i==2&&j==7) ||(i==7&&j==2));}\r\nint grade (int i, int j, int bd[][LEN]);//\r\nint legalDirect(int x, int y, int bd[][LEN], int color, int xoffest, int yoffset, int flag);\r\nint legal(int x, int y, int bd[][LEN], int color);\r\nint point (int i, int j, int T);//\r\nint afput(int i, int j, int bd[][LEN], int color, int *m, int *M, int *ave);//color\r\nint countmap (int bd[][LEN]);\r\n\r\n int main()\r\n{\r\n	int i =0;\r\n	int j =0;\r\n	int t, Max, Mi, Mj, sum;\r\n	Max=-10000;\r\n\r\n//freopen(\"in.txt\", \"r\", stdin);\r\n    memset (board, 0, sizeof (board));\r\n    memset (tbd1, 0, sizeof (tbd1));\r\n    memset (tbd2, 0, sizeof (tbd2));\r\n    sum=0;\r\n	for(i=1;i<=8;i++)\r\n		for(j=1;j<=8;j++)\r\n		{\r\n            scanf(\"%d\",&board[i][j]);\r\n            if (board[i][j]) sum++;\r\n		}\r\n\r\n	for(j=1;j<=8;j++)\r\n		for(i=1;i<=8;i++)\r\n		{\r\n			if(legal(i,j, board, 1))\r\n			{\r\n			   // printf (\":::%d %d\\n\", i-1, j-1);\r\n				t=point (i, j, sum)+100;\r\n				if (t>=Max)\r\n                    {Max=t; Mi=i; Mj=j; }\r\n			}\r\n		}\r\n    printf(\"%d %d\\n\", Mi-1, Mj-1);\r\n    /*t2=clock();\r\n    printf(\"%d\\n\", t2);*/\r\n    return 0;\r\n}\r\n\r\nint legalDirect(int x, int y, int bd[][LEN], int color, int xoffest, int yoffset, int flag)\r\n{\r\n	x += xoffest;\r\n	y += yoffset;\r\n	if (x < 1 || x > 8 || y < 1 || y > 8)// \r\n	{\r\n		return 0;\r\n	}\r\n	if (bd[x][y] == 3-color)\r\n	{\r\n		flag = 1;\r\n		return legalDirect(x, y, bd, color, xoffest, yoffset, flag);\r\n	}\r\n	else if (board[x][y] == color)\r\n	{\r\n		if (flag == 1)\r\n		{\r\n			return 1;\r\n		}\r\n		return 0;\r\n	}\r\n	else\r\n		return 0;\r\n\r\n	return 0;\r\n}\r\n\r\nint legal(int x, int y, int bd[][LEN], int color)\r\n{\r\n	if (bd[x][y]!=0)// \r\n		return 0;\r\n	int i, j, flag;\r\n	for (i = -1; i <= 1; i++)\r\n	{\r\n		for (j = -1; j <= 1; j++)\r\n		{\r\n			if (i == 0 && j == 0)// (x,y)\r\n			{\r\n				continue;\r\n			}\r\n			flag = 0;\r\n			if (legalDirect(x, y, bd, color, i, j, flag))\r\n			{\r\n				return 1;\r\n			}\r\n		}\r\n	}\r\n	return 0;\r\n}\r\n\r\nint grade (int i, int j, int bd[][LEN]) //\r\n{\r\n    int g=0;int ii, jj;int a[9]={0};\r\n    a[2]=1; a[7]=8; a[1]=1; a[8]=8;\r\n     {\r\n        if ((a[i]==1&&a[j]==1&&(i!=1||j!=1)) || (a[i]==8&&a[j]==8&&(i!=8||j!=8)) || (a[i]==1&&a[j]==8&&(i!=1||j!=8)) || (a[i]==8&&a[j]==1&&(i!=8||j!=1) ) ){\r\n            if (bd[ a[i] ][ a[j] ]==0)\r\n                g-=150;\r\n        }\r\n\r\n        else if (i==8||i==1) {\r\n            if (3<=j&&j<=6)  g+=30;\r\n            if (j==3 || j==6) g+=40;\r\n        }\r\n        else if (j==1||j==8) {\r\n            if (3<=i&&i<=6)  g+=30;\r\n            if (i==3 || i==6) g+=40;\r\n        }\r\n        else if (3<=i&&i<=6 && 3<=j&&j<=6) {\r\n            g+=30;\r\n        }\r\n        else g+=10;\r\n	if ((i==8&&j==8) || (i==1&&j==8) || (i==1&&j==1) || (i==8&&j==1)) {\r\n            g+=500;\r\n        }\r\n        for (ii=-1; ii<=1; ii++) {\r\n            for(jj=-1; jj<=1; jj++) {\r\n                if (ii==0&&jj==0) continue;\r\n                else {\r\n                    if (1<=i+ii&&i+ii<=8 && 1<=j+jj&&j+jj<=8)\r\n                    if (bd[i+ii][j+jj] !=0)\r\n                    g+=2;\r\n                }\r\n            }\r\n        }\r\n    }\r\n    return g;\r\n}\r\nint point (int i,int j, int T)\r\n{\r\n    int ii, jj, c1, c2, c2max=-1, g1, g2, g2max, m, M, ave;\r\n    int flag=0, f=0;\r\n        boom = 0;\r\n        g1 = grade(i, j, board);//boardi,j\r\n        memcpy (tbd1, board, LEN*LEN*sizeof(int));//tbd1\r\n        c1=afput (i, j, tbd1, 1, &m, &M, &ave);//tbd1(i, j)\r\n        g1+=countmap(tbd1);\r\n        g1 += ((3*m+0.3*M)+ave)/2;\r\n        for(ii=1;ii<=8;ii++) {\r\n            for(jj=1;jj<=8;jj++)\r\n            {\r\n                if(legal(ii,jj, tbd1, 2))//\r\n                {\r\n                    f=1;\r\n                    g2=grade(ii, jj, tbd1);\r\n                    if (g2>g2max) g2max=g2;\r\n                    memcpy(tbd2, tbd1, LEN*LEN*sizeof(int));//\r\n                    c2 = afput (ii, jj, tbd2, 2, &m, &M, &ave);//\r\n                    g2max +=(M*0.3+ave)/2;\r\n                    if (tbd2[i][j]!=1) flag=1;//flag=true\r\n                    if (c2max<c2) c2max=c2;\r\n                }\r\n            }\r\n        }\r\n    c1*=8; c2max*=8;\r\n    if (f==0)//\r\n        return 10000;\r\n    if (T<BEGIN) {\r\n        return 2*(g1-0.4*g2max) + 2*(c1-0.3*c2max) -(flag==1?10:0) - (boom==1?150:0);\r\n    }\r\n    else if (T >= BEGIN && T<MID1) {\r\n        return  3*(g1-0.4*g2max) + (c1-0.3*c2max)-(flag==1?10:0) - (boom==1?150:0);\r\n    }\r\n    else if (T>=MID1 && T<MID2) {\r\n        return  (g1-0.3*g2max) + 3*(c1-0.3*c2max)-(flag==1?10:0) - (boom==1?150:0);\r\n    }\r\n    else\r\n        return (g1-0.45*g2max)+4*(c1-0.45*c2max)-(flag==1?10:0) - (boom==1?150:0);\r\n}\r\n\r\nint afput(int i, int j, int bd[][LEN], int color, int *m, int *M, int *ave)//color\r\n{\r\n    int dx, dy, cut, ti, tj, t;\r\n    int a[9]={0};\r\n    a[2]=1; a[7]=8; a[1]=1; a[8]=8;\r\n    cut=0;*ave=0;\r\n    *M=-10000; *m=10000;\r\n    for (dx=-1; dx<=1; dx++) {\r\n        for (dy=-1; dy<=1; dy++) {\r\n            if (dx==0&&dy==0) continue;\r\n            else {\r\n                if (legalDirect(i, j, bd, color, dx, dy, 0)) {\r\n                    ti=i; tj=j;\r\n                    while (bd[ti+dx][tj+dy] == 3-color) {//color\r\n                        ti+=dx; tj+=dy;\r\n                        if (color == 1 && istype2(ti, tj) && bd[ a[ti] ][ a[tj] ]==0) {\r\n                            boom = 1;\r\n                        }\r\n                        bd[ti][tj] = color;\r\n                        if ((t=grade(ti, tj, bd) ) > *M) *M=t;\r\n                        if (t<*m) *m=t;\r\n                        *ave+=t;\r\n                        cut++;\r\n                    }\r\n                }\r\n            }\r\n        }\r\n    }\r\n    *ave = *ave/cut;\r\n    return cut;\r\n}\r\n\r\nint countmap (int bd[][LEN])\r\n{\r\n    int i, j, sum;\r\n    for (i=1; i<=8; i++) {\r\n        for (j=1; j<=8; j++) {\r\n           if (in(i+1, j+1)) {\r\n                if(bd[i+1][j+1]==1)\r\n                    sum++;\r\n           }\r\n           if (in(i-1, j-1)) {\r\n                if(bd[i-1][j-1]==1)\r\n                    sum++;\r\n           }\r\n           if (in(i-1, j+1)) {\r\n                if(bd[i-1][j+1]==1)\r\n                    sum++;\r\n           }\r\n           if (in(i+1, j-1)) {\r\n                if(bd[i+1][j-1]==1)\r\n                    sum++;\r\n           }\r\n        }\r\n    }\r\n    if (i==1||i==8) sum+=5;\r\n    if (j==1||j==8) sum+=5;\r\n    return sum;\r\n}\r\n\r\n','compile correct','gcc','othello','2013-06-26 14:41:39','');
INSERT INTO task VALUES (564,'smooth','/*12bugcutgrade*/\r\n/*233*/\r\n#include <stdio.h>\r\n#include <math.h>\r\n#include <string.h>\r\n#include <time.h>\r\n#define BEGIN 10\r\n#define MID1 38\r\n#define MID2 55\r\n#define LEN 10\r\nint in (int i, int j) {return (i>=1&&i<=8)&&(j>=1&&j<=8); }\r\nint board[LEN][LEN];\r\nint tbd1[LEN][LEN]; //\r\nint tbd2[LEN][LEN];//\r\nint boom;\r\n\r\nint istype2 (int i, int j) {return ((i==2&&j==2) || (i==7&&j==7) || (i==2&&j==7) ||(i==7&&j==2));}\r\nint istype1 (int i, int j) {return ((i==1&&j==1) || (i==8&&j==8) || (i==1&&j==8) ||(i==8&&j==1)); }\r\nint grade (int i, int j, int bd[][LEN]);//\r\nint legalDirect(int x, int y, int bd[][LEN], int color, int xoffest, int yoffset, int flag);\r\nint legal(int x, int y, int bd[][LEN], int color);\r\nint point (int i, int j, int T);//\r\nint afput(int i, int j, int bd[][LEN], int color, int *m, int *M, int *ave);//color\r\nint countmap (int bd[][LEN]);\r\n\r\n int main()\r\n{\r\n	int i =0;\r\n	int j =0;\r\n	int t, Max, Mi, Mj, sum;\r\n	Max=-10000;\r\n\r\n//freopen(\"in.txt\", \"r\", stdin);\r\n    memset (board, 0, sizeof (board));\r\n    memset (tbd1, 0, sizeof (tbd1));\r\n    memset (tbd2, 0, sizeof (tbd2));\r\n    sum=0;\r\n	for(i=1;i<=8;i++)\r\n		for(j=1;j<=8;j++)\r\n		{\r\n            scanf(\"%d\",&board[i][j]);\r\n            if (board[i][j]) sum++;\r\n		}\r\n\r\n	for(j=1;j<=8;j++)\r\n		for(i=1;i<=8;i++)\r\n		{\r\n			if(legal(i,j, board, 1))\r\n			{\r\n			   // printf (\":::%d %d\\n\", i-1, j-1);\r\n				t=point (i, j, sum)+100;\r\n				if (t>=Max)\r\n                    {Max=t; Mi=i; Mj=j; }\r\n			}\r\n		}\r\n    printf(\"%d %d\\n\", Mi-1, Mj-1);\r\n    /*t2=clock();\r\n    printf(\"%d\\n\", t2);*/\r\n    return 0;\r\n}\r\n\r\nint legalDirect(int x, int y, int bd[][LEN], int color, int xoffest, int yoffset, int flag)\r\n{\r\n	x += xoffest;\r\n	y += yoffset;\r\n	if (x < 1 || x > 8 || y < 1 || y > 8)// \r\n	{\r\n		return 0;\r\n	}\r\n	if (bd[x][y] == 3-color)\r\n	{\r\n		flag = 1;\r\n		return legalDirect(x, y, bd, color, xoffest, yoffset, flag);\r\n	}\r\n	else if (board[x][y] == color)\r\n	{\r\n		if (flag == 1)\r\n		{\r\n			return 1;\r\n		}\r\n		return 0;\r\n	}\r\n	else\r\n		return 0;\r\n\r\n	return 0;\r\n}\r\n\r\nint legal(int x, int y, int bd[][LEN], int color)\r\n{\r\n	if (bd[x][y]!=0)// \r\n		return 0;\r\n	int i, j, flag;\r\n	for (i = -1; i <= 1; i++)\r\n	{\r\n		for (j = -1; j <= 1; j++)\r\n		{\r\n			if (i == 0 && j == 0)// (x,y)\r\n			{\r\n				continue;\r\n			}\r\n			flag = 0;\r\n			if (legalDirect(x, y, bd, color, i, j, flag))\r\n			{\r\n				return 1;\r\n			}\r\n		}\r\n	}\r\n	return 0;\r\n}\r\n\r\nint grade (int i, int j, int bd[][LEN]) //\r\n{\r\n    int g=0;int ii, jj;int a[9]={0};\r\n    a[2]=1; a[7]=8; a[1]=1; a[8]=8;\r\n     {\r\n        if ((a[i]==1&&a[j]==1&&(i!=1||j!=1)) || (a[i]==8&&a[j]==8&&(i!=8||j!=8)) || (a[i]==1&&a[j]==8&&(i!=1||j!=8)) || (a[i]==8&&a[j]==1&&(i!=8||j!=1) ) ){\r\n            if (bd[ a[i] ][ a[j] ]==0)\r\n                g-=150;\r\n        }\r\n\r\n        else if (i==8||i==1) {\r\n            if (3<=j&&j<=6)  g+=30;\r\n            if (j==3 || j==6) g+=40;\r\n        }\r\n        else if (j==1||j==8) {\r\n            if (3<=i&&i<=6)  g+=30;\r\n            if (i==3 || i==6) g+=40;\r\n        }\r\n        else if (3<=i&&i<=6 && 3<=j&&j<=6) {\r\n            g+=30;\r\n        }\r\n        else g+=10;\r\n	if ((i==8&&j==8) || (i==1&&j==8) || (i==1&&j==1) || (i==8&&j==1)) {\r\n            g+=500;\r\n    }\r\n        for (ii=-1; ii<=1; ii++) {\r\n            for(jj=-1; jj<=1; jj++) {\r\n                if (ii==0&&jj==0) continue;\r\n                else {\r\n                    if (1<=i+ii&&i+ii<=8 && 1<=j+jj&&j+jj<=8)\r\n                    if (bd[i+ii][j+jj] !=0)\r\n                    g+=2;\r\n                }\r\n            }\r\n        }\r\n    }\r\n    return g;\r\n}\r\nint point (int i,int j, int T)\r\n{\r\n    int ii, jj, c1, c2, c2max=-1, g1, g2, g2max, m, M, ave;\r\n    int flag=0, f=0;\r\n    int bigboom = 0;\r\n        boom = 0;\r\n        g1 = grade(i, j, board);//boardi,j\r\n        memcpy (tbd1, board, LEN*LEN*sizeof(int));//tbd1\r\n        c1=afput (i, j, tbd1, 1, &m, &M, &ave);//tbd1(i, j)\r\n        g1+=countmap(tbd1);\r\n        g1 += ((3*m+0.3*M)+ave)/2;\r\n        for(ii=1;ii<=8;ii++) {\r\n            for(jj=1;jj<=8;jj++)\r\n            {\r\n                if(legal(ii,jj, tbd1, 2))//\r\n                {\r\n                    f=1;\r\n                    if (istype1(ii, jj))\r\n                        bigboom = 1;\r\n                    g2=grade(ii, jj, tbd1);\r\n                    if (g2>g2max) g2max=g2;\r\n                    memcpy(tbd2, tbd1, LEN*LEN*sizeof(int));//\r\n                    c2 = afput (ii, jj, tbd2, 2, &m, &M, &ave);//\r\n                    g2max +=(M*0.3+ave)/2;\r\n                    if (tbd2[i][j]!=1) flag=1;//flag=true\r\n                    if (c2max<c2) c2max=c2;\r\n                }\r\n            }\r\n        }\r\n    c1*=8; c2max*=8;\r\n    if (f==0)//\r\n        return 10000;\r\n    if (T<BEGIN) {\r\n        return 2*(g1-0.4*g2max) + 3*(c1-0.3*c2max) -(flag==1?10:0) - (boom==1?150:0);\r\n    }\r\n    else if (T >= BEGIN && T<MID1) {\r\n        return  3*(g1-0.4*g2max) + (c1-0.3*c2max)-(flag==1?10:0) - (boom==1?150:0) - bigboom*200;\r\n    }\r\n    else if (T>=MID1 && T<MID2) {\r\n        return  (g1-0.3*g2max) + 3*(c1-0.3*c2max)-(flag==1?10:0) - (boom==1?150:0) - bigboom*200;\r\n    }\r\n    else\r\n        return (g1-0.2*g2max)+4*(c1-0.45*c2max)-(flag==1?10:0) - (boom==1?150:0)- bigboom*150;\r\n}\r\n\r\nint afput(int i, int j, int bd[][LEN], int color, int *m, int *M, int *ave)//color\r\n{\r\n    int dx, dy, cut, ti, tj, t;\r\n    int a[9]={0};\r\n    a[2]=1; a[7]=8; a[1]=1; a[8]=8;\r\n    cut=0;*ave=0;\r\n    *M=-10000; *m=10000;\r\n    for (dx=-1; dx<=1; dx++) {\r\n        for (dy=-1; dy<=1; dy++) {\r\n            if (dx==0&&dy==0) continue;\r\n            else {\r\n                if (legalDirect(i, j, bd, color, dx, dy, 0)) {\r\n                    ti=i; tj=j;\r\n                    while (bd[ti+dx][tj+dy] == 3-color) {//color\r\n                        ti+=dx; tj+=dy;\r\n                        if (color == 1 && istype2(ti, tj) && bd[ a[ti] ][ a[tj] ]==0) {\r\n                            boom = 1;\r\n                        }\r\n                        bd[ti][tj] = color;\r\n                        if ((t=grade(ti, tj, bd) ) > *M) *M=t;\r\n                        if (t<*m) *m=t;\r\n                        *ave+=t;\r\n                        cut++;\r\n                    }\r\n                }\r\n            }\r\n        }\r\n    }\r\n    *ave = *ave/cut;\r\n    return cut;\r\n}\r\n\r\nint countmap (int bd[][LEN])\r\n{\r\n    int i, j, sum;\r\n    for (i=1; i<=8; i++) {\r\n        for (j=1; j<=8; j++) {\r\n           if (in(i+1, j+1)) {\r\n                if(bd[i+1][j+1]==1)\r\n                    sum++;\r\n           }\r\n           if (in(i-1, j-1)) {\r\n                if(bd[i-1][j-1]==1)\r\n                    sum++;\r\n           }\r\n           if (in(i-1, j+1)) {\r\n                if(bd[i-1][j+1]==1)\r\n                    sum++;\r\n           }\r\n           if (in(i+1, j-1)) {\r\n                if(bd[i+1][j-1]==1)\r\n                    sum++;\r\n           }\r\n        }\r\n    }\r\n    if (i==1||i==8) sum+=5;\r\n    if (j==1||j==8) sum+=5;\r\n    return sum;\r\n}\r\n\r\n','compile correct','gcc','othello','2013-06-26 15:20:23','');
INSERT INTO task VALUES (565,'APOLLO2','#include <stdio.h>\r\n\r\nint board[8][8] = {0},map[8][8] = {0},map1[8][8] = {0},map2[8][8] = {0},val[8][8] = {0};\r\nint quan[8][8] = {1200, -1000,1000,-1000,-1000,1000,-1000,1200,\r\n                  -1000,-1000 ,0   ,0    ,0    ,0   ,-1000,-1000,\r\n                  1000 ,0     ,1000,1000 ,1000 ,1000,0    ,1000,\r\n                  -1000,0     ,1000,1000 ,1000 ,1000,0    ,-1000,\r\n                  -1000,0     ,1000,1000 ,1000 ,1000,0    ,-1000,\r\n                  1000 ,0     ,1000,1000 ,1000 ,1000,0    ,1000,\r\n                  -1000,-1000 ,0   ,0    ,0    ,0   ,-1000,-1000,\r\n                  1200 , -1000,1000,-1000,-1000,1000,-1000,1200};\r\n/* (x,y),xoffest,yoffset(x,y)*/\r\nint legalDirect(int x, int y, int xoffest, int yoffset, int flag)\r\n{\r\n	x += xoffest;\r\n	y += yoffset;\r\n	if (x < 0 || x >= 8 || y < 0 || y >= 8)// \r\n	{\r\n		return 0;\r\n	}\r\n	if (map[x][y] == 2)\r\n	{\r\n		/* (x,y),\r\n		*  ,\r\n		*/\r\n		flag = 1;\r\n		return legalDirect(x, y, xoffest, yoffset, flag);\r\n	}\r\n	else if (map[x][y] == 1)\r\n	{\r\n		/* , legal=1*/\r\n		if (flag == 1)\r\n		{\r\n			return 1;\r\n		}\r\n		return 0;\r\n	}\r\n	else\r\n		return 0;\r\n\r\n	return 0;\r\n}\r\nint direct(int x, int y)\r\n{\r\n    int xx = x,yy = y,p,q,i,j;\r\n    for(i=0;i<8;i++)\r\n		for(j=0;j<8;j++)\r\n		  map1[i][j] = map[i][j];\r\n	for (i = -1; i <= 1; i++)\r\n	{\r\n		for (j = -1; j <= 1; j++)\r\n		{\r\n			if (i == 0 && j == 0)// (x,y)\r\n			{\r\n				continue;\r\n			}\r\n			while(map[x+i][y+j] == 2)\r\n			{\r\n                x += i;\r\n                y += j; \r\n            }\r\n            x += i;\r\n            y += j; \r\n            if (x < 0 || x >= 8 || y < 0 || y >= 8)// \r\n        	{\r\n        		continue;\r\n        	}\r\n            if(map[x][y] == 1)\r\n            {\r\n                for(p = xx,q = yy;p < x;p = p+i,q = q+j)\r\n                    map1[p][q] = 1;\r\n            }\r\n        }\r\n    }\r\n}\r\n/* , 0, 1*/\r\nint legal(int x, int y)\r\n{\r\n	if (map[x][y]!=0)// \r\n		return 0;\r\n	int i, j, flag;\r\n	/* (x,y)*/\r\n	for (i = -1; i <= 1; i++)\r\n	{\r\n		for (j = -1; j <= 1; j++)\r\n		{\r\n			if (i == 0 && j == 0)// (x,y)\r\n			{\r\n				continue;\r\n			}\r\n			flag = 0;\r\n			if (legalDirect(x, y, i, j, flag))\r\n			{\r\n				return 1;\r\n			}\r\n		}\r\n	}\r\n	return 0;\r\n}\r\n// \r\nint turn()\r\n{\r\n    int i,j;\r\n	for(i=0;i<8;i++)\r\n		for(j=0;j<8;j++)\r\n		{\r\n            if(map[i][j] == 1)\r\n                map1[i][j] = 2;\r\n            else if (map[i][j] == 2)\r\n                map1[i][j] = 1;\r\n            else\r\n                map1[i][j] = 0;\r\n        }\r\n    return 0;\r\n}\r\n// \r\nint count()\r\n{\r\n    int n = 0,i,j;\r\n	for(j=0;j<8;j++)\r\n		for(i=0;i<8;i++)\r\n		{\r\n            if(legal(i,j))\r\n            n++;\r\n        }\r\n    return n;\r\n}\r\nint angle()\r\n{\r\n    if(legal(0,0) || legal(0,7) || legal(7,0) || legal(7,7))\r\n        return 600;\r\n    else if(legal(0,2) || legal(0,5) || legal(7,2) || legal(7,5) || legal(2,0) || legal(5,0) || legal(2,7) || legal(5,7))\r\n        return 400; \r\n    else\r\n        return 0;\r\n}\r\nint value()\r\n{\r\n    int i,j,p,q;\r\n	for(i=0;i<8;i++)\r\n		for(j=0;j<8;j++)\r\n		  val[i][j] = quan[i][j];\r\n	for(i=0;i<8;i++)\r\n		for(j=0;j<8;j++)\r\n		{\r\n            for(p=0;p<8;p++)\r\n		        for(q=0;q<8;q++)\r\n                    map[p][q] = board[p][q];\r\n            if(legal(i,j))\r\n            {\r\n                direct(p,q);\r\n                for(p=0;p<8;p++)\r\n		          for(q=0;q<8;q++)\r\n		              map[p][q] = map1[p][q];\r\n                turn();\r\n                for(p=0;p<8;p++)\r\n		          for(q=0;q<8;q++)\r\n		              map[p][q] = map1[p][q];\r\n                val[i][j] += 280/(count()+1);\r\n                val[i][j] -=angle();\r\n            }\r\n            else \r\n                val[i][j] = -100000;\r\n        }\r\n}\r\n int main()\r\n{\r\n	int i =0,j =0,max = -100000,maxx,maxy;	\r\n	for(i=0;i<8;i++)\r\n		for(j=0;j<8;j++)\r\n		{\r\n		scanf(\"%d\",&board[i][j]);\r\n		}\r\n		value();\r\n	for(j=0;j<8;j++)\r\n		for(i=0;i<8;i++)\r\n		{\r\n            if(max<val[i][j])\r\n            {\r\n                max = val[i][j];\r\n                maxx = i;\r\n                maxy = j;\r\n            }\r\n		}\r\n	printf(\"%d %d\\n\",maxx,maxy);\r\n    return 1;\r\n}\r\n','compile correct','gcc','othello','2013-06-26 15:29:34','');
INSERT INTO task VALUES (568,'APOLLO','#include <stdio.h>\r\nint board[8][8] = {0},map[8][8] = {0},map1[8][8] = {0},map2[8][8] = {0},val[8][8] = {0},num[8][8] = {0};\r\nint quan[8][8] = {1200, -1000,1000,-500 ,-500 ,1000,-1000,1200,\r\n                  -1000,-1000 ,0   ,0    ,0    ,0   ,-1000,-1000,\r\n                  1000 ,0     ,1000,1000 ,1000 ,1000,0    ,1000,\r\n                  -500,0     ,1000,1000 ,1000 ,1000,0    ,-500,\r\n                  -500,0     ,1000,1000 ,1000 ,1000,0    ,-500,\r\n                  1000 ,0     ,1000,1000 ,1000 ,1000,0    ,1000,\r\n                  -1000,-1000 ,0   ,0    ,0    ,0   ,-1000,-1000,\r\n                  1200 , -1000,1000,-500,-500,1000,-1000,1200};\r\n/* (x,y),xoffest,yoffset(x,y)*/\r\nint legalDirect(int x, int y, int xoffest, int yoffset, int flag)\r\n{\r\n	x += xoffest;\r\n	y += yoffset;\r\n	if (x < 0 || x >= 8 || y < 0 || y >= 8)// \r\n	{\r\n		return 0;\r\n	}\r\n	if (map[x][y] == 2)\r\n	{\r\n		/* (x,y),\r\n		*  ,\r\n		*/\r\n		flag = 1;\r\n		return legalDirect(x, y, xoffest, yoffset, flag);\r\n	}\r\n	else if (map[x][y] == 1)\r\n	{\r\n		/* , legal=1*/\r\n		if (flag == 1)\r\n		{\r\n			return 1;\r\n		}\r\n		return 0;\r\n	}\r\n	else\r\n		return 0;\r\n\r\n	return 0;\r\n}\r\nint direct(int x, int y)\r\n{\r\n    int xx = x,yy = y,p,q,i,j;\r\n    for(i=0;i<8;i++)\r\n		for(j=0;j<8;j++)\r\n		{\r\n            num[i][j] = 0;\r\n            map1[i][j] = map[i][j];\r\n        }\r\n	for (i = -1; i <= 1; i++)\r\n	{\r\n		for (j = -1; j <= 1; j++)\r\n		{\r\n			if (i == 0 && j == 0)// (x,y)\r\n			{\r\n				continue;\r\n			}\r\n			while(map[x+i][y+j] == 2)\r\n			{\r\n                x += i;\r\n                y += j; \r\n            }\r\n            x += i;\r\n            y += j; \r\n            if (x < 0 || x >= 8 || y < 0 || y >= 8)// \r\n        	{\r\n        		continue;\r\n        	}\r\n            if(map[x][y] == 1)\r\n            {\r\n                for(p = xx,q = yy;p < x;p = p+i,q = q+j)\r\n                {\r\n                    map1[p][q] = 1;\r\n                    num[xx][yy] += 1;\r\n                }\r\n            }\r\n        }\r\n    }\r\n}\r\n/* , 0, 1*/\r\nint legal(int x, int y)\r\n{\r\n	if (map[x][y]!=0)// \r\n		return 0;\r\n	int i, j, flag;\r\n	/* (x,y)*/\r\n	for (i = -1; i <= 1; i++)\r\n	{\r\n		for (j = -1; j <= 1; j++)\r\n		{\r\n			if (i == 0 && j == 0)// (x,y)\r\n			{\r\n				continue;\r\n			}\r\n			flag = 0;\r\n			if (legalDirect(x, y, i, j, flag))\r\n			{\r\n				return 1;\r\n			}\r\n		}\r\n	}\r\n	return 0;\r\n}\r\n// \r\nint turn()\r\n{\r\n    int i,j;\r\n	for(i=0;i<8;i++)\r\n		for(j=0;j<8;j++)\r\n		{\r\n            if(map[i][j] == 1)\r\n                map1[i][j] = 2;\r\n            else if (map[i][j] == 2)\r\n                map1[i][j] = 1;\r\n            else\r\n                map1[i][j] = 0;\r\n        }\r\n    return 0;\r\n}\r\n// \r\nint count()\r\n{\r\n    int n = 0,i,j;\r\n	for(j=0;j<8;j++)\r\n		for(i=0;i<8;i++)\r\n		{\r\n            if(legal(i,j))\r\n            n++;\r\n        }\r\n    return n;\r\n}\r\nint angle()\r\n{\r\n    if(legal(0,0) || legal(0,7) || legal(7,0) || legal(7,7))\r\n        return 600;\r\n    else if(legal(0,2) || legal(0,5) || legal(7,2) || legal(7,5) || legal(2,0) || legal(5,0) || legal(2,7) || legal(5,7))\r\n        return 400; \r\n    else\r\n        return 0;\r\n}\r\nint value()\r\n{\r\n    int i,j,p,q,n,m;\r\n	for(i=0;i<8;i++)\r\n		for(j=0;j<8;j++)\r\n		  val[i][j] = quan[i][j];\r\n	for(i=0;i<8;i++)\r\n		for(j=0;j<8;j++)\r\n		{\r\n            for(p=0;p<8;p++)\r\n		        for(q=0;q<8;q++)\r\n                    map[p][q] = board[p][q];\r\n            if(legal(i,j))\r\n            {\r\n                direct(i,j);\r\n                for(p=0;p<8;p++)\r\n		          for(q=0;q<8;q++)\r\n		              map[p][q] = map1[p][q];\r\n                turn();\r\n                for(p=0;p<8;p++)\r\n		          for(q=0;q<8;q++)\r\n		              map[p][q] = map1[p][q];\r\n		        n = count();\r\n		        m = angle();\r\n                val[i][j] += 280/(n+1);\r\n                val[i][j] -=m;\r\n                val[i][j] += 100*num[i][j];\r\n                \r\n            }\r\n            else \r\n                val[i][j] = -100000;\r\n        }\r\n}\r\n int main()\r\n{\r\n	int i =0,j =0,max = -100000,maxx,maxy;	\r\n	for(i=0;i<8;i++)\r\n		for(j=0;j<8;j++)\r\n		{\r\n		scanf(\"%d\",&board[i][j]);\r\n		}\r\n		value();\r\n	for(j=0;j<8;j++)\r\n		for(i=0;i<8;i++)\r\n		{\r\n            if(max<val[i][j])\r\n            {\r\n                max = val[i][j];\r\n                maxx = i;\r\n                maxy = j;\r\n            }\r\n		}\r\n	printf(\"%d %d\\n\",maxx,maxy);\r\n    return 1;\r\n}','compile correct','gcc','othello','2013-06-26 16:26:41','');
INSERT INTO task VALUES (570,'haiwei624!','#include <iostream>\r\n#include <cstdio>\r\n#include <cstdlib>\r\n#include <cstring>\r\n#include <cmath>\r\nusing namespace std;\r\n#define FOR(i,a,b) for(int i=a;i<=b;i++)\r\n#define MST(a,b) memset(a,b,sizeof(a))\r\n#define MAXN 10\r\nint fx[8]={-1,0,1,1,1,0,-1,-1};\r\nint fy[8]={1,1,1,0,-1,-1,-1,0};\r\nint g0[MAXN][MAXN];\r\nint val[8][8]={\r\n{40,-5,4,2,2,4,-5,40},\r\n{-5,-10,-1,-1,-1,-1,-10,-5},\r\n{4,-1,2,2,2,2,-1,4},\r\n{2,-1,2,1,1,2,-1,2},\r\n{2,-1,2,1,1,2,-1,2},\r\n{4,-1,2,2,2,2,-1,4},\r\n{-5,-10,-1,-1,-1,-1,-10,-5},\r\n{40,-5,4,2,2,4,-5,40}\r\n};\r\nint timelimit;\r\nint tots;\r\nvoid init()\r\n{\r\n    FOR(i,0,7)FOR(j,0,7)scanf(\"%d\",&g0[i][j]);\r\n    tots=0;\r\n    FOR(i,0,7)FOR(j,0,7)if(g0[i][j])tots++;\r\n    timelimit=8;\r\n    if(tots<=54)timelimit=6;\r\n    if(tots<=40)timelimit=4;\r\n}\r\n\r\nint dfs(int k,int g0[MAXN][MAXN],int &ansi,int &ansj)\r\n{\r\n    if(k==timelimit+1)\r\n    {\r\n        int ans=0;\r\n        FOR(i,0,7)FOR(j,0,7)\r\n        {\r\n            if(g0[i][j]==1)ans+=1;\r\n            if(g0[i][j]==2)ans-=1;\r\n        }\r\n        return ans;\r\n    }\r\n    /*printf(\"%d:\\n\",k);\r\n    FOR(i,0,7)\r\n    {\r\n        FOR(j,0,7)printf(\"%d \",g0[i][j]);\r\n        printf(\"\\n\");\r\n    }*/\r\n    int maxS=-2000,maxi=0,maxj=0;\r\n    int tried=0;\r\n    FOR(x,0,7)FOR(y,0,7)\r\n    if(g0[x][y]==0)\r\n    {\r\n        int g[MAXN][MAXN];\r\n        FOR(i,0,7)FOR(j,0,7)g[i][j]=g0[i][j];\r\n        g[x][y]=1;\r\n        int legal=0;\r\n        int tot,stx[MAXN],sty[MAXN];\r\n        FOR(p,0,7)\r\n        {\r\n            int xt=x+fx[p],yt=y+fy[p];\r\n            tot=0;\r\n            while( xt>=0 && yt>=0 && xt<=7 && yt<=7 && g[xt][yt]==2)\r\n            {\r\n                tot++;\r\n                stx[tot]=xt;\r\n                sty[tot]=yt;\r\n                xt=xt+fx[p];\r\n                yt=yt+fy[p];\r\n            }\r\n            if(xt>=0 && yt>=0 && xt<=7 && yt<=7 && g[xt][yt]==1 && tot>0)\r\n            {\r\n                legal=1;\r\n                FOR(i,1,tot)g[stx[i]][sty[i]]=1;\r\n            }\r\n        }\r\n        if(legal==0)continue;\r\n        tried=1;\r\n        if(k<timelimit)\r\n        {\r\n            int ans,t1,t2;\r\n            FOR(i,0,7)FOR(j,0,7)\r\n            {\r\n                if(g[i][j]==1)g[i][j]=2;\r\n                else if(g[i][j]==2)g[i][j]=1;\r\n            }\r\n            ans=-dfs(k+1,g,t1,t2);\r\n            if(ans>=maxS)\r\n            {\r\n                maxS=ans;\r\n                maxi=x;\r\n                maxj=y;\r\n            }\r\n        }\r\n        if(k==timelimit)\r\n        {\r\n            int ans=0;\r\n            FOR(i,0,7)FOR(j,0,7)\r\n            {\r\n                if(g[i][j]==1)ans+=val[i][j];\r\n                if(g[i][j]==2)ans-=val[i][j];\r\n            }\r\n            if(ans>=maxS)\r\n            {\r\n                if((rand()*rand())%(64*64*64)<=64*64*64-(64-tots)*(64-tots)*(64-tots) || maxS==-2000){\r\n                maxS=ans;\r\n                maxi=x;\r\n                maxj=y;}\r\n            }\r\n        }\r\n    }\r\n\r\n    ansi=maxi;\r\n    ansj=maxj;\r\n    if(tried==0)\r\n    {\r\n        int g[MAXN][MAXN];\r\n        FOR(i,0,7)FOR(j,0,7)\r\n        {\r\n            if(g0[i][j]==1)g[i][j]=2;\r\n                else if(g0[i][j]==2)g[i][j]=1;\r\n                else g[i][j]=0;\r\n            }\r\n        maxS=-dfs(k+1,g,ansi,ansj);\r\n    }\r\n    //printf(\"%d %d %d %d\\n\",k,maxS,ansi,ansj);\r\n    return maxS;\r\n}\r\nvoid work()\r\n{\r\n    int ansi,ansj;\r\n    dfs(1,g0,ansi,ansj);\r\n    printf(\"%d %d\\n\",ansi,ansj);\r\n}\r\nint main()\r\n{\r\n\r\n    init();\r\n    work();\r\n}\r\n','compile correct','g++','othello','2013-06-27 20:44:37','');
INSERT INTO task VALUES (576,NULL,'		\r\n		#include<cstdio>\r\n#include<iostream>\r\nusing namespace std;\r\n\r\n//boardboard2\r\n\r\n\r\nint board[8][8] = {{0}} , board2[8][8] = {{0}} ;                 //board2board\r\nint DirectNumTemp = 0;                 // xy\r\nconst int DEPTH = 7;                   // \r\nconst int First =40 ;\r\n\r\nvoid Print()\r\n{\r\n	for(int i(0); i < 8; i++)\r\n	{\r\n		for(int j(0); j < 8; j++)\r\n    	{		\r\n    		printf(\"%d\",board2[i][j]);\r\n 		}\r\n		printf(\"\\n\");\r\n	}\r\n	printf(\"\\n\");\r\n}\r\n\r\n//boardboard2\r\nvoid CopyBoard()                                                 \r\n{\r\n    for(int i(0); i < 8; i++)\r\n        for(int j(0); j < 8; j++)\r\n            board2[i][j] = board[i][j];\r\n}\r\n\r\nvoid CopyToBoardTemp(int boardtemp[8][8])                                                 \r\n{\r\n    for(int i(0); i < 8; i++)\r\n        for(int j(0); j < 8; j++)\r\n            boardtemp[i][j] = board2[i][j];\r\n}\r\n\r\n//(x,y)i,j \r\nbool LegalDirect(int x, int y, int i, int j, int flag , int &DirectNumTemp)             \r\n{\r\n    // DirectNumTemp?\r\n    x += i;\r\n    y += j;\r\n\r\n    if (x < 0 || x > 7 || y < 0 || y > 7)                        // \r\n        return 0;\r\n\r\n    int flagtemp;\r\n    if(board2[x][y] == 2)flagtemp = 0;                         //\r\n    else if(board2[x][y] == 1)flagtemp = 1;\r\n    else return 0;										// ,\r\n\r\n    if(flag == flagtemp && DirectNumTemp != 0)return 1;    //\r\n\r\n    else if (flagtemp != flag )\r\n        {\r\n            DirectNumTemp ++;              //\r\n            /* (x,y),\r\n            *  ,\r\n            */\r\n            return LegalDirect(x, y, i, j, flag, DirectNumTemp);\r\n        }\r\n    return 0;\r\n}\r\n\r\n//(x,y)(i,j)\r\nbool Legal(int x, int y, int flag)                                \r\n{\r\n    //DirectNum[i][j];     \r\n    if (board2[x][y] != 0)                              // \r\n        return 0;\r\n    int i, j;\r\n\r\n    for (i = -1; i <= 1; i++)                          // (x,y)\r\n        {\r\n            for (j = -1; j <= 1; j++)\r\n                {\r\n                    if (i == 0 && j == 0)                      // (x,y)\r\n                        {\r\n                            continue;\r\n                        }\r\n                    if (LegalDirect(x, y, i, j, flag, DirectNumTemp))\r\n                        {\r\n                        	DirectNumTemp = 0;                          //\r\n                            return 1;\r\n                        }\r\n                    DirectNumTemp = 0;                          //\r\n                }\r\n        }\r\n    return 0;\r\n}\r\n\r\n// xyboard1 \r\nvoid make_move(int x , int y, int flag,int boardtemp[][8])                           \r\n{\r\n	CopyToBoardTemp(boardtemp);\r\n    int i, j,temp1= ((flag==0) ?2:1 );\r\n    board2[x][y] = temp1;\r\n    for (i = -1; i <= 1; i++)                          // (x,y)\r\n        {\r\n            for (j = -1; j <= 1; j++)\r\n                {\r\n                    if (i == 0 && j == 0)                      // (x,y)\r\n                        continue;\r\n                    if ( LegalDirect(x, y, i, j, flag, DirectNumTemp)) //\r\n					{\r\n						for(int k(0); k < DirectNumTemp + 1; k++)\r\n                            board2[x + i * k][y + j * k] = temp1 ; // \r\n					}           \r\n                    DirectNumTemp = 0;\r\n                }\r\n        }\r\n}\r\n\r\n\r\nvoid unmake_move(int boardtemp[8][8])                                                 \r\n{\r\n    for(int i(0); i < 8; i++)\r\n        for(int j(0); j < 8; j++)\r\n            board2[i][j] = boardtemp[i][j];\r\n}\r\n\r\n\r\nbool isConner(int x ,int y)                           // \r\n{\r\n	if(x==0&&y==0)return 1;\r\n	else if(x==0&&y==7)return 1;\r\n	else if(x==7&&y==0)return 1;\r\n	else if(x==7&&y==7)return 1;\r\n	return 0; \r\n}\r\n\r\nbool is1BesideConner(int x ,int y)                   //412 \r\n{\r\n	if(x==0||x==7)\r\n		if(y==1||y==6)return 1;\r\n	if(x==1||x==6)\r\n		if(y==0||y==1||y==6||y==7)return 1;\r\n	return 0;\r\n}\r\n\r\nbool is2BesideConner(int x ,int y)                   //416 \r\n{\r\n	if(y==5||y==2)\r\n		if(x==1||x==0||x==6||x==7)return 1;\r\n	if(x==5||x==2)\r\n			if(y==1||y==0||y==6||y==7)return 1;\r\n	if((x==2&&y==2 )||( x==2&&y==5 )||( x==5&&y==5 )|| (x==5&&y==2) )return 1;\r\n	\r\n	return 0;\r\n} \r\n\r\n/*int CanGoNum (int flag)                     //xy \r\n{\r\n	int w=0;\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0); j<8; j++)\r\n			if(Legal(i,j,flag))w++;                           \r\n	return w;\r\n}*/\r\n\r\n\r\nint evaluation(int board2[8][8])\r\n{\r\n	int value(0), Total(0), White(0), Black(0), Conner(0);\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0);j<8; j++)\r\n		{\r\n			if(board2[i][j]==2)White++;\r\n			else if(board2[i][j]==1)Black++;\r\n		}\r\n	Total = Black + White ;\r\n	if(Total == 64)\r\n	{\r\n		if(Black > White)return 100000;\r\n		else return -100000;\r\n	}\r\n	if(Black < 6)value = -10000;\r\n	for(int i(0); i<8; i++)\r\n	for(int j(0); j<8; j++)\r\n	{\r\n		if(board2[i][j]==0)continue;\r\n		if(isConner(i,j))\r\n		{\r\n			if(board2[i][j]==1)value+=500;\r\n			else value-=500;\r\n			Conner++;\r\n		}\r\n		if(is1BesideConner(i,j))\r\n		{\r\n			if(board2[i][j]==1)value-=300;\r\n			else value+=300;\r\n		}\r\n		if(is2BesideConner(i,j))\r\n		{\r\n			if(board2[i][j]==1)value+=30;\r\n			else value-=30;\r\n		}\r\n		if(isSide(i,j))\r\n			if(board2[i][j]==2)value+=30;\r\n			else value-=10;\r\n	}\r\n	if(Conner>1)\r\n	{\r\n		value += Black*20;\r\n		value -= White*20;\r\n	}\r\n	else if(Total > First)\r\n	{\r\n		value -= Black*20;\r\n		value += White*20;\r\n	}\r\n//	cout << \"evaluation\" << value << endl;\r\n	return value;\r\n}\r\n\r\n\r\nint get_exact()\r\n{\r\n	int value(0), White(0), Black(0);\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0);j<8; j++)\r\n		{\r\n			if(board2[i][j]==2)White++;\r\n			else if(board2[i][j]==1)Black++;\r\n		}\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0);j<8; j++)\r\n			if(board2[i][j]==2){\r\n				value+=Black;\r\n				value-=White;\r\n			}\r\n//	cout << \"get_exact\" << value << endl;\r\n	return value;\r\n}\r\n\r\nint alpha_beta(int alpha, int beta, int depth, int pass)\r\n{\r\n	int boardtemp[8][8] = {{0}};\r\n	int flag(0);\r\n	bool key (1);\r\n	if(depth % 2 == 1)flag = 1;\r\n	// \r\n	int best_value = -10000000;\r\n	// \r\n	if (depth == DEPTH) {\r\n		// \r\n		return evaluation(board2);\r\n	}\r\n	// \r\n	for(int i(0); i < 8; i++)\r\n        for(int j(0); j < 8; j++)\r\n                if(Legal(i, j, flag))\r\n                {\r\n                    make_move(i,j,flag,boardtemp);\r\n                    // \r\n					int value = -alpha_beta(-beta, -alpha, depth+1, 0);\r\n					// \r\n					unmake_move(boardtemp);\r\n					// \r\n					if (value >= beta) \r\n					{\r\n					// \r\n					return value;\r\n					}\r\n						// \r\n					if (value > best_value)\r\n					{\r\n						// \r\n						best_value = value;\r\n						// \r\n						if (value > alpha) \r\n						{\r\n							alpha = value;\r\n						}\r\n					}\r\n					key = 0;\r\n				}\r\n	// \r\n	if (key)\r\n	 {\r\n		// \r\n		if (pass) \r\n		{\r\n			// \r\n			return get_exact();\r\n		}\r\n		CopyToBoardTemp(boardtemp);\r\n		// \r\n		best_value = -alpha_beta(-beta, -alpha, depth+1, 1);\r\n		// \r\n		unmake_move(boardtemp);\r\n	}\r\n	// \r\n	return best_value;\r\n}\r\n\r\nint main()\r\n{\r\n    int Total = 0;\r\n    for(int i(0); i < 8; i++)                              // \r\n        for(int j(0); j < 8; j++)\r\n            {\r\n                scanf(\"%d\", &board[i][j]);\r\n                if(board[i][j] != 0)Total++;\r\n            }\r\n    CopyBoard();\r\n    int xans(0),yans(0),flag(1),bestvalue(-100000),depth(1),value(-100000);\r\n	\r\n    for(int i(0); i < 8; i++)\r\n        for(int j(0); j < 8; j++)\r\n                if(Legal(i, j, flag))\r\n                {\r\n                	int boardtemp[8][8] = {{0}};\r\n                	make_move(i,j,flag,boardtemp);\r\n                	value =  -alpha_beta(-100000,100000,depth+1,0);\r\n                	unmake_move(boardtemp);\r\n                	if(value > bestvalue)\r\n                	{\r\n                		xans = i; yans = j; bestvalue = value ;\r\n                	}\r\n                }\r\n    printf(\"%d %d\",xans,yans);\r\n	// \r\n}\r\n	','enter queue','g++','othello','2013-06-28 19:37:02','');
INSERT INTO task VALUES (578,'jerrytest','		\r\n		#include<cstdio>\r\n#include<iostream>\r\nusing namespace std;\r\n\r\n//boardboard2\r\n\r\n\r\nint board[8][8] = {{0}} , board2[8][8] = {{0}} ;                 //board2board\r\nint DirectNumTemp = 0;                 // xy\r\nconst int DEPTH = 7;                   // \r\nconst int First =40 ;\r\n\r\nvoid Print()\r\n{\r\n	for(int i(0); i < 8; i++)\r\n	{\r\n		for(int j(0); j < 8; j++)\r\n    	{		\r\n    		printf(\"%d\",board2[i][j]);\r\n 		}\r\n		printf(\"\\n\");\r\n	}\r\n	printf(\"\\n\");\r\n}\r\n\r\n//boardboard2\r\nvoid CopyBoard()                                                 \r\n{\r\n    for(int i(0); i < 8; i++)\r\n        for(int j(0); j < 8; j++)\r\n            board2[i][j] = board[i][j];\r\n}\r\n\r\nvoid CopyToBoardTemp(int boardtemp[8][8])                                                 \r\n{\r\n    for(int i(0); i < 8; i++)\r\n        for(int j(0); j < 8; j++)\r\n            boardtemp[i][j] = board2[i][j];\r\n}\r\n\r\n//(x,y)i,j \r\nbool LegalDirect(int x, int y, int i, int j, int flag , int &DirectNumTemp)             \r\n{\r\n    // DirectNumTemp?\r\n    x += i;\r\n    y += j;\r\n\r\n    if (x < 0 || x > 7 || y < 0 || y > 7)                        // \r\n        return 0;\r\n\r\n    int flagtemp;\r\n    if(board2[x][y] == 2)flagtemp = 0;                         //\r\n    else if(board2[x][y] == 1)flagtemp = 1;\r\n    else return 0;										// ,\r\n\r\n    if(flag == flagtemp && DirectNumTemp != 0)return 1;    //\r\n\r\n    else if (flagtemp != flag )\r\n        {\r\n            DirectNumTemp ++;              //\r\n            /* (x,y),\r\n            *  ,\r\n            */\r\n            return LegalDirect(x, y, i, j, flag, DirectNumTemp);\r\n        }\r\n    return 0;\r\n}\r\n\r\n//(x,y)(i,j)\r\nbool Legal(int x, int y, int flag)                                \r\n{\r\n    //DirectNum[i][j];     \r\n    if (board2[x][y] != 0)                              // \r\n        return 0;\r\n    int i, j;\r\n\r\n    for (i = -1; i <= 1; i++)                          // (x,y)\r\n        {\r\n            for (j = -1; j <= 1; j++)\r\n                {\r\n                    if (i == 0 && j == 0)                      // (x,y)\r\n                        {\r\n                            continue;\r\n                        }\r\n                    if (LegalDirect(x, y, i, j, flag, DirectNumTemp))\r\n                        {\r\n                        	DirectNumTemp = 0;                          //\r\n                            return 1;\r\n                        }\r\n                    DirectNumTemp = 0;                          //\r\n                }\r\n        }\r\n    return 0;\r\n}\r\n\r\n// xyboard1 \r\nvoid make_move(int x , int y, int flag,int boardtemp[][8])                           \r\n{\r\n	CopyToBoardTemp(boardtemp);\r\n    int i, j,temp1= ((flag==0) ?2:1 );\r\n    board2[x][y] = temp1;\r\n    for (i = -1; i <= 1; i++)                          // (x,y)\r\n        {\r\n            for (j = -1; j <= 1; j++)\r\n                {\r\n                    if (i == 0 && j == 0)                      // (x,y)\r\n                        continue;\r\n                    if ( LegalDirect(x, y, i, j, flag, DirectNumTemp)) //\r\n					{\r\n						for(int k(0); k < DirectNumTemp + 1; k++)\r\n                            board2[x + i * k][y + j * k] = temp1 ; // \r\n					}           \r\n                    DirectNumTemp = 0;\r\n                }\r\n        }\r\n}\r\n\r\n\r\nvoid unmake_move(int boardtemp[8][8])                                                 \r\n{\r\n    for(int i(0); i < 8; i++)\r\n        for(int j(0); j < 8; j++)\r\n            board2[i][j] = boardtemp[i][j];\r\n}\r\n\r\n\r\nbool isConner(int x ,int y)                           // \r\n{\r\n	if(x==0&&y==0)return 1;\r\n	else if(x==0&&y==7)return 1;\r\n	else if(x==7&&y==0)return 1;\r\n	else if(x==7&&y==7)return 1;\r\n	return 0; \r\n}\r\n\r\nbool is1BesideConner(int x ,int y)                   //412 \r\n{\r\n	if(x==0||x==7)\r\n		if(y==1||y==6)return 1;\r\n	if(x==1||x==6)\r\n		if(y==0||y==1||y==6||y==7)return 1;\r\n	return 0;\r\n}\r\n\r\nbool is2BesideConner(int x ,int y)                   //416 \r\n{\r\n	if(y==5||y==2)\r\n		if(x==1||x==0||x==6||x==7)return 1;\r\n	if(x==5||x==2)\r\n			if(y==1||y==0||y==6||y==7)return 1;\r\n	if((x==2&&y==2 )||( x==2&&y==5 )||( x==5&&y==5 )|| (x==5&&y==2) )return 1;\r\n	\r\n	return 0;\r\n} \r\n\r\nbool isSide(int x ,int y)\r\n{\r\n	if(x == 0 || x == 7)\r\n		if(y == 3 || y == 4)return 1;\r\n	if(y == 0 || y == 7)\r\n		if(x == 3 || x == 4)return 1;\r\n	return 0;\r\n}\r\n\r\n/*int CanGoNum (int flag)                     //xy \r\n{\r\n	int w=0;\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0); j<8; j++)\r\n			if(Legal(i,j,flag))w++;                           \r\n	return w;\r\n}*/\r\n\r\n\r\nint evaluation(int board2[8][8])\r\n{\r\n	int value(0), Total(0), White(0), Black(0), Conner(0);\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0);j<8; j++)\r\n		{\r\n			if(board2[i][j]==2)White++;\r\n			else if(board2[i][j]==1)Black++;\r\n		}\r\n	Total = Black + White ;\r\n	if(Total == 64)\r\n	{\r\n		if(Black > White)return 100000;\r\n		else return -100000;\r\n	}\r\n	if(Black < 6)value = -10000;\r\n	for(int i(0); i<8; i++)\r\n	for(int j(0); j<8; j++)\r\n	{\r\n		if(board2[i][j]==0)continue;\r\n		if(isConner(i,j))\r\n		{\r\n			if(board2[i][j]==1)value+=500;\r\n			else value-=500;\r\n			Conner++;\r\n		}\r\n		if(is1BesideConner(i,j))\r\n		{\r\n			if(board2[i][j]==1)value-=300;\r\n			else value+=300;\r\n		}\r\n		if(is2BesideConner(i,j))\r\n		{\r\n			if(board2[i][j]==1)value+=30;\r\n			else value-=30;\r\n		}\r\n		if( isSide(i,j) )\r\n		{\r\n			if(board2[i][j]==2)value+=30;\r\n			else value-=10;\r\n		}\r\n	}\r\n	if(Conner>1)\r\n	{\r\n		value += Black*20;\r\n		value -= White*20;\r\n	}\r\n	else if(Total > First)\r\n	{\r\n		value -= Black*20;\r\n		value += White*20;\r\n	}\r\n//	cout << \"evaluation\" << value << endl;\r\n	return value;\r\n}\r\n\r\n\r\nint get_exact()\r\n{\r\n	int value(0), White(0), Black(0);\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0);j<8; j++)\r\n		{\r\n			if(board2[i][j]==2)White++;\r\n			else if(board2[i][j]==1)Black++;\r\n		}\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0);j<8; j++)\r\n			if(board2[i][j]==2){\r\n				value+=Black;\r\n				value-=White;\r\n			}\r\n//	cout << \"get_exact\" << value << endl;\r\n	return value;\r\n}\r\n\r\nint alpha_beta(int alpha, int beta, int depth, int pass)\r\n{\r\n	int boardtemp[8][8] = {{0}};\r\n	int flag(0);\r\n	bool key (1);\r\n	if(depth % 2 == 1)flag = 1;\r\n	// \r\n	int best_value = -10000000;\r\n	// \r\n	if (depth == DEPTH) {\r\n		// \r\n		return evaluation(board2);\r\n	}\r\n	// \r\n	for(int i(0); i < 8; i++)\r\n        for(int j(0); j < 8; j++)\r\n                if(Legal(i, j, flag))\r\n                {\r\n                    make_move(i,j,flag,boardtemp);\r\n                    // \r\n					int value = -alpha_beta(-beta, -alpha, depth+1, 0);\r\n					// \r\n					unmake_move(boardtemp);\r\n					// \r\n					if (value >= beta) \r\n					{\r\n					// \r\n					return value;\r\n					}\r\n						// \r\n					if (value > best_value)\r\n					{\r\n						// \r\n						best_value = value;\r\n						// \r\n						if (value > alpha) \r\n						{\r\n							alpha = value;\r\n						}\r\n					}\r\n					key = 0;\r\n				}\r\n	// \r\n	if (key)\r\n	 {\r\n		// \r\n		if (pass) \r\n		{\r\n			// \r\n			return get_exact();\r\n		}\r\n		CopyToBoardTemp(boardtemp);\r\n		// \r\n		best_value = -alpha_beta(-beta, -alpha, depth+1, 1);\r\n		// \r\n		unmake_move(boardtemp);\r\n	}\r\n	// \r\n	return best_value;\r\n}\r\n\r\nint main()\r\n{\r\n    int Total = 0;\r\n    for(int i(0); i < 8; i++)                              // \r\n        for(int j(0); j < 8; j++)\r\n            {\r\n                scanf(\"%d\", &board[i][j]);\r\n                if(board[i][j] != 0)Total++;\r\n            }\r\n    CopyBoard();\r\n    int xans(0),yans(0),flag(1),bestvalue(-100000),depth(1),value(-100000);\r\n	\r\n    for(int i(0); i < 8; i++)\r\n        for(int j(0); j < 8; j++)\r\n                if(Legal(i, j, flag))\r\n                {\r\n                	int boardtemp[8][8] = {{0}};\r\n                	make_move(i,j,flag,boardtemp);\r\n                	value =  -alpha_beta(-100000,100000,depth+1,0);\r\n                	unmake_move(boardtemp);\r\n                	if(value > bestvalue)\r\n                	{\r\n                		xans = i; yans = j; bestvalue = value ;\r\n                	}\r\n                }\r\n    printf(\"%d %d\",xans,yans);\r\n	// \r\n}\r\n	','compile correct','g++','othello','2013-06-28 19:42:09','');
INSERT INTO task VALUES (586,'zym','//AI\r\n//****\r\n\r\n#include <stdio.h>\r\n\r\nint board[8][8] = {0};\r\nint grade[8][8]={{100,-100,50,0,0,50,-100,100},\r\n                     {-100,-100,10,20,20,10,-100,-100},\r\n                     {50,10,30,30,30,30,10,50},\r\n                     {0,20,30,30,30,30,20,0},\r\n                     {0,20,30,30,30,30,20,0},\r\n                     {50,10,30,30,30,30,10,50},\r\n                     {-100,-100,10,30,30,10,-100,-100},\r\n                     {100,-100,50,0,0,50,-100,100}\r\n                     };\r\n/* (x,y),xoffest,yoffset(x,y)*/\r\nint legalDirect(int x, int y, int xoffest, int yoffset, int flag)\r\n{\r\n	x += xoffest;\r\n	y += yoffset;\r\n	if (x < 0 || x >= 8 || y < 0 || y >= 8)// \r\n	{\r\n		return 0;\r\n	}\r\n	if (board[x][y] == 2)\r\n	{\r\n		/* (x,y),\r\n		*  ,\r\n		*/\r\n		flag = 1;\r\n		return legalDirect(x, y, xoffest, yoffset, flag);\r\n	}\r\n	else if (board[x][y] == 1)\r\n	{\r\n		/* , legal=1*/\r\n		if (flag == 1)\r\n		{\r\n			return 1;\r\n		}\r\n		return 0;\r\n	}\r\n	else\r\n		return 0;\r\n\r\n	return 0;\r\n}\r\n\r\n/* , 0, 1*/\r\nint legal(int x, int y)\r\n{\r\n	if (board[x][y]!=0)// \r\n		return 0;\r\n	int i, j, flag;\r\n	/* (x,y)*/\r\n	for (i = -1; i <= 1; i++)\r\n	{\r\n		for (j = -1; j <= 1; j++)\r\n		{\r\n			if (i == 0 && j == 0)// (x,y)\r\n			{\r\n				continue;\r\n			}\r\n			flag = 0;\r\n			if (legalDirect(x, y, i, j, flag))\r\n			{\r\n				return 1;\r\n			}\r\n		}\r\n	}\r\n	return 0;\r\n}\r\n\r\nint legalDirect2(int x, int y, int xoffest, int yoffset, int flag)\r\n{\r\n	x += xoffest;\r\n	y += yoffset;\r\n	if (x < 0 || x >= 8 || y < 0 || y >= 8)// \r\n	{\r\n		return 0;\r\n	}\r\n	if (board[x][y] == 1)\r\n	{\r\n		/* (x,y),\r\n		*  ,\r\n		*/\r\n		flag = 1;\r\n		return legalDirect(x, y, xoffest, yoffset, flag);\r\n	}\r\n	else if (board[x][y] == 2)\r\n	{\r\n		/* , legal=1*/\r\n		if (flag == 1)\r\n		{\r\n			return 1;\r\n		}\r\n		return 0;\r\n	}\r\n	else\r\n		return 0;\r\n\r\n	return 0;\r\n}\r\n\r\n/* , 0, 1*/\r\nint legal2(int x, int y)\r\n{\r\n	if (board[x][y]!=0)// \r\n		return 0;\r\n	int i, j, flag;\r\n	/* (x,y)*/\r\n	for (i = -1; i <= 1; i++)\r\n	{\r\n		for (j = -1; j <= 1; j++)\r\n		{\r\n			if (i == 0 && j == 0)// (x,y)\r\n			{\r\n				continue;\r\n			}\r\n			flag = 0;\r\n			if (legalDirect(x, y, i, j, flag))\r\n			{\r\n				return 1;\r\n			}\r\n		}\r\n	}\r\n	return 0;\r\n}\r\n int min1(int i,int j){\r\n   int a;\r\n   board[i][j]=1;\r\n   a=-200;\r\n   int i0,j0;\r\n   	for(j0=0;j0<8;j0++)\r\n		for(i0=0;i0<8;i0++)\r\n		{\r\n			if(legal2(i0,j0))\r\n			{\r\n                 if(a<grade[i0][j0]) a=grade[i0][j0];\r\n			}\r\n		}\r\n	board[i][j]=0;\r\n	return a;\r\n}\r\n int main()\r\n{\r\n    int i =0;\r\n	int j =0;\r\n	\r\n	for(i=0;i<8;i++)\r\n		for(j=0;j<8;j++)\r\n		{\r\n		scanf(\"%d\",&board[i][j]);\r\n		}\r\n	int max,min;\r\n	max=-200;\r\n	min=200;\r\n    int k,l,min0; \r\n	for(j=0;j<8;j++)\r\n		for(i=0;i<8;i++)\r\n		{\r\n			if(legal(i,j))\r\n			{\r\n                 if(grade[i][j]==100) goto OUT;\r\n                 min0=min1(i,j);\r\n                 if(min0==100&&max!=-200) continue;\r\n                 if(grade[i][j]>max){k=i;l=j;min=min0;}\r\n                 else if(grade[i][j]==max){\r\n                      if(min0<min){k=i;l=j;min=min0;}\r\n                 }\r\n			}\r\n		}\r\nOUT:printf(\"%d %d\\n\",k,l);\r\n	return 1;\r\n}\r\n','compile correct','gcc','othello','2013-06-29 12:11:59','');
INSERT INTO task VALUES (603,'xuzhenbo','#include <stdio.h>\r\n#include <math.h>\r\n#include <string.h>\r\n#include <time.h>\r\n#define LEN 10\r\nint myb [LEN][LEN]={0};\r\nint tb [LEN][LEN] ={0};//privat\r\nint youb[LEN][LEN]={0};\r\nint judge_spe1 (int i,int j);//,restore_p\r\nint judge_spe2 (int i,int j);//,restore_p\r\nint restore_p (int i,int j);\r\nint legal (int i,int j,int b[][LEN]);//\r\nint pro_point (int i,int j,int b[][LEN],int num,int y_sum);//,\r\nint in (int i,int j){return (i>=1&&i<=8)&&(j>=1&&j<=8);}\r\nint side1 (int i,int j,int b[][LEN]);\r\nint side2 (int i,int j,int b[][LEN]);//\r\n//100200\r\nint privat (int i,int j,int b[][LEN]);//4100.\r\nint isside (int i,int j){return (i==1)||(i==8)||(j==1)||(j==8);}//\r\nint cornor(int i,int j);\r\nint iscornor(int i,int j){return ((i==1)||(i==8))&&((j==1)||(j==8));}\r\nint cornor(int i,int j)\r\n{\r\n	if(i<=2)\r\n	{\r\n		if(j<=2)return myb[1][1];\r\n		else if(j>=7)return myb[1][8];\r\n	}\r\n	else if(i>=7)\r\n	{\r\n		if(j<=2)return myb[8][1];\r\n		else if(j>=7)return myb[8][8];\r\n	}\r\n}\r\nint side1 (int i,int j,int b[][LEN])\r\n{\r\n	if(b[i][j-1]==2&&b[i][j+1]==2)return 200;\r\n	else if((b[i][j-1]==2&&b[i][j+1]==0)||(b[i][j+1]==2&&b[i][j-1]==0))return -150;\r\n	else\r\n		return 0;\r\n}\r\nint side2 (int i,int j,int b[][LEN])\r\n{\r\n	if(b[i-1][j]==2&&b[i+1][j]==2)return 100;\r\n	else if((b[i-1][j]==2&&b[i+1][j]==0)||(b[i+1][j]==2&&b[i-1][j]==0))return -150;\r\n	else\r\n		return 0;\r\n}\r\nint privat (int i,int j,int b[][LEN],int ti,int tj,int side)\r\n{\r\n	int ti1=i+ti,tj1=j+tj,state=0,count=1;\r\n	while(in(ti1,tj1))\r\n	{\r\n		if(b[ti1][tj1]==1)count++;\r\n		if(b[ti1][tj1]==2)state++;\r\n		ti1+=ti;\r\n	    tj1+=tj;\r\n	}\r\n	if((state==0)&&(count>=(side==1? 3:5)))return 1;\r\n	ti1=i-ti,tj1=j-tj;count=1;state=0;\r\n    while((in(ti1,tj1)))\r\n	{\r\n		if(b[ti1][tj1]==1)count++;\r\n		if(b[ti1][tj1]==2)state++;\r\n		ti1-=ti;\r\n	    tj1-=tj;\r\n	}\r\n	if((state==0)&&(count>=(side==1? 3:5)))return 1;\r\n/*	for(ii=1;ii<=8;ii++)\r\n	{\r\n		if(b[ii][j]==1&&b[ii-1][j]==1)count_c++;\r\n		if(b[ii][j]==2)state_c=1;\r\n		if(b[i][ii]==1&&b[i][ii-1]==1)count_r++;\r\n		if(b[i][ii]==2)state_r=1;\r\n	}\r\n*/\r\n	return 0;\r\n}\r\nint judge_spe2 (int i,int j)\r\n{\r\n	if(((i==3)||(i==6))&&((j==1)||(j==2)||(j==3)||(j==6)||(j==7)||(j==8)))return 1;\r\n	else if(((i==1)||(i==2)||(i==7)||(i==8))&&((j==3)||(j==6)))return 1;\r\n	else \r\n		return 0;\r\n}\r\n\r\nint judge_spe1 (int i,int j)\r\n{\r\n	if((i==1||i==8)&&(j==2)||(j==7))return 1;\r\n	else if(((i==2)||(i==7))&&((j==1)||(j==2)||(j==7)||(j==8)))return 1;\r\n	else\r\n		return 0;\r\n}\r\n\r\nint restore_p (int i,int j)//100050.\r\n{\r\n	if(iscornor(i,j))return 2000;\r\n	else if(judge_spe1(i,j)&&cornor(i,j)!=1)return -1000;\r\n	else if(judge_spe2(i,j)&&cornor(i,j)!=1)return 50;\r\n	else\r\n		return 0;\r\n}\r\nint main()\r\n{\r\n	int i =0,j =0;\r\n//	int t1, t2;\r\n	int t, Max, Mi, Mj, sum,num,y_sum;//y_sum\r\n	Max = -10000;\r\n\r\n //freopen(\"in.txt\", \"r\", stdin);\r\n//t1=clock();\r\n    sum=0;y_sum=0;\r\n	for(i=1;i<=8;i++)\r\n		for(j=1;j<=8;j++)\r\n		{\r\n            scanf(\"%d\",&myb[i][j]);\r\n			tb[i][j]=myb[i][j];\r\n            if (myb[i][j]) sum++;\r\n			if (myb[i][j]==2)y_sum++;\r\n		}\r\n\r\n	for(j=1;j<=8;j++)\r\n		for(i=1;i<=8;i++)\r\n		{\r\n			if(num=legal(i,j, myb))\r\n			{\r\n			   // printf (\":::%d %d\\n\", i-1, j-1);\r\n				if(sum<=58&&sum>=10)\r\n				    t = pro_point(i,j,myb,num,y_sum);\r\n				else if(sum>58||sum<10)\r\n				{\r\n					t = 10*num;\r\n					if(judge_spe1(i,j))t-=1000;\r\n					if(iscornor(i,j))t+=1000;\r\n				}\r\n//				if(i==2&&j==7)printf(\"*%d\\n\",t);\r\n				if (t>=Max)\r\n				{Max=t; Mi=i; Mj=j; }\r\n			}\r\n		}\r\n    printf(\"%d %d\\n\", Mi-1, Mj-1);\r\n//	printf(\"%d\\n\",Max);\r\n    /*t2=clock();\r\n    printf(\"%d\\n\", t2);*/\r\n    return 0;\r\n}\r\n\r\nint legal (int i,int j,int b[][LEN])\r\n{\r\n	if(b[i][j])return 0;\r\n	int ii,jj;\r\n	int t_r,t_c;\r\n	int count,state;\r\n	int sum=0;\r\n	tb[i][j]=1;\r\n	for(ii=1;ii<=8;ii++)//tb\r\n		for(jj=1;jj<=8;jj++)\r\n			tb[ii][jj]=b[ii][jj];\r\n	for(ii =-1;ii <=1;ii ++)\r\n		for(jj =-1;jj <=1;jj ++)\r\n		{\r\n			count =0;\r\n			state =0;\r\n			if(ii==0&&jj==0)continue;\r\n			else{				\r\n				for(t_r =i+ii,t_c = j+jj;in(t_r,t_c);t_r =t_r+ii,t_c = t_c+jj)\r\n				{\r\n					if(b[t_r][t_c]==2){state=1;tb[t_r][t_c]=1;count++;}\r\n					else if(b[t_r][t_c]==0)break;\r\n					else if(b[t_r][t_c]==1)\r\n					{\r\n						if(state==1)\r\n							sum+=count;\r\n						break;\r\n					}\r\n				}\r\n			}\r\n		}\r\n    return sum;\r\n}\r\n\r\nint nonchance(int t,int b[][LEN],int tb [][LEN])\r\n{\r\n	int ii,jj,state=0;\r\n	if(t==-1)\r\n	{\r\n		for(ii=1,jj=1;in(ii,jj);ii++,jj++)\r\n			if(tb[ii][jj]==1)state++;\r\n	}\r\n	else if(t==1)\r\n	{\r\n		for(ii=1,jj=8;in(ii,jj);ii++,jj--)\r\n			if(tb[ii][jj]==1)state++;\r\n	}\r\n	if(state==0)return 1;\r\n	else return 0;\r\n}\r\nint ispriv_midd(int tb1[][LEN])\r\n{\r\n	int ii=0,jj=0,state=0,count=0,sign,t;\r\n    while(in(++ii,++jj))\r\n	{\r\n        if(tb1[ii][jj]==2)state++;\r\n		if(tb1[ii-1][jj-1]==0&&tb1[ii][jj]==1)\r\n		{\r\n			sign=1;\r\n			count=1;\r\n		}\r\n		if(tb1[ii][jj]==0)\r\n		{\r\n			sign=0;\r\n			if(count>=5)\r\n				t++;\r\n		}\r\n		if(sign=1&&tb1[ii][jj]==1)count++;\r\n	}\r\n	if(t&&state==0)return 1;\r\n\r\n	ii=9,jj=0,state=0,count=0,sign,t;\r\n    while(in(--ii,++jj))\r\n	{\r\n        if(tb1[ii][jj]==2)state++;\r\n		if(tb1[ii+1][jj-1]==0&&tb1[ii][jj]==1)\r\n		{\r\n			sign=1;\r\n			count=1;\r\n		}\r\n		if(tb1[ii][jj]==0)\r\n		{\r\n			sign=0;\r\n			if(count>=5)\r\n				t++;\r\n		}\r\n		if(sign=1&&tb1[ii][jj]==1)count++;\r\n	}\r\n	if(t&&state==0)return -1;\r\n	return 0;\r\n}\r\nint pro_point (int i,int j,int b[][LEN],int num_me,int y_sum)\r\n{\r\n	int ii,jj,num_him;\r\n	double proportion=num_me/y_sum;\r\n	int point =0;\r\n	point += restore_p(i,j);//\r\n	point += int(200 * proportion);\r\n	if(i==1||i==8) point += 100+ side1 (i,j,tb);//\r\n	else if(j==1||j==8)point += 100+ side2 (i,j,tb);//\r\n	if((privat(i,j,tb,1,0,1)||privat(i,j,tb,0,1,1))&&isside(i,j)) point += 400;//tbmyb//isside\r\n	//(tbyoub[i][j])(50)\r\n	for(ii=1;ii<=8;ii++)\r\n		for(jj=1;jj<=8;jj++)\r\n		{\r\n			if(tb[ii][jj])youb[ii][jj] = 3 - tb[ii][jj];\r\n			else\r\n				youb[ii][jj]=0;\r\n		}\r\n	int t1=0,t2=0,t3=0,max=0,t4=0,angle;\r\n\r\n	if(angle=ispriv_midd(tb))point += 400;//tb\r\n\r\n	for(ii=1;ii<=8;ii++)\r\n		for(jj=1;jj<=8;jj++)\r\n		{\r\n			if(num_him=legal(ii,jj, youb))\r\n			{//legaltb\r\n			if(num_him>max)\r\n			{\r\n				max=num_him;\r\n			}\r\n			max=num_him;\r\n			if(ii==1||ii==8)\r\n			    t1+=privat(ii,jj,tb,0,1,1);//\r\n			else if(jj==1||jj==8)\r\n				t1+=privat(ii,jj,tb,1,0,1);\r\n			t2 +=isside(ii,jj);//\r\n			t3 += (ii==1||ii==8)&&(jj==1||jj==8);//\r\n			t4 +=(angle)&&nonchance(angle,youb,tb);//nonchance5250\r\n			}\r\n		}\r\n	if(max>num_me)point -= 50;\r\n	if(t1)point -= 400;\r\n	if(t2)point -= 50;\r\n    if(t3)point -= 1000;\r\n	if(t4)point += 1200;\r\n	return point;\r\n}','compile correct','gcc','othello','2013-06-30 15:12:02','');
INSERT INTO task VALUES (605,'jerrytest3','#include<cstdio>\r\nusing namespace std;\r\n\r\n//boardboard2\r\n\r\n\r\nint board[8][8] = {{0}} , board2[8][8] = {{0}} ;                 //board2board\r\nint DirectNumTemp = 0;                 // xy\r\nconst int DEPTH = 7;                   // \r\nconst int First =40 ;\r\n\r\nvoid Print()\r\n{\r\n	for(int i(0); i < 8; i++)\r\n	{\r\n		for(int j(0); j < 8; j++)\r\n    	{		\r\n    		printf(\"%d\",board2[i][j]);\r\n 		}\r\n		printf(\"\\n\");\r\n	}\r\n	printf(\"\\n\");\r\n}\r\n\r\n//boardboard2\r\nvoid CopyBoard()                                                 \r\n{\r\n    for(int i(0); i < 8; i++)\r\n        for(int j(0); j < 8; j++)\r\n            board2[i][j] = board[i][j];\r\n}\r\n\r\nvoid CopyToBoardTemp(int boardtemp[8][8])                                                 \r\n{\r\n    for(int i(0); i < 8; i++)\r\n        for(int j(0); j < 8; j++)\r\n            boardtemp[i][j] = board2[i][j];\r\n}\r\n\r\n//(x,y)i,j \r\nbool LegalDirect(int x, int y, int i, int j, int flag , int &DirectNumTemp)             \r\n{\r\n    // DirectNumTemp?\r\n    x += i;\r\n    y += j;\r\n\r\n    if (x < 0 || x > 7 || y < 0 || y > 7)                        // \r\n        return 0;\r\n\r\n    int flagtemp;\r\n    if(board2[x][y] == 2)flagtemp = 0;                         //\r\n    else if(board2[x][y] == 1)flagtemp = 1;\r\n    else return 0;										// ,\r\n\r\n    if(flag == flagtemp && DirectNumTemp != 0)return 1;    //\r\n\r\n    else if (flagtemp != flag )\r\n        {\r\n            DirectNumTemp ++;              //\r\n            /* (x,y),\r\n            *  ,\r\n            */\r\n            return LegalDirect(x, y, i, j, flag, DirectNumTemp);\r\n        }\r\n    return 0;\r\n}\r\n\r\n//(x,y)(i,j)\r\nbool Legal(int x, int y, int flag)                                \r\n{\r\n    //DirectNum[i][j];     \r\n    if (board2[x][y] != 0)                              // \r\n        return 0;\r\n    int i, j;\r\n\r\n    for (i = -1; i <= 1; i++)                          // (x,y)\r\n        {\r\n            for (j = -1; j <= 1; j++)\r\n                {\r\n                    if (i == 0 && j == 0)                      // (x,y)\r\n                        {\r\n                            continue;\r\n                        }\r\n                    if (LegalDirect(x, y, i, j, flag, DirectNumTemp))\r\n                        {\r\n                        	DirectNumTemp = 0;                          //\r\n                            return 1;\r\n                        }\r\n                    DirectNumTemp = 0;                          //\r\n                }\r\n        }\r\n    return 0;\r\n}\r\n\r\n// xyboard1 \r\nvoid make_move(int x , int y, int flag,int boardtemp[][8])                           \r\n{\r\n	CopyToBoardTemp(boardtemp);\r\n    int i, j,temp1= ((flag==0) ?2:1 );\r\n    board2[x][y] = temp1;\r\n    for (i = -1; i <= 1; i++)                          // (x,y)\r\n        {\r\n            for (j = -1; j <= 1; j++)\r\n                {\r\n                    if (i == 0 && j == 0)                      // (x,y)\r\n                        continue;\r\n                    if ( LegalDirect(x, y, i, j, flag, DirectNumTemp)) //\r\n					{\r\n						for(int k(0); k < DirectNumTemp + 1; k++)\r\n                            board2[x + i * k][y + j * k] = temp1 ; // \r\n					}           \r\n                    DirectNumTemp = 0;\r\n                }\r\n        }\r\n}\r\n\r\n\r\nvoid unmake_move(int boardtemp[8][8])                                                 \r\n{\r\n    for(int i(0); i < 8; i++)\r\n        for(int j(0); j < 8; j++)\r\n            board2[i][j] = boardtemp[i][j];\r\n}\r\n\r\n\r\nbool isConner(int x ,int y)                           // \r\n{\r\n	if(x==0&&y==0)return 1;\r\n	else if(x==0&&y==7)return 1;\r\n	else if(x==7&&y==0)return 1;\r\n	else if(x==7&&y==7)return 1;\r\n	return 0; \r\n}\r\n\r\nbool is1BesideConner(int x ,int y)                   //412 \r\n{\r\n	if(x==0||x==7)\r\n		if(y==1||y==6)return 1;\r\n	if(x==1||x==6)\r\n		if(y==0||y==1||y==6||y==7)return 1;\r\n	return 0;\r\n}\r\n\r\nbool is2BesideConner(int x ,int y)                   //416 \r\n{\r\n	if(y==5||y==2)\r\n		if(x==1||x==0||x==6||x==7)return 1;\r\n	if(x==5||x==2)\r\n			if(y==1||y==0||y==6||y==7)return 1;\r\n	if((x==2&&y==2 )||( x==2&&y==5 )||( x==5&&y==5 )|| (x==5&&y==2) )return 1;\r\n	\r\n	return 0;\r\n} \r\n\r\nbool isSide(int x ,int y)\r\n{\r\n	if(x == 0 || x == 7)\r\n		if(y == 3 || y == 4)return 1;\r\n	if(y == 0 || y == 7)\r\n		if(x == 3 || x == 4)return 1;\r\n	return 0;\r\n}\r\n\r\nint CanGoNum (int flag)                     //xy \r\n{\r\n	int w=0;\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0); j<8; j++)\r\n			if(Legal(i,j,flag))w++;                           \r\n	return w;\r\n}\r\n\r\n\r\nint evaluation(int board2[8][8])\r\n{\r\n	int value(0), Total(0), White(0), Black(0), Conner(0);\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0);j<8; j++)\r\n		{\r\n			if(board2[i][j]==2)White++;\r\n			else if(board2[i][j]==1)Black++;\r\n		}\r\n	Total = Black + White ;\r\n	if(Total == 64)\r\n	{\r\n		if(Black > White)return 100000;\r\n		else return -100000;\r\n	}\r\n	if(Black < 6)value = -10000;\r\n	for(int i(0); i<8; i++)\r\n	for(int j(0); j<8; j++)\r\n	{\r\n		if(board2[i][j]==0)continue;\r\n		if(isConner(i,j))\r\n		{\r\n			if(board2[i][j]==1)value+=500;\r\n			else value-=500;\r\n			Conner++;\r\n		}\r\n		if(is1BesideConner(i,j))\r\n		{\r\n			if(board2[i][j]==1)value-=300;\r\n			else value+=300;\r\n		}\r\n		if(is2BesideConner(i,j))\r\n		{\r\n			if(board2[i][j]==1)value+=30;\r\n			else value-=30;\r\n		}\r\n		if( isSide(i,j) )\r\n		{\r\n			if(board2[i][j]==2)value+=30;\r\n			else value-=10;\r\n		}\r\n	}\r\n	if(Conner>1)\r\n	{\r\n		value += Black*20;\r\n		value -= White*20;\r\n	}\r\n	else if(Total > First)\r\n	{\r\n		value -= Black*20;\r\n		value += White*20;\r\n	}\r\n	value -= CanGoNum(1)*20; \r\n	//cout << \"evaluation\" << value << endl;\r\n	return value;\r\n}\r\n\r\n\r\nint get_exact()\r\n{\r\n	int value(0), White(0), Black(0);\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0);j<8; j++)\r\n		{\r\n			if(board2[i][j]==2)White++;\r\n			else if(board2[i][j]==1)Black++;\r\n		}\r\n	for(int i(0); i<8; i++)\r\n		for(int j(0);j<8; j++)\r\n			if(board2[i][j]==2){\r\n				value+=Black;\r\n				value-=White;\r\n			}\r\n//	cout << \"get_exact\" << value << endl;\r\n	return value;\r\n}\r\n\r\nint alpha_beta(int alpha, int beta, int depth, int pass)\r\n{\r\n	int boardtemp[8][8] = {{0}};\r\n	int flag(0);\r\n	bool key (1);\r\n	if(depth % 2 == 1)flag = 1;\r\n	// \r\n	int best_value = -10000000;\r\n	// \r\n	if (depth == DEPTH) {\r\n		// \r\n		return evaluation(board2);\r\n	}\r\n	// \r\n	for(int i(0); i < 8; i++)\r\n        for(int j(0); j < 8; j++)\r\n                if(Legal(i, j, flag))\r\n                {\r\n                    make_move(i,j,flag,boardtemp);\r\n                    // \r\n					int value = -alpha_beta(-beta, -alpha, depth+1, 0);\r\n					// \r\n					unmake_move(boardtemp);\r\n					// \r\n					if (value >= beta) \r\n					{\r\n					// \r\n					return value;\r\n					}\r\n						// \r\n					if (value > best_value)\r\n					{\r\n						// \r\n						best_value = value;\r\n						// \r\n						if (value > alpha) \r\n						{\r\n							alpha = value;\r\n						}\r\n					}\r\n					key = 0;\r\n				}\r\n	// \r\n	if (key)\r\n	 {\r\n		// \r\n		if (pass) \r\n		{\r\n			// \r\n			return get_exact();\r\n		}\r\n		CopyToBoardTemp(boardtemp);\r\n		// \r\n		best_value = -alpha_beta(-beta, -alpha, depth+1, 1);\r\n		// \r\n		unmake_move(boardtemp);\r\n	}\r\n	// \r\n	return best_value;\r\n}\r\n\r\nint main()\r\n{\r\n//	freopen(\"in\",\"r\",stdin);\r\n//	freopen(\"out\",\"w\",stdout);\r\n    int Total = 0;\r\n    for(int i(0); i < 8; i++)                              // \r\n        for(int j(0); j < 8; j++)\r\n            {\r\n                scanf(\"%d\", &board[i][j]);\r\n                if(board[i][j] != 0)Total++;\r\n            }\r\n    CopyBoard();\r\n    int xans(0),yans(0),flag(1),bestvalue(-100000),depth(1),value(-100000);\r\n	\r\n    for(int i(0); i < 8; i++)\r\n        for(int j(0); j < 8; j++)\r\n                if(Legal(i, j, flag))\r\n                {\r\n                	int boardtemp[8][8] = {{0}};\r\n                	make_move(i,j,flag,boardtemp);\r\n                	value =  -alpha_beta(-100000,100000,depth+1,0);\r\n                	unmake_move(boardtemp);\r\n                	if(value > bestvalue)\r\n                	{\r\n                		xans = i; yans = j; bestvalue = value ;\r\n                	}\r\n                }\r\n    printf(\"%d %d\",xans,yans);\r\n	// \r\n//	fclose(stdin);\r\n//	fclose(stdout);\r\n}\r\n	','compile correct','g++','othello','2013-07-01 13:20:18','');
